tive powers of ten.  Everything is excellent.  Keep it up!  \r\nSincerely, Ms. Ashby'),(2705,16,NULL,2,'2011-12-13 06:08:34','2011-12-15 15:27:22','Sem1','Ezana has worked steadily this quarter and improved a few of his benchmarks.  He is very strong in addition, subtraction and division of decimals but needs to practice his division.  A very important skill but not a favorite to practice. However, this is a basic fundamental operation that needs to be mastered before 7th grade.  I was really impressed with Ezana\'s understanding of fractions thus far.  Keep working hard.  \r\nSincerely,\r\nMs. Ashby '),(2706,657,NULL,2,'2011-12-13 06:12:43','2011-12-15 15:31:11','Sem1','I am very stingy with 6\'s and 7\'s and so for Felicity to have earned two means she has a very good understanding of how to do and when to use.  Her practical application of math and her logic, is excellent.  This comes handy in math contests and so I would love to see her participate in upcoming contests.  Keep up the steady, good work Felicity.\r\nSincerely,\r\nMs. Ashby'),(2707,241,NULL,2,'2011-12-13 06:21:32','2011-12-15 15:36:51','Sem1','Hanna has done a great job with all the benchmarks we learned this semester.  She shows a good understanding and good mathematical sense.  The next step is to apply these math skills, where needed, to real-life problem solving.  The \"Exceed the Standards\" type questions.  One way to get some good practice with that is through practice and participating in math contests.  This might take Hanna out of her comfort zone for a little bit, but that is part of \'taking it to the next level\'.  Overall well done.\r\nSincerely, Ms. Ashby'),(2708,351,NULL,5,'2011-12-13 06:25:09','2011-12-15 15:43:41','Sem1','I appreciate that my lessons might not engage Jared to the degree he would like.  I take that as good feedback to improve my practice.  However, Jared must be willing to come halfway and be prepared to do some \'activities\' that might not be to his liking.  He shows good understanding of all the benchmarks except for division with decimals.  He ran out of energy to finish the re-do problem.  Perhaps finding a division \'video\' game might helps with the quick facts and make the whole process a little less energy intensive.  Overall, good work Jared.\r\nSincerely, Ms. Ashby'),(2709,251,NULL,2,'2011-12-13 06:28:20','2011-12-15 15:46:00','Sem1','Joshua has done a great job this quarter not only working hard, but also participating in a math contest.  I appreciate the work that he and his mom do together at home.  Only two area need a little more practice.  The other benchmarks are very solid.  Well done Josh.  Keep working hard in Semester 2. \r\nSincerely, Ms. Ashby'),(2710,278,NULL,2,'2011-12-13 06:31:28','2011-12-15 15:50:02','Sem1','Lara has done a great job this quarter and really improved in her math confidence!  As you can see, she is solid in the majority of the benchmarks.  She takes in feedback, learns from her mistakes and then improves from there!  In short, an excellent student.  Keep up the hard work in Semester 2. \r\nSincerely, Ms. Ashby'),(2711,137,NULL,2,'2011-12-13 06:34:49','2011-12-15 15:54:50','Sem1','Maria has improved in many of her benchmarks over the course of the semester.  Though a very good math student, she still seems hesitant and nervous.  I would like to help her improve her confidence by having her try more challenging problems, in a safe environment.  I am still not sure what exactly that will be - but I am thinking about it.  I appreciate Maria\'s hard working nature and dependability.\r\nSincerely, Ms. Ashby \r\n'),(2712,525,NULL,1,'2011-12-13 06:37:00','2011-12-15 15:59:45','Sem1','Nanseera has worked really hard this semester and it has paid off in great results.  She shows solid understanding of the benchmarks.  I would like to apply that to the next level of solving practical word problems where decisions about what to do are not made for you.  Math contest problems, though scary at times, are good practice and build the confidence. Be ready for those next semester.  Overall, well done, great work. \r\nSincerely,  Ms. Ashby'),(2713,194,NULL,4,'2011-12-13 06:39:41','2011-12-15 16:06:55','Sem1','Nkotseng has improved in many benchmarks and shows a good understanding of graphs and decimal operations.  However, I feel that her areas of weakness can be improved simply by practice and focus on those skills.  \r\nSincerely, Ms. Ashby'),(2714,407,NULL,4,'2011-12-13 06:41:56','2011-12-15 16:10:42','Sem1','Patience has improved her focus and organization skills during the second quarter.  There were less missed homework assignments-definitely.  Her basic understanding of the math benchmarks is good. The next step is applying these to open ended practical word problems.  I look forward to challenging Patience with such problems and hope she will accept that challenge.  \r\nSincerely, Ms. Ashby'),(2715,30,NULL,1,'2011-12-13 06:44:03','2011-12-15 16:15:22','Sem1','Rekik has done an excellent job in the second quarter and really brought up her level of thinking and application in math. She did an outstanding job in the \"Exceeds the Standard\' (optional) question at the end of the UNIT 2 test.  As a result, she received 6\'s in those areas.  I would like to see Rekik practicing some math contest type questions to have her continue to do this type of problem solving. \r\nKeep working hard in Semester 2 Rekik!\r\nSincerely, Ms. Ashby'),(2716,443,NULL,2,'2011-12-13 06:46:27','2011-12-15 16:20:47','Sem1','Ruhama has shown very good progress in her Semester 1 benchmarks.  She is solid in all areas.  The next step is applying those skills to practical problems (open ended word problems).  I really like Ruhama\'s positive, hard working attitude and would like to see that grow into confidence as well.  Keep up the great work Ruhama.\r\nSincerely, Ms. Ashby\r\n'),(2717,493,NULL,2,'2011-12-13 06:48:44','2011-12-15 16:28:34','Sem1','Samuel has done a really great job in math this semester.  He is very responsive to feedback and learns from his mistakes, which are great student qualities.  Since we are still working on Unit 4, I am not worried about that 3 for comparing fractions.  Keep working hard Samuel!  Good job.\r\nSincerely, Ms. Ashby'),(2718,435,NULL,4,'2011-12-13 06:50:48','2011-12-15 16:32:18','Sem1','Sean has a very solid understanding of the basic operations in decimals and is good at interpreting graphs.  He has a very logical and practical brain.  If he applies that brain power to mathematics, he can be as successful as he chooses.  As with all things, it does require work.  Good luck in your next school Sean!  \r\nSincerely, Ms. Ashby '),(2719,359,NULL,2,'2011-12-13 06:53:08','2011-12-15 16:38:39','Sem1','Shakaa has done a solid job of the benchmarks for Semester 1.  However, I still feel like he is not up to his top level yet.  I appreciate his participation in the November math contest and would like to continue to have him work on those math contest type questions to bring up his \'game\' to the next level.  Keep working hard Shakaa.  Be ready for some challenges. \r\nSincerely, Ms. Ashby'),(2720,371,NULL,4,'2011-12-13 06:56:01','2011-12-15 16:42:57','Sem1','Sidney has done a good job on all the learning objectives.  He has quite good number sense really.  I feel like he is just cruising along without a lot of focus or intent.  I would like to see him working purposefully during class.  I am not sure if this is a confidence issue or a boredom issue.  I think he is ready to be challenged more, but I am not sure if he will take the challenge on.  Looking for a way to inspire him.  Suggestions welcome.  \r\nSincerely, Ms. Ashby'),(2721,94,NULL,1,'2011-12-13 06:58:30','2011-12-15 16:51:34','Sem1','Wedu has done a great job with all the benchmarks we learned this semester.  She shows a good understanding and good mathematical sense.  The next step is to apply these math skills, where needed, to real-life problem solving.  The \"Exceed the Standards\" type questions.  One way to get some good practice with that is through more math contest type questions. \r\nOverall well done.  I appreciate all your hard work!\r\nSincerely, Ms. Ashby'),(2722,718,NULL,1,'2011-12-13 07:30:02','2011-12-16 07:23:57','Sem1','Aisha is an excellent student. She participates well in class.She is always focused and on task. She asks most of her questions in French. I encourage her to keep up the good work. \r\nSincerely yours, \r\nMr. Goliad Tamerou'),(2723,753,NULL,1,'2011-12-13 07:34:19','2011-12-13 11:49:05','Sem1','Layan is a very good student. She is always focused and on task. Leya has made an effort to participate more in class during this quarter. I encourage her to keep up the good work. \r\n\r\nSincerely yours,\r\n\r\nMr. Goliad Tamerou'),(2724,563,NULL,2,'2011-12-13 07:34:43','2011-12-16 06:51:59','Sem1','Abigail has worked hard to improve her math skills.  She ask questions, does corrections and does redo test to improve her understanding.  These are all qualities of a good student.  Keep working hard Abigail.  Sincerely, Ms. Ashby'),(2725,2438,1,1,'2011-12-13 07:37:07','2011-12-13 07:37:07','Sem1',''),(2726,2802,4,2,'2011-12-13 07:37:17','2011-12-13 07:37:17','Sem1',''),(2727,1914,2,2,'2011-12-13 07:37:37','2011-12-13 07:37:37','Sem1',''),(2728,55,NULL,1,'2011-12-13 07:37:41','2011-12-16 06:55:11','Sem1','Aida has worked really hard both inside and outside of class to complete all her assignments in math.  She shows excellent understanding of almost all the math concepts, save number and word notation which we can review together.  I appreciate her focused attitude in class and her willingness to try challenge problems (eg. math counts questions).  Keep working hard Aida. '),(2729,2769,3,4,'2011-12-13 07:38:04','2011-12-13 07:38:04','Sem1',''),(2730,1842,3,2,'2011-12-13 07:38:17','2011-12-13 07:38:17','Sem1',''),(2731,2020,2,1,'2011-12-13 07:38:30','2011-12-13 07:38:30','Sem1',''),(2732,2669,3,