Keep up the hard work!  Sincerely, Ms. Ashby'),(2745,908,NULL,1,'2011-12-13 07:47:15','2011-12-13 11:49:48','Sem1','Simon is a very good student. He always participates in class. He is always focused and on task. I encourage him to keep up the good work.\r\nSincerely yours,\r\nMr Goliad Tamerou'),(2746,551,NULL,2,'2011-12-13 07:49:47','2011-12-16 07:14:29','Sem1','Eliane has shown good understanding of most of the benchmarks for Semester 1.  She still needs to work on her multiplication and division with decimals, which is mainly an issue with how to deal with the decimal point. We will continue to work on this 3rd quarter as it is an essential building block for the future courses.  I am very happy with her progress.  Keep up the good work Eliane.  Sincerely, Ms. Ashby'),(2747,290,NULL,2,'2011-12-13 07:52:11','2011-12-16 07:20:59','Sem1','Enrico has really shown increased effort and focus for the 2nd quarter.  He has done a fantastic job with all the benchmarks for the semester.  In two particular benchmarks, he exceeded the standard by applying his understanding of decimals (and commerce) to solve an open ended word problem.  I hope he will continue to take on more practice of these challenging problems.  Keep up the good work Enrico!  Sincerely, Ms. Ashby'),(2748,468,NULL,1,'2011-12-13 07:56:34','2011-12-16 07:24:21','Sem1','Gen has shown outstanding understanding of all the math benchmarks for semester 1.  My plan is to continue to challenge him with math counts problems and expand his understanding in that way.  He has started some practice on these already and does find them \'hard\'.  Keep up the good work Gen!'),(2749,2261,4,2,'2011-12-13 07:57:21','2011-12-13 07:57:21','Sem1',''),(2750,65,NULL,2,'2011-12-13 07:59:06','2011-12-16 09:06:38','Sem1','Hafeleni has made good progress this quarter and worked hard to improve her skills in math.  She has done a great job with decimals, which is an important building block as we get into algebra concepts.  Hafeleni needs to practice reading questions carefully, especially when it comes to word problems. Keep up the good work Hafeleni!\r\nSincerely, Ms. Ashby'),(2751,380,NULL,1,'2011-12-13 08:01:31','2011-12-16 09:02:27','Sem1','Jacob has done an excellent job with all the benchmarks we studied this semester.  He shows a good understanding of math concepts and good mathematical sense in solving open ended problems.   I would like him to continue practicing these more challenging math contest type questions. We have started practicing with \'math counts\' challenge questions and will continue to do this throughout the 3rd quarter. \r\nOverall well done.  Keep up the good work. \r\nSincerely, Ms. Ashby'),(2752,632,NULL,2,'2011-12-13 08:04:31','2011-12-16 08:43:02','Sem1','Kip has done a good job with all the benchmarks we learned this semester.  He has improved in his organization and focus during the 2nd quarter and that has helped his studies over all. Kip shows a good understanding of the math concepts. He needs to practice his place value a little bit more, especially getting confused with tenths and tens places etc...  I realize the comma vs period decimal issue can be confusing for him!  \r\nOverall well done.\r\nSincerely, Ms. Ashby'),(2753,1405,NULL,2,'2011-12-13 08:50:26','2011-12-13 08:50:26','Sem1','Adam has improved since the beginning of the school year. He is working hard to play all accidentals with correct fingers though it has been difficult for him.  Adam can continue to work on his tone quality and musicianship as he practices his saxophone. '),(2754,209,NULL,2,'2011-12-13 08:58:41','2011-12-13 08:58:41','Sem1','Kai has significantly improved since the beginning of the school year.  However, he has made very little progress on the keyboard percussion playing, has not asked for help; thus, shying away from playing the keyboard percussion completely. '),(2755,1413,NULL,2,'2011-12-13 09:16:53','2012-01-03 09:13:30','Sem1','Adam has made above average progress this 