mes, teacher) with the percussion section.  Keep up the excellent work! '),(2936,163,NULL,4,'2011-12-13 12:39:11','2012-01-03 10:00:20','Sem1','Bamlak shows enthusiasm for the course. He can improve his results by participating more in class and working on the structural aspects of the language.\r\nSincerely yours,\r\n\r\nMr. Goliad Tamerou'),(2937,304,NULL,2,'2011-12-13 12:39:31','2011-12-15 16:46:46','Sem1','There is a distinct difference between quarter 1 work and quarter 2 work.  Sina has done a great job of focusing and practicing her weaker skills, thus producing an excellent result on her Unit 2 test.  Hard work pays off!  Well done Sina.  Keep up the hard work in Semester 2!\r\nSincerely, Ms. Ashby'),(2938,222,NULL,2,'2011-12-13 12:44:26','2011-12-13 12:44:26','Sem1','Kadiya, when she practices regularly, has a fantastic sound on her clarinet.  She should keep working on maintaining a good tone quality for transitioning between low and high registers as well as paying attention to the articulations and dynamics markings on the music. '),(2939,3763,NULL,2,'2011-12-13 12:48:21','2011-12-13 12:48:21','Sem1','Diya has been a fabulous addition to the Middle School Band.  She has done a good job of learning her music and being prepared for class.  I would encourage her to pay attention to the articulation and dynamic markings on her music and continue to work on her flute tone quality.  Overall, keep up the excellent work, Diya!'),(2940,265,NULL,4,'2011-12-13 12:51:11','2012-01-03 10:00:51','Sem1','David mastered most of the things we learned during this quarter. However, he tends to work too quickly and as a result he makes many mistakes. David can improve his grades if he takes his time to review his work before presenting them or handing them in.\r\n\r\nSincerely yours,\r\n\r\nMr. Goliad Tamerou'),(2941,1144,NULL,1,'2011-12-13 12:58:33','2011-12-13 12:58:33','Sem1','Keeghan has done nothing but excel in Middle School Band.  His music reading and playing skills continue to improve significantly. From this point on, he should focus on the articulation and dynamic markings after he works on the pitch accuracy.  Keep up the excellent work, Keeghan! '),(2942,350,NULL,2,'2011-12-13 13:01:34','2012-01-03 10:01:20','Sem1','Jared\'s reading skill is very good. However, he needs to participate more in class to improve his oral skill and he also needs to spend some time reviewing the daily material for his writing skills. I believe that if Jared puts in a little effort, he will improve his skills more rapidly.\r\n\r\nSincerely yours,\r\n\r\nMr. Goliad Tamerou\r\n'),(2943,1067,NULL,1,'2011-12-13 13:08:13','2011-12-13 13:08:13','Sem1','Kgatiso continues to play the trumpet with excellence.  He has been instrumental in helping and encouraging the trumpet section.  I hope that he continues to play and make good music in his next school.  Kgatiso will be missed! '),(2944,3347,2,2,'2011-12-13 13:08:22','2011-12-13 13:08:22','Sem1',''),(2945,3713,2,2,'2011-12-13 13:08:34','2011-12-13 13:08:34','Sem1',''),(2946,3521,3,2,'2011-12-13 13:08:47','2011-12-13 13:08:47','Sem1',''),(2947,575,NULL,2,'2011-12-13 13:14:32','2012-01-03 10:01:43','Sem1','Kojo is a good student. However, Kojo needs to participate more in class in order to improve his oral skill. He also needs to review his written work before handing them in. I believe that if Kojo puts in a little effort, he will improve his skills more rapidly.\r\n\r\nSincerely yours,\r\n\r\nMr. Goliad Tamerou'),(2948,149,NULL,1,'2011-12-13 13:22:20','2012-01-03 10:01:56','Sem1','Marda is an excellent student. She is always on task and focused. She participates well in class. I encourage her to keep on the good work.\r\n\r\nSincerely yours,\r\n\r\nMr. Goliad Tamerou'),(2949,928,NULL,2,'2011-12-13 13:24:24','2011-12-13 13:24:24','Sem1','Leah has shown improvement on her trumpet.  She can continue to focus more on the articulation and dynamic markings on her music to play with more musicianship.  She should also pay attention to accidentals on her music so she plays pitches accurately as well.  Overall, Leah is doing well.  Keep it up! '),(2950,124,NULL,2,'2011-12-13 13:29:23','2012-01-03 10:02:12','Sem1','Medin is a very good student. He always participates in class. However, he tends to work too quickly and makes mistakes. I encourage him to take his time to review his works before handing them in.\r\n\r\nSincerely yours,\r\n\r\nMr. Goliad Tamerou'),(2951,3431,3,2,'2011-12-13 13:33:42','2011-12-13 13:33:42','Sem1',''),(2952,3508,2,2,'2011-12-13 13:33:52','2011-12-13 13:33:52','Sem1',''),(2953,501,NULL,2,'2011-12-13 13:36:13','2012-01-03 10:02:34','Sem1','Ntiska has a very good listening and reading skills. Ntsika needs to participate more in class and not be distracted easily. I believe that if Ntsika puts in a little extra effort he can improve his oral and writing skills more rapidly.'),(2954,2006,4,4,'2011-12-13 13:40:29','2011-12-13 13:40:29','Sem1',''),(2955,2238,1,1,'2011-12-13 13:40:43','2011-12-13 13:40:43','Sem1',''),(2956,3392,1,1,'2011-12-13 13:40:53','2011-12-13 13:40:53','Sem1',''),(2957,2383,2,2,'2011-12-13 13:41:06','2011-12-13 13:41:06','Sem1',''),(2958,2281,2,2,'2011-12-13 13:41:17','2011-12-13 13:41:17','Sem1',''),(2959,2670,1,2,'2011-12-13 13:41:52','2011-12-13 13:41:52','Sem1',''),(2960,2649,3,2,'2011-12-13 13:42:03','2011-12-13 13:42:03','Sem1',''),(2961,27,NULL,1,'2011-12-13 13:42:13','2011-12-13 13:42:13','Sem1','Rekik is an excellent student. She always asks pertinent questions. She always participates in class. She is on task and focused. I encourage her to keep up the good work.\r\n\r\nSincerely yours,\r\n\r\nMr. Goliad Tamerou'),(2962,3694,2,4,'2011-12-13 13:42:26','2011-12-13 13:42:26','Sem1',''),(2963,2270,2,2,'2011-12-13 13:42:38','2011-12-13 13:42:38','Sem1',''),(2964,2330,2,2,'2011-12-13 13:42:50','2011-12-13 13:42:50','Sem1',''),(2965,376,NULL,4,'2011-12-13 13:48:25','2012-01-03 10:03:03','Sem1','Sidney is a good student. However,