19:54','Sem1',''),(2981,214,NULL,2,'2011-12-13 14:53:18','2011-12-16 08:29:08','Sem1','Kai has made steady progress this semester on his individual learning goals by increasing his reading fluency, decoding skills, and sentence grammar. In writing, we have focused primarily this semester on short responses. Next semester we will focus on benchmark 2: â€œWrite structurally complete and grammatically correct expository paragraphs and essays that include transitions words and phrases,â€ which was not graded this semester (NG) as well as work on increasing Kaiâ€™s writing fluency and spelling skills. \r\nNG = No Grade - indicates the benchmark was not assessed during this grading period.'),(2982,180,NULL,1,'2011-12-13 14:59:44','2011-12-13 14:59:44','Sem1','Liyaan is improving on her flute tone quality.  She could continue to improve on her playing by focusing and heeding  the different key signatures, accidentals, dynamics and articulations in her music. '),(2983,122,NULL,1,'2011-12-13 15:02:25','2011-12-13 15:02:25','Sem1','Medin continues to play his clarinet well and with pitch accuracy.  He can pay more attention to the articulation and dynamics as he practices new music in the future.  Medin is always attentive and contributes well to analyzing music with appropriate terminology. '),(2984,419,NULL,2,'2011-12-13 15:06:19','2011-12-13 15:06:19','Sem1','Michael, when he focus and practices, is a fantastic percussionist.  He  plays the rhythms with consistency and accuracy.  His sight-reading skills are fantastic as well when he counts. Michael is encouraged to practice more frequently so he can play more challenging music on his own or in small ensembles with other people.  '),(2985,2458,17,1,'2011-12-13 15:06:27','2011-12-13 15:06:27','Sem1',''),(2986,2531,17,1,'2011-12-13 15:06:57','2011-12-13 15:06:57','Sem1',''),(2987,2390,17,1,'2011-12-13 15:07:14','2011-12-13 15:07:14','Sem1',''),(2988,2182,17,1,'2011-12-13 15:07:33','2011-12-13 15:07:33','Sem1',''),(2989,2647,17,1,'2011-12-13 15:07:51','2011-12-13 15:07:51','Sem1',''),(2990,1237,NULL,1,'2011-12-13 15:09:47','2011-12-13 15:09:47','Sem1','Oksana is a fantastic flute player. Although she feels that there are minor difficulties when she plays notes in the higher octave, she is doing a fabulous job.  Her tone quality is great!  Should she choose to challenge herself further, she could play flute ensemble music with Afshana, Emma, or Diya.  '),(2991,1034,NULL,1,'2011-12-13 15:11:47','2011-12-13 15:12:44','Sem1','Ramanuj is excelling quickly on the percussion.  He has exercised extreme discipline to read music and play rhythms accurately.  His percussive skills are daily progressing and improving. To improve further, Ramanuj should play more with his wrist and not his entire arm, focus on the articulations and dynamics. Keep up the excellent work!  '),(2992,985,NULL,2,'2011-12-14 05:45:50','2012-01-03 10:32:05','Sem1','Alvin has shown strong interest and effort in Spanish class. He always uses class time well and his participation in class is very good. Now he has developed a solid basis. I appreciated his enthusiasm and his risk taking attitude.\r\n\r\nMarie Demoor'),(2993,1664,NULL,1,'2011-12-14 05:47:28','2012-01-03 10:32:29','Sem1','Joshua is a very good student in Spanish class. His participation in class is good and he turns in his homework in a timely manner. He is improving strong writing and oral skills. I really enjoy having Joshua in my class.\r\n\r\nMarie Demoor'),(2994,1393,NULL,2,'2011-12-14 05:50:06','2012-01-03 10:32:51','Sem1','Nadia has shown interest and effort in Spanish class. Her participation is good and I appreciate her enthusiasm. Next semester she will continue to focus on writing skills, grammar and vocabulary.\r\n\r\nMarie Demoor '),(2995,996,NULL,2,'2011-12-14 05:51:53','2011-12-16 09:36:20','Sem1','Rebekahâ€™s writing skills are good and she usually participates well in class.\r\n\r\nMarie Demoor'),(2996,1185,NULL,2,'2011-12-14 06:06:35','2012-01-03 10:33:19','Sem1','Temesgen displays strong efforts in Spanish class, which I truly appreciate. He also actively participates in a cooperative manner. However, he should try to focus on his writing skills. He works too quickly and makes mistakes.\r\n\r\nMarie Demoor'),(2997,1089,NULL,2,'2011-12-14 06:08:20','2011-12-16 09:36:33','Sem1','Yohanna started the Spanish class with enthusiasm. \r\nShe completes her assignments in a timely manner.\r\nYohannaâ€™s grammar and writing skills are good but she has to improve her oral participation.\r\n\r\nMarie Demoor'),(2998,1284,NULL,2,'2011-12-14 06:10:30','2012-01-03 10:33:58','Sem1','Batchâ€™s oral and writing skills are good. His participation in class is always thoughtful and intelligent. I appreciate his enthusiasm.\r\n\r\nMarie Demoor'),(2999,1573,NULL,2,'2011-12-14 06:11:53','2012-01-03 10:34:18','Sem1','Byram has been making steady progress in French conjugation, grammar and spelling. He has improved his written skills and he has good participation in class. I am happy to notice his progress.\r\n\r\nMarie Demoor '),(3000,1652,NULL,1,'2011-12-14 06:14:15','2012-01-03 10:34:47','Sem1','Heldana is a hard worker and she always demonstrates enthusiasm. She submits her homework and pays attention in class. Her oral participation is good and I appreciate her critical mind. She has almost a good knowledge of the grammar and French spelling.\r\nItâ€™s a pleasure to have Heldana in my class.\r\nMarie Demoor'),(3001,637,NULL,2,'2011-12-14 06:16:03','2012-01-03 10:35:28','Sem1','This semester Kip has been making some efforts in his writing skills. Unfortunately it is not enough and Kip has to continue to focus on grammar and French spelling. He has to work more consistently, and focusing on details in his writing.\r\nHe has this potential because orally he has good ideas. I am happy to have Kip in my class because he always demonstrates enthusiasm and I wish he will continue his efforts.\r\nNG= no grade\r\nMarie Demoor\r\n'),(3002,847,NULL,2,'2011-12-14 06:17:05','2012-01-03 10:35:47','Sem1','Leyla has been making steady progress in French conjugation, grammar and spelling. She has good participation in class and she always turns in her homework.\r\nI appreciated her originals ideas. \r\n\r\nMarie Demoor'),(3003,1272,NULL,2,'2011-12-14 06:18:11','2012-01-03 10:36:01','Sem1','Maimuna has been making effort to improve her writing skills. She shows interest in anything we do and participates well in class.\r\n\r\n\r\nMarie Demoor'),(3004,1120,NULL,2,'2011-12-14 06:19:19','2012-01-03 10:36:28','Sem1','This semester Malik has been making some efforts but he has to improve more his writing skills. According to this, Malik has to focus on details and accuracy. He has the potential to produce good work because he always has relevant ideas. His participation in class is good. \r\nMarie Demoor'),(3005,77,NULL,2,'2011-12-14 06:27:35','2012-01-03 10:36:45','Sem1','Martin has been making effort to improve his writing skills. He needs to continue to focus on the acquisition of French spelling and grammar. He pays attention in class but I wish he would participate more. \r\n\r\nNG = No grade\r\n \r\nMarie Demoor'),(3006,492,NULL,2,'2011-12-14 06:30:18','2012-01-03 10:37:02','Sem1','Samuel has been making an effort to improve his writing skills. He has very good participation in class and I appreciated his judicious comments and knowledge about French culture. I am happy to notice his progress.\r\n\r\nMarie Demoor'),(3007,170,NULL,2,'2011-12-14 06:38:12','2012-01-03 09:50:50','Sem1','Abigail is a serious student. She is always on task and focused. However, Abigail needs to participate more in class. She also needs to work on the conjugation of verbs in the past tense. I believe that if Abigail puts in a little extra effort, she can improve her skills rapidly.\r\n\r\nSincerely yours,\r\n\r\nMr.Goliad Tamerou'),(3008,2532,16,2,'2011-12-14 06:46:50','2011-12-14 06:47:20','Sem1',''),(3009,2017,2,2,'2011-12-14 06:47:54','2011-12-14 06:47:54','Sem1',''),(3010,2405,2,2,'2011-12-14 06:48:03','2011-12-14 06:48:03','Sem1',''),(3011,1702,NULL,4,'2011-12-14 06:54:26','2012-01-03 09:51:14','Sem1','Ammanuel\'s listening and reading skills are very good. However, Ammanuel works too quickly and makes mistakes in his written works and oral presentation. He is also easily distracted in class. I believe that if Ammanuel focuses more and puts a little extra effort, he can improve his skills more rapidly.\r\n\r\nSincerely yours,\r\n\r\nMr. Goliad Tamerou'),(3012,1615,NULL,1,'2011-12-14 06:54:41','2011-12-15 05:45:23','Sem1','Hamza is an engaged learner that comes to class prepared and eager to participate in all activities and lessons. He has made significant progress this semester on his individual learning goals: his academic writing is clear, coherent, and marked by a strong thesis statement. Hamza works hard and uses his class time wisely by completing homework assignments for other academic classes. He has currently met our requirements to be exited from resource class.'),(3013,710,NULL,2,'2011-12-14 06:55:12','2011-12-15 05:46:01','Sem1','Kaleb has made significant progress on his individual learning goals for writing. His writing is well organized, thoughtful, and clear. He has also shown improvement in following directions and staying on task when given an assignment. Kaleb works hard and uses his class time wisely. He is an eager and engaged student and is a pleasure to have in class. '),(3014,906,NULL,5,'2011-12-14 06:56:11','2011-12-15 05:49:50','Sem1','Kurbell has made significant progress on his individual learning goals for writing this semester. His writing is well organized, thoughtful, and clear. He has also shown improvement in his ready skills and is eager to read for pleasure. Next semester, we will focus on improving Kurbellâ€™s spelling and handwriting as well as increasing his math fluency.  Kurbell works hard and usually uses his class time wisely. His effort grade was marked â€œmediocreâ€ because he often comes to class unprepared and sometimes gets distracted by his computer. Overall, he is an eager and engaged student and is a pleasure to have in class. '),(3015,1320,NULL,1,'2011-12-14 07:00:59','2011-12-14 07:00:59','Sem1','Aubrey is a very good student. He grasps new material/concepts quickly. He shows curiosity and enthusiasm for the subject. However, he works quickly and makes mistakes. I encourage him to take his time to review his works before handing them in.\r\n\r\nSincerely yours,\r\n\r\nMr. Goliad Tamerou'),(3016,1250,NULL,1,'2011-12-14 07:09:42','2012-01-03 09:51:43','Sem1','Bethany is an excellent student. She grasps new material/concepts quickly. She is always focused and on task. However, Bethany needs to participate more in class. I encourage her to keep up the good work.\r\n\r\nSincerely yours,\r\n\r\nMr. Goliad Tamerou'),(3017,1890,4,4,'2011-12-14 07:15:24','2011-12-16 09:40:34','Sem1','Swazi has made satisfactory progress in the Pre Algebra course. Unfortunately, she missed several weeks of school due to illness, but she has made an effort to catch up the missed work. I wish her well in her new school.\r\n\r\nFiona Thangata'),(3018,84,NULL,4,'2011-12-14 07:50:18','2011-12-15 05:50:01','Sem1','Martin has made progress on his individual learning goals for writing. His writing is well organized, thoughtful, and clear. He has also shown improvement in editing his work as well as staying organized. Martin continues to struggle in producing written work and is resistant to writing. Next semester we will focus on increasing Martinâ€™s writing fluency as well as his self-advocacy skills.  '),(3019,1234,NULL,1,'2011-12-14 07:51:51','2011-12-15 05:50:11','Sem1','Penehafo has made significant progress on her individual learning goals for writing this semester. Her writing is well organized, thoughtful, and clear. She has also shown improvement in writing mechanically correct sentences, paragraphs and essays. Next semester, we will focus on increasing Penehafoâ€™s writing fluency.  Penehafo works hard and usually uses her class time wisely. She is an eager and engaged student and is a pleasure to have in class. '),(3020,950,NULL,2,'2011-12-14 07:52:31','2011-12-15 05:49:13','Sem1','Theo has made significant progress on his individual learning goals for writing this semester. His writing is well organized, thoughtful, and expressive. He has also shown improvement in following verbal directions. Next semester, Theo will continue to focus on writing grammatically complex and correct sentences in essays and short responses.  Theo works hard and usually uses his class time wisely. He is an eager and engaged student and is a pleasure to have in class. '),(3021,2553,17,2,'2011-12-14 07:53:58','2011-12-14 07:53:58','Sem1',''),(3022,22,NULL,2,'2011-12-14 07:54:51','2011-12-16 08:29:24','Sem1','Ezana has made steady progress this semester on his individual learning goals of increasing his reading fluency, reading comprehension skills, and vocabulary. We have focused primarily on writing short responses. Next semester we will focus on benchmark 2: â€œWrite structurally complete and grammatically correct expository paragraphs and essays that include transitions words and phrases,â€ which was not graded this semester (NG) as well as work on increasing Ezanaâ€™s writing fluency and academic writing skills.\r\nNG = No Grade - indicates the benchmark was not assessed during this grading period.'),(3023,1116,NULL,2,'2011-12-14 07:55:34','2011-12-16 08:29:36','Sem1','Jarrah has made steady progress this semester on his individual learning goals  by increasing his reading fluency, reading comprehension skills, and academic vocabulary. We have focused primarily on writing grammatically correct short responses. Next semester we will focus on benchmark 2: â€œWrite structurally complete and grammatically correct expository paragraphs and essays that include transitions words and phrases,â€ which was not graded this semester (NG) as well as work on increasing Jarrahâ€™s writing fluency and academic writing skills. \r\nNG = No Grade - indicates the benchmark was not assessed during this grading period.'),(3024,3306,17,2,'2011-12-14 07:55:54','2011-12-14 07:55:54','Sem1',''),(3025,343,NULL,2,'2011-12-14 07:56:38','2011-12-16 08:29:49','Sem1','This semester, Tommy has made steady progress on his individual learning goals of organization and following directions as well task completion. In class, Tommy has worked hard on completing class work and has eagerly used his time to correct or complete assignments. He did not have a chance to work on benchmark 2: â€œWrite structurally complete and grammatically correct expository paragraphs and essays that include transitions words and phrases,â€ which was not graded this semester (NG).  Tommy has been a positive and energetic student in the class and will be greatly missed next semester.\r\nNG = No Grade - indicates the benchmark was not assessed during this grading period.'),(3026,1758,NULL,1,'2011-12-14 09:25:42','2011-12-14 09:27:02','Sem1','Asha does a good work in class and puts much effort on her homework and assignments. Her use of grammar and vocabulary is still in progress\r\n\r\nSincerely, \r\n\r\nMrs Oswald'),(3027,1071,NULL,4,'2011-12-14 09:36:12','2011-12-14 10:18:12','Sem1','Benjamin shows a good command of oral expression in Spanish at this level. He needs to focus more on his homework and assignments, as well as on his work in class.\r\nSincerely,\r\nMrs. Oswald'),(3028,1202,NULL,2,'2011-12-14 09:42:57','2011-12-16 06:33:17','Sem1','Calvin shows a good command of Spanish, oral and written, according to the level. He needs to stay focused on his work in class.\r\nSincerely,\r\nMrs. Oswald'),(3029,1724,NULL,4,'2011-12-14 09:46:41','2011-12-14 09:51:07','Sem1','David needs to put more effort on his use of grammar and vocabulary and on his homework.\r\nSincerely,\r\nMrs. Oswald'),(3030,50,NULL,1,'2011-12-14 09:48:46','2011-12-14 09:48:46','Sem1','Aida has demonstrated a good understanding of the course material to date. She is a keen students who is always participating in class and is sure to do her work in a timely manner.'),(3031,3762,NULL,1,'2011-12-14 09:50:30','2011-12-14 09:50:30','Sem1','Debalina works very well in class and puts much effort on her homework.\r\nSincerely,\r\nMrs. Oswald'),(3032,670,NULL,2,'2011-12-14 09:51:21','2011-12-14 09:51:21','Sem1','Annmarie is a committed student who participates well in class.  She is able to successfully complete her work and keeps up with the expectations of the course.'),(3033,268,NULL,2,'2011-12-14 09:59:26','2011-12-14 09:59:26','Sem1','David is a conscientious and affable student who always participates in group discussions.  He is performing well in class and is able to stay on top of his course work.'),(3034,288,NULL,2,'2011-12-14 10:02:15','2011-12-14 10:02:15','Sem1','Rico is performing well in class and is able to complete all coursework without difficulty. He is an affable student who completes his work in a timely manner. He participates in discussions and is always able to analyze issues critically.'),(3035,3444,17,1,'2011-12-14 10:14:23','2011-12-14 10:14:23','Sem1',''),(3036,3729,17,1,'2011-12-14 10:14:34','2011-12-14 10:14:34','Sem1',''),(3037,3504,17,1,'2011-12-14 10:14:46','2011-12-14 10:14:46','Sem1',''),(3038,3584,17,1,'2011-12-14 10:14:58','2011-12-14 10:14:58','Sem1',''),(3039,3366,17,1,'2011-12-14 10:15:09','2011-12-14 10:15:09','Sem1',''),(3040,2697,2,1,'2011-12-14 10:16:02','2011-12-14 10:16:02','Sem1',''),(3041,2515,2,1,'2011-12-14 10:16:12','2011-12-14 10:16:12','Sem1',''),(3042,2323,2,2,'2011-12-14 10:16:39','2011-12-14 10:16:39','Sem1',''),(3043,2559,2,1,'2011-12-14 10:16:50','2011-12-14 10:16:50','Sem1',''),(3044,2549,2,1,'2011-12-14 10:16:59','2011-12-14 10:16:59','Sem1',''),(3045,2750,2,1,'2011-12-14 10:17:14','2011-12-14 10:17:14','Sem1',''),(3046,1049,NULL,2,'2011-12-14 10:17:30',