 attitude. Abi is starting to use the concepts taught when she is writing texts or being part of a role-play. I would like to see Abi more actively participating in class discussions. \r\nGabriela Gade'),(3077,611,NULL,4,'2011-12-14 10:41:34','2011-12-16 08:59:48','Sem1','Kalkeydan doesn\'t really enjoy this class so much.  I understand that.  When the concepts don\'t make sense then how could it be fun.  I want to continue to work with Kalkeydan on a regular basis but feel a lunch time slot doesn\'t give us enough time.  I feel he needs a lot of practical hands on manipulatives to help him \'see\' the concepts.  I would like to work out a schedule that suits everyone so perhaps we need to talk in the new year.  \r\nSincerely, Ms. Ashby'),(3078,309,NULL,1,'2011-12-14 10:42:47','2011-12-16 06:10:59','Sem1','This semester the students were busy learning the basics of the Spanish language: greetings, introducing themselves, colors, likes/dislikes, school subjects, family, and more. Comfort is a quiet, well-mannered student. She is always on time and is responsible about her homework. Comfort would benefit from some more practice at home, studying her vocabulary and revising the concepts taught in class. \r\nGabriela Gade'),(3079,321,NULL,1,'2011-12-14 10:51:34','2011-12-16 06:11:29','Sem1','This semester the students were busy learning the basics of the Spanish language: greetings, introducing themselves, colors, likes/dislikes, school subjects, family, and more. Cuthbert is a very active participant of our Spanish class. He is eager to learn new concepts, and tries to focus when explanations are taking place, asking questions and making sure he understands the concepts. Cuthbert should practice a bit more at home, in order to get a better grasp of grammatical structures and vocabulary learned. \r\nGabriela Gade'),(3080,3140,17,5,'2011-12-14 10:52:18','2011-12-14 10:52:18','Sem1',''),(3081,3015,17,1,'2011-12-14 10:52:29','2011-12-14 10:52:29','Sem1',''),(3082,3073,17,2