is throughout the 3rd quarter. \r\nOverall well done.  I appreciate all your hard work!\r\nSincerely, Ms. Ashby'),(3130,504,NULL,5,'2011-12-14 11:34:26','2011-12-16 07:54:26','Sem1','Ntsika shows good basic understanding of math concepts but needs to work on a few areas.  In particular, multiplication and division of decimals are extremely important building blocks for future units and these need to be improved.  Staying current with his homework assignments is also important and this aspect needs to be worked on.  Many homework assignments were not handed in (see moodle site). We can only help Ntsika if he gives us the work to correct and give him feedback on.  He is a capable student but the work needs to be done to achieve a good result.  Sincerely, Ms. Ashby'),(3131,338,NULL,2,'2011-12-14 11:36:03','2011-12-16 07:45:58','Sem1','Tommy has shown very solid understanding of the benchmarks for semester 1.  He has very good number sense and uses his logic well.  We will miss Tommy, but hope he transitions quickly into his new school.  \r\nSincerely, Ms. Ashby'),(3132,685,NULL,2,'2011-12-14 11:38:01','2011-12-16 07:28:43','Sem1','Wilson has improved a lot over the 2nd quarter of math.  The extra after school sessions are productive and we are making progress.  It is very important to become very confident in all the operations (addition, subtraction, multiplication and division) with decimals as a building block for future units.  We will be working on multiplication and division for our next after school sessions.  Keep working hard Wilson.  Sincerely, Ms. Ashby'),(3133,174,NULL,1,'2011-12-14 11:40:45','2011-12-16 06:48:23','Sem1','Abigail has done an excellent job in all the math benchmarks for the semester. She works hard both in class and at home to get her work done and corrections completed.  Well done.  Keep working hard.\r\nSincerely, Ms. Ashby'),(3134,594,NULL,1,'2011-12-14 11:41:21','2011-12-16 06:13:03','Sem1','This semester the students were busy learning 