uld like to see him apply his creativity to a wider variety of art topics and projects.\r\n\r\nRegards,\r\nMs. Brianna Balboni'),(3298,1593,NULL,2,'2011-12-15 08:05:01','2011-12-16 09:12:26','Sem1','Katie has consistently demonstrated that she is able to apply art skills and knowledge in a variety of contexts.  She has created some successful pieces this semester, and in the future, could focus on slowing down the working process in order to produce her best work.\r\n\r\nRegards,\r\nMs. Brianna Balboni'),(3299,1403,NULL,2,'2011-12-15 08:05:16','2011-12-15 08:05:16','Sem1','Adam has done well understanding a conceptually difficult class. He asks interesting questions and has demonstrated a willingness to learn new subject.'),(3300,59,NULL,1,'2011-12-15 08:07:17','2011-12-15 08:07:17','Sem1','Aida is an engaged student who has done well understanding a conceptually difficult subject. She has been an eager learner and has taken opportunities to independently further her own understanding.'),(3301,1768,NULL,1,'2011-12-15 08:08:55','2011-12-15 08:08:55','Sem1','Asha is an engaged student who asks is curious about the subject matter covered in the class. She has done well to understanding a conceptually difficult subject and stretch her own comprehension of the universe.'),(3302,603,NULL,2,'2011-12-15 08:10:35','2011-12-16 09:13:34','Sem1','Kayleigh has consistently demonstrated that she is able to apply art skills and knowledge in a variety of contexts.  She shows strong motivation to complete her work and often seeks out additional learning opportunities.  She sometimes rushes through work, and would benefit from slowing down a bit.  \r\nRegards,\r\nMs. Brianna Balboni'),(3303,1059,NULL,1,'2011-12-15 08:12:24','2011-12-15 08:12:24','Sem1','Elliot is a very curious student and has done well understanding the difficult concepts of the class. He has taken opportunities to further his own understanding independently and is genuinely interested in the subject.'),(3304,1569,NULL,2,'2011-12-15 08:14:07','2011-12-16 09:27:45','Sem1','Keratiloe has consistently demonstrated that she is able to apply art skills and knowledge in most contexts.  She has strong craftmanship skills and attention to detail in her work.  Linear perspective was her biggest challenge this semester, but could be improved with more practice.\r\n\r\nRegards,\r\nMs. Brianna Balboni'),(3305,287,NULL,2,'2011-12-15 08:16:02','2011-12-15 08:16:02','Sem1','Rico has done a very good job of understanding a conceptually difficult subject. He asks interesting question, has taken opportunities to learn independently, and is generally interested in what we have covered.'),(3306,1675,NULL,1,'2011-12-15 08:18:53','2011-12-15 08:18:53','Sem1','Josh has done well understanding a conceptually difficult subject. He is a curious student and asks interesting questions. He has taken the opportunity to learn independently and is able to show his understanding of the subject.'),(3307,392,NULL,2,'2011-12-15 08:21:36','2011-12-15 08:21:36','Sem1','Lonaoui has demonstrated curiosity in the subject. He asks questions to further his understanding and has done well to understand a conceptually difficult subject.'),(3308,3022,6,6,'2011-12-15 08:22:10','2011-12-15 08:25:31','Sem1',''),(3309,1533,NULL,1,'2011-12-15 08:23:06','2011-12-15 08:23:06','Sem1','Matthew has been an engaged student who has demonstrated excellent work in the class. He is curious and has done well understanding the course material.'),(3310,1688,NULL,4,'2011-12-15 08:23:37','2011-12-16 09:08:52','Sem1','Krubel has struggled to complete work in the last quarter of the semester.  He is sometimes distracted by peers and has also missed significant class time.  His last ceramic project was incomplete.  He has demonstrated strong potential to apply skills and knowledge in the visual arts, and needs to work on building his own confidence in those skills.\r\nRegards,\r\nMs. Brianna Balboni'),(3311,2899,5,5,'2011-12-15 08:25:21','2011-12-15 08:25:21','Sem1',''),(3312,3227,6,6,'2011-12-15 08:25:44','2011-12-15 08:25:44','Sem1',''),(3313,508,NULL,4,'2011-12-15 08:25:45','2011-12-15 08:25:45','Sem1','Ntsika is sometimes distracted in the class but he seems genuinely interested in the course. He asks interesting questions and has stretched his understanding of the cosmos.'),(3314,3204,4,4,'2011-12-15 08:27:22','2011-12-15 08:27:22','Sem1',''),(3315,273,NULL,2,'2011-12-15 08:28:09','2011-12-16 09:28:04','Sem1','Lara continues to be a strong visual art student. She takes care in her work and shows strong attention to detail. She had some difficulty with linear perspective and retaining art historical information, but with more practice, this can be improved.  \r\n\r\nRegards,\r\nMs. Brianna Balboni'),(3316,438,NULL,1,'2011-12-15 08:28:10','2011-12-15 08:28:10','Sem1','Ruhama has done well understanding the conceptually difficult parts of the class. She is a curious student and taken many opportunities to learn independently and seek to further her knowledge of the cosmos.'),(3317,814,NULL,1,'2011-12-15 08:29:20','2011-12-15 08:29:20','Sem1','Tomas is making progress in all areas of playing his baritone horn!  He plays every pitch beautifully and in tune. He is sight reading more and more music. He is doing very well in his quiz playing.  Tomas can work on playing with more articulations and dynamics when it appears on his music.  Overall, Tomas, keep up the great work! '),(3318,437,NULL,2,'2011-12-15 08:30:19','2011-12-15 08:30:19','Sem1','Sean has stretched his understanding of the cosmos. He is generally engaged and has shown an interest in the course material.'),(3319,377,NULL,2,'2011-12-15 08:31:48','2011-12-15 08:31:48','Sem1','Sidney has been generally engaged in the class and has shown an interest in learning about the cosmos. He asks interesting questions and has taken opportunities to learn independently.'),(3320,521,NULL,1,'2011-12-15 08:32:12','2011-12-16 09:28:18','Sem1','Nanseera continues to be a strong visual art student. She shows a high level of thought and attention to detail in her work, resulting in very successful pieces of art.  I hope she continues to use her creativity in the future.\r\n\r\nRegards,\r\nMs. Brianna Balboni'),(3321,1163,NULL,2,'2011-12-15 08:33:02','2011-12-15 08:33:02','Sem1','Uakuu is a curious student who often asks questions. He is generally interested in stretching his understanding of the cosmos.'),(3322,3045,2,1,'2011-12-15 08:34:18','2011-12-15 08:34:18','Sem1',''),(3323,1757,NULL,1,'2011-12-15 08:34:50','2011-12-15 08:34:50','Sem1','William has done an excellent job of understanding the conceptually difficult elements of the course. He is a curious student who asks questions to further his own understanding and has been engaged in all parts of the course.'),(3324,191,NULL,1,'2011-12-15 08:35:39','2011-12-16 09:29:22','Sem1','Nkotseng continues to be a strong visual art student who applies skills in a variety of assignments.  She shows strong attention to detail in her work.  Nkotseng struggled to retain some art history information we learned this semester, and should work on making those connections stronger in the future.\r\n\r\nRegards,\r\nMs. Brianna Balboni '),(3325,1747,NULL,1,'2011-12-15 08:36:57','2011-12-15 08:36:57','Sem1','William has a good tone on his tenor saxophone.  He is a hard worker and contributes positively to the class at all times.  To excel, William is encouraged to heed to the articulation and dynamic markings on his instrument and work on his rhythm reading skills.  Overall, William has been an asset to the middle school band! '),(3326,1344,NULL,1,'2011-12-15 08:44:33','2011-12-15 08:44:33','Sem1','Yema continues to excel at playing the clarinet.  To further improve, Yema can blow more air into her clarinet to differentiate the spectrum of dynamics she can play!  Overall, Yema is doing well and should keep up the great work. '),(3327,3167,5,4,'2011-12-15 08:45:28','2011-12-15 08:45:28','Sem1',''),(3328,3082,3,1,'2011-12-15 08:46:01','2011-12-15 08:46:01','Sem1',''),(3329,3070,5,2,'2011-12-15 08:46:11','2012-01-10 07:05:36','Sem1',''),(3330,2933,5,4,'2011-12-15 08:46:41','2011-12-15 08:46:41','Sem1',''),(3331,3238,5,1,'2011-12-15 08:46:55','2011-12-15 08:47:14','Sem1',''),(3332,1083,NULL,1,'2011-12-15 08:57:09','2011-12-15 08:57:09','Sem1','Yohanna continues to improve in her clarinet playing.  She has excellent knowledge of music terminology and their applications.  To further improve, she would benefit from blowing more air into the clarinet so that she can exercise the spectrum of dynamics to the fullest.  Yohanna, keep up the excellent work! '),(3333,3753,NULL,5,'2011-12-15 09:00:34','2011-12-15 09:00:34','Sem1','Kurbell started off the quarter well - he came in for help, was able to play parts of a scale and had good tone quality on his trombone.  However, he has done little practice when offered after school time slots and given specific homework.  Easily, Kurbell could be a fantastic trombone player.  However, his lack of practice has not contributed positively to his playing.  Kurbell is always welcome to come in for help and practice with friends.  He, however, needs to initiate these rehearsals and ask for help. '),(3334,2976,4,2,'2011-12-15 09:05:16','2011-12-15 09:05:16','Sem1',''),(3335,3091,2,1,'2011-12-15 09:05:52','2011-12-15 09:05:52','Sem1',''),(3336,2836,3,1,'2011-12-15 09:06:19','2011-12-15 09:06:43','Sem1',''),(3337,3101,3,2,'2011-12-15 09:07:55','2011-12-15 09:07:55','Sem1',''),(3338,3249,2,1,'2011-12-15 09:08:05','2011-12-15 09:08:05','Sem1',''),(3339,3129,2,1,'2011-12-15 09:08:40','2011-12-15 09:08:40','Sem1',''),(3340,3146,3,1,'2011-12-15 09:09:01','2011-12-15 09:09:01','Sem1',''),(3341,2967,2,1,'2011-12-15 09:09:32','2011-12-15 09:09:32','Sem1',''),(3342,3162,4,1,'2011-12-15 09:10:03','2011-12-15 09:10:03','Sem1',''),(3343,2822,2,1,'2011-12-15 09:10:36','2011-12-15 09:10:36','Sem1',''),(3344,562,NULL,2,'2011-12-15 09:39:59','2011-12-16 10:26:52','Sem1','Abigail has done very well on many of the science benchmarks.  It seems that she has forgotten a few of the skills we worked on mostly during the first quarter and so we just need to review and re-fresh these with her.  Other than that, I am very please with Abigail\'s progress.  Keep working hard!\r\nSincerely, Ms. Ashby'),(3345,595,NULL,2,'2011-12-15 09:44:17','2011-12-16 10:36:22','Sem1','Kayleigh has shown a lot of strength and determination this quarter.  She has been focused on improving her science skills and her hard work has paid off.  Her accurate measurement skills in particular are much better.  An important aspect of a good scientist.  We will continue to work on experimental design and identifying variables in the 3rd quarter.  Keep working hard Kayleigh.\r\nSincerely, Ms. Ashby'),(3346,334,NULL,4,'2011-12-15 09:46:32','2011-12-16 10:38:26','Sem1','Dear Tommy,  \r\nI really enjoyed my short half-year with you.  You are a good scientist with lots of logic and inquisitiveness (ask your mom).  Remember to stay on top of your studies and assignments, read questions carefully, and you will do great! \r\nSincerely, Ms. Ashby'),(3347,679,NULL,4,'2011-12-15 09:49:04','2011-12-16 10:36:54','Sem1','Wilson is definitely improving in his science skills.  We practiced using the triple beam balance and it helped!   There are still areas which need to be worked on and improved.  I know Wilson is a very capable student.   if he continues to work hard on his assignments at home and we continue our after school sessions, I think much progress can be made. \r\nSincerely, Ms. Ashby'),(3348,64,NULL,4,'2011-12-15 09:54:27','2011-12-16 10:34:50','Sem1','Hafeleni has improved her science work habits a lot.  Coming after school one day a week along with better focus in class (and at home) has helped her improve in many benchmarks.  There are just a few areas that still need attention.  I would like to continue this once a week after school session for Semester 2.  Keep working hard, Hafeleni.  \r\nSincerely, Ms. Ashby'),(3349,51,NULL,2,'2011-12-15 09:55:49','2011-12-16 10:30:13','Sem1','Great work Aida.  Your understanding of the buoyancy labs is excellent!  I would like to see you take on an independent study or experiment in the 3rd quarter to explore an aspect of science that you might like and to further your science skills. Keep working hard. \r\nSincerely, Ms. Ashby'),(3350,239,NULL,2,'2011-12-15 10:02:30','2011-12-16 10:35:34','Sem1','Hanna, I appreciate your enthusiasm and inquisitive nature in science class.  You have a solid  understanding of the science skills and comments, though you need to be careful with the details.  Keep\r\nup the good work and think about doing an independent study or experiment in the 3rd quarter to explore an aspect of science that you might like.\r\nSincerely, Ms. Ashby'),(3351,275,NULL,4,'2011-12-15 10:09:01','2011-12-16 10:45:05','Sem1','Lara has improved a great deal in both her science skills and knowledge.  She needs to be more careful with details, for example, measuring to the nearest tenth and remembering all the parts of a graph.  Lara did a great job with the soil and scarification labs.  Keep up the good work. \r\nSincerely, Ms. Ashby'),(3352,118,NULL,2,'2011-12-15 10:10:41','2011-12-16 10:42:51','Sem1','Nikita works hard, works fast and works focused.  She does not take time to ponder but gets on with business and gets it done.  She has a great understanding of basic science theory and how to conduct experiments.  She can read instructions.  I hope Nikita will consider doing an independent study or experiment in the 3rd quarter to explore an aspect of science that she might like.  Keep up the good work.  \r\nSincerely, Ms. Ashby'),(3353,135,NULL,2,'2011-12-15 10:13:07','2011-12-16 10:43:58','Sem1','Maria is a quiet and steady worker in class.  She definitely participates in class discussions but when it comes to labs she is focused and on task.  She shows a very solid understand of the benchmarks for Semester 1.  Maria did a great job with understanding our buoyancy labs and answered the \'exceeds the standard\' questions very well.  I hope Maria will consider doing an independent study or experiment in the 3rd quarter to explore an aspect of science that she might like.  Keep working hard. \r\nSincerely, Ms. Ashby'),(3354,76,NULL,4,'2011-12-15 10:14:59','2011-12-16 10:43:25','Sem1','Martin has a much improved attitude as well as performance during this past quarter.  I am hoping that he sees that one influences the other.  He has shown very solid laboratory skills as well as understanding of our buoyancy and soil experiments. We shall continue to work on density experiments in the third quarter, so I am not worried about that benchmark.  He has made excellent contributions to class discussions and I hope he continues to do that in Semester 2.  \r\nSincerely, Ms. Ashby'),(3355,497,NULL,5,'2011-12-15 10:18:12','2011-12-16 10:41:15','Sem1','Ntsika is able to do very good work when focused.  He needs to improve his self-discipline to have that focus and be willing to put in the work it takes to complete assignments.  I highly recommend that he works in my classroom one afternoon a week (not Wednesdays) to keep him up to date on assignments.  He has achieved well on many benchmarks but needs to still improve in some basic ones. \r\nSincerely,  Ms. Ashby'),(3356,442,NULL,1,'2011-12-15 10:20:12','2012-01-23 07:55:47','Sem1','Ruhama has worked very hard this semester and achieved very well on all her learning benchmarks for science.  In particular, she has exceeded the standard in her measurement skills (and relating them to buoyancy) as well as her ability to define variables in an experiment.  Excellent work.  Keep it up for the next semester.\r\nSincerely, Ms. Ashby'),(3357,452,NULL,1,'2011-12-15 10:24:11','2011-12-16 10:42:12','Sem1','Nomonde has continued to excel in her studies of science.  She has excellent laboratory skills as well as analyzing skills.  She exceeded the standard in her understanding of the buoyancy concepts we have been studying.  I hope she continues her plans to do an independent study/ experiment on seeds.  Keep up the good work.  \r\nMs. Ashby'),(3358,90,NULL,1,'2011-12-15 10:39:39','2011-12-16 10:37:40','Sem1','Wedu is a steady, hard worker.  She is very disciplined about her work inside and outside of class.  I appreciate this hard work ethic and believe that she achieves so well directly because of it!   I look forward to seeing how her independent study/experiment turns out during the next semester.  Keep up the good work.\r\nSincerely, Ms. Ashby'),(3359,368,NULL,4,'2011-12-15 10:42:57','2011-12-16 10:39:18','Sem1','Sidney has done fine in all of the benchmarks except for graphing and interpreting graphs.  I am sure this would only take a short review to \'remind\' him of how to do this.  He has a good understanding of experiments and how the variables play a part in them.  He has difficulty getting assignments in on time, participating in class discussions and working with non-friend lab partners.  I would appreciate a little more focus and intentness in class.  I think this would benefit Sidney in many ways.  \r\nSincerely, Ms. Ashby'),(3360,538,NULL,2,'2011-12-15 10:47:55','2011-12-16 09:26:07','Sem1','In the second quarter, Ms. Ashby was a bit lazy and did not translate any tests or other documents for Ana Sofia.  This did not seem to matter to her!  She has done an outstanding job in science in English!   \r\nI am impressed with her ability to adapt and learn so quickly!  Great job.  I appreciate your hard work and will have to figure out a way to challenge you in quarter 3!  \r\nSincerely,  Ms. Ashby'),(3361,669,NULL,2,'2011-12-15 10:49:59','2011-12-16 09:26:46','Sem1','If there was a prize for \'most improved\',  Annmarie would get it for her work in science.  She has really improved in her understanding of concepts and her lab skills, as well as her ability to organize herself.  I am very impressed and appreciate all her hard work.  I think the one day a week after school sessions are working very well and would like to continue this in the third quarter.  Keep up the great work Annmarie.  Sincerely, Ms. Ashby'),(3362,44,NULL,2,'2011-12-15 10:51:40','2011-12-16 09:27:32','Sem1','Briana is doing a great job.  She has a solid understanding of all the semester 1 benchmarks.  On the metric skills test 2, she answered the exceed the standard questions for buoyancy and identifying variables well enough to bump her up her grade.   I would like to see Briana take on an independent study or experiment in the 3rd quarter to explore an aspect of science that she might like and to develop her experiment design skills as well. Keep up the good work! \r\nSincerely,  Ms. Ashby '),(3363,2948,17,1,'2011-12-15 11:12:16','2011-12-15 11:12:16','Sem1',''),(3364,1,NULL,2,'2011-12-15 11:13:40','2011-12-16 10:04:10','Sem1','Abale is doing a great job in science and is very competent in all the benchmarks except perhaps density, which we will continue to work on in Quarter 3 anyway.  She must be careful to always record to the accuracy that is allowed by the instrument (to the near tenth in our equipment).  She is a good lab partner and participates often in class discussions.  Keep working hard Abale!\r\nSincerely, Ms. Ashby'),(3365,171,NULL,2,'2011-12-15 11:15:51','2011-12-16 10:05:45','Sem1','Abigail, or Abi -B as I call her,  works very hard both in class and out.  She has done well to achieve and improve on a lot of her science skills.  We will continue to work on the design of experiments and therefore review variables and how to define and identify them in a lab.  I appreciate Abigail\'s serious and purposeful approach to the labs we do in class. Keep up the good work. \r\nSincerely, Ms. Ashby'),(3366,3293,17,1,'2011-12-15 11:16:43','2011-12-15 11:16:43','Sem1',''),(3367,3242,17,1,'2011-12-15 11:17:01','2011-12-15 11:17:01','Sem1',''),(3368,227,NULL,4,'2011-12-15 11:17:31','2011-12-16 10:06:32','Sem1','Ahmed has some very good contributions to some of our class discussions.  I appreciate his ideas and insights but also feel he needs to develop some discipline in how he approaches his work.  This self-discipline would include keeping himself focused during lab or review times, asking questions if he doesn\'t understand, and completing assignments to the full extent.  Ahmed is capable of all these things, he just has to decide that he will do it.  I feel our after school session are helpful and we should continue in quarter 3.  \r\nSincerely, Ms. Ashby\r\n'),(3369,2982,17,1,'2011-12-15 11:17:43','2011-12-15 11:17:43','Sem1',''),(3370,1406,NULL,4,'2011-12-15 11:18:06','2011-12-16 06:49:37','Sem1','Adam:\r\n-does well on assessments\r\n-rarely comes to class unprepared \r\n-needs to ask more questions in class when confused\r\n-needs to take more responsibility for his learning\r\n\r\nNice job this semester!'),(3371,1215,NULL,2,'2011-12-15 11:18:45','2011-12-16 06:50:21','Sem1','Ashley:\r\n-has begun to participate more in class\r\n-is always on task\r\n-often forgets her book\r\n\r\nNice job this semester!'),(3372,262,NULL,2,'2011-12-15 11:19:10','2011-12-16 10:07:06','Sem1','David has done very well on all the semester 1 benchmarks.  He has a good approach to the science labs in class and is very purposeful in his actions.  I would like to see David take on an independent study or experiment in the 3rd quarter to explore an aspect of science that he might like and to develop his experiment design skills as well. Keep working hard. \r\nSincerely,  Ms. Ashby '),(3373,1287,NULL,2,'2011-12-15 11:19:10','2011-12-16 06:51:35','Sem1','Batch:\r\n-does very well with concepts as shown on assessments\r\n-sometimes comes to class with incomplete homework\r\n-is very distracting to others in class\r\n\r\nNice job this semester!'),(3374,3230,17,1,'2011-12-15 11:19:13','2011-12-15 11:19:13','Sem1',''),(3375,2243,16,2,'2011-12-15 11:19:55','2011-12-16 06:41:10','Sem1',''),(3376,1574,NULL,2,'2011-12-15 11:20:46','2011-12-16 06:53:04','Sem1','Biram:\r\n-performs well on assessments\r\n-always has his homework done\r\n-is often off task and disrupts others\' learning\r\n-purposely leaves his book in the classroom after being repeatedly reminded to keep it in his locker\r\n\r\nGood job this semester!\r\n\r\n'),(3377,548,NULL,2,'2011-12-15 11:21:00','2012-01-02 10:29:44','Sem1','Eliane has made great improvements this quarter.  I see her becoming more confident as a scientist and she is very purposeful during labs. The metric thinking is coming along very nicely.  I have seen inches in a long while. Now I just need to get her to measure to the nearest tenth of a cm and not settle for 1/2 or 1/4 \'s.  Great work Eliane!  Keep it up for next semester too!\r\nSincerely,  Ms. Ashby'),(3378,3252,17,1,'2011-12-15 11:21:16','2011-12-15 11:21:16','Sem1',''),(3379,2089,4,1,'2011-12-15 11:21:44','2011-12-16 06:53:49','Sem1','Eynaas:\r\n-is always on task\r\n-always hands in her homework on time\r\n-participates well during class time\r\n-does well on assessments\r\n\r\nKeep it up!'),(3380,2826,17,1,'2011-12-15 11:22:10','2011-12-15 11:22:10','Sem1',''),(3381,2275,5,4,'2011-12-15 11:22:14','2011-12-16 06:54:44','Sem1','Leake:\r\n\r\n-occasionally comes to see me for extra help\r\n-is often unprepared for class\r\n-is improving his participation\r\n-needs to spend more time outside of class working on difficult concepts'),(3382,2175,6,5,'2011-12-15 11:22:41','2011-12-16 06:55:44','Sem1','Marlene:\r\n\r\n-sometimes comes to class unprepared\r\n-is usually off task during class\r\n-asks questions when she is confused\r\n-needs to spend more time working on difficult concepts'),(3383,656,NULL,2,'2011-12-15 11:22:46','2011-12-16 10:13:34','Sem1','Excellent work Felicity!  Your drawing of germination was by far the best one of the whole 6th grade.  Great work.  All the other benchmarks are solid as well.  I hope you might consider doing an independent study or experiment in the 3rd quarter to explore an aspect of science that you might like. Maybe something about scientific artists? Or relating super -string theory (physics) to knitting?!  Well done and keep up the good work in the 2nd semester!\r\nSincerely, Ms. Ashby'),(3384,2210,5,5,'2011-12-15 11:23:46','2011-12-16 06:56:31','Sem1','Mwenya:\r\n\r\n-asks questions when she is confused\r\n-often comes to class with incomplete homework\r\n-often distracts herself and others in class\r\n-needs to spend more time outside of class working on challenging concepts\r\n\r\n'),(3385,1536,NULL,2,'2011-12-15 11:24:16','2011-12-16 06:57:13','Sem1','Pandeni:\r\n\r\n-is usually prepared for class\r\n-is improving his participation\r\n\r\nNice job this semester!'),(3386,641,NULL,2,'2011-12-15 11:24:31','2011-12-16 10:25:22','Sem1','Great work Henry.  All the benchmarks are well done.  I appreciate your accurate data collection  and sustained focus during the laboratories.  Ironic that the data you collected for the test was slightly off.  Good improvement in metric conversions. I hope you will consider doing an independent study or experiment in the 3rd quarter to explore an aspect of science that you might like and further your science skills.  Keep up the good work. \r\nSincerely, Ms. Ashby'),(3387,2263,4,2,'2011-12-15 11:25:13','2011-12-16 06:57:55','Sem1','Sophi:\r\n\r\n-asks questions when she is confused\r\n-participates regularly\r\n-is sometimes unprepared without her book and/or homework\r\n\r\nNice job this semester!'),(3388,607,NULL,2,'2011-12-15 11:26:07','2011-12-16 10:22:25','Sem1','Kalkeydan is doing some excellent work in science.  I am very impressed with his graphing and interpreting graphing skills.  There are just a couple of items to bring up to standard.  I appreciate your hard working attitude and focus during labs.  Keep up the good work.  \r\nSincerely, Ms. Ashby'),(3389,714,NULL,1,'2011-12-15 11:26:20','2011-12-15 11:26:20','Sem1','Aisha is an engaged student who easily understands the course material. She is consistent in her effort and is always able to demonstrate thorough knowledge of the subject. She works well be in groups and as an individual and makes positive contributions to the classroom.'),(3390,3057,3,2,'2011-12-15 11:26:40','2011-12-15 11:26:40','Sem1',''),(3391,2876,2,1,'2011-12-15 11:26:56','2011-12-15 11:26:56','Sem1',''),(3392,2945,3,2,'2011-12-15 11:27:25','2011-12-15 11:30:02','Sem1',''),(3393,3135,4,4,'2011-12-15 11:27:40','2011-12-15 11:27:40','Sem1',''),(3394,145,NULL,2,'2011-12-15 11:27:40','2011-12-16 10:18:29','Sem1','Good work Marda.  Very solid in all the benchmarks for Semester 1.  You are working hard and staying on top of your assignments which is great but I also appreciate your focus in class and during labs.  Keep working hard!\r\nSincerely,  Ms. Ashby'),(3395,3068,2,1,'2011-12-15 11:27:57','2011-12-15 11:27:57','Sem1',''),(3396,3287,2,2,'2011-12-15 11:28:19','2011-12-15 11:28:19','Sem1',''),(3397,3032,4,4,'2011-12-15 11:28:36','2011-12-15 11:28:36','Sem1',''),(3398,2955,4,2,'2011-12-15 11:29:05','2011-12-15 11:29:05','Sem1',''),(3399,121,NULL,4,'2011-12-15 11:29:13','2011-12-16 10:17:45','Sem1','Medin has shown in the Metric skills 2 test that he understands all the basic concepts and skills that we have learned in Semester 1.   It is hardest to practice what you are not good at, but to become a really strong student (and person) we must face our weaknesses.  If you can tackle this inability to get homework or assignments completed you will be a very strong student indeed.  It is okay to ask for help or put yourself in an environment where you are \'forced\' to do what you need to do.  The after school sessions were effective and I think you should consider that at your new school.   Take care.  We will miss you.\r\nSincerely, Ms. Ashby'),(3400,3179,3,2,'2011-12-15 11:29:21','2011-12-15 11:29:21','Sem1',''),(3401,1167,NULL,4,'2011-12-15 11:29:38','2011-12-15 11:29:38','Sem1','Daggy is doing well keeping up with the content introduced in the course. She generally performs well but is occasionally disorganized and does not always come prepared for class. When she participates she makes positive contributions to the classroom.'),(3402,2913,4,4,'2011-12-15 11:29:42','2011-12-15 11:29:42','Sem1',''),(3403,522,NULL,1,'2011-12-15 11:30:53','2011-12-16 10:16:52','Sem1','Great job Nanseera.  All around excellence.   You understand the buoyancy concepts extremely well (the 6) and do a great job in all the labs.  I hope you might consider doing an independent study or experiment in the 3rd quarter to explore an aspect of science that you might like.  Keep up the good work.  \r\nSincerely, Ms. Ashby'),(3404,3464,4,2,'2011-12-15 11:30:59','2011-12-15 11:30:59','Sem1',''),(3405,3407,3,2,'2011-12-15 11:31:13','2011-12-15 11:31:13','Sem1',''),(3406,3345,3,2,'2011-12-15 11:31:28','2011-12-15 11:31:28','Sem1',''),(3407,3710,4,4,'2011-12-15 11:31:46','2011-12-15 11:31:46','Sem1',''),(3408,3566,4,4,'2011-12-15 11:32:03','2011-12-15 11:32:03','Sem1',''),(3409,3545,3,2,'2011-12-15 11:32:22','2011-12-15 11:32:22','Sem1',''),(3410,3518,3,2,'2011-12-15 11:32:37','2011-12-15 11:32:37','Sem1',''),(3411,3510,2,1,'2011-12-15 11:32:51','2011-12-15 11:32:51','Sem1',''),(3412,26,NULL,2,'2011-12-15 11:33:03','2011-12-16 10:16:13','Sem1','Excellent work Rekik.  You have a very solid understanding of all the science concepts learned in Semester 1.  Your understanding of the buoyancy concepts and the different variables in experimental design pushed you up in those benchmarks.  Well done.  Your hard work pays off.  Keep up the good work next semester.\r\nSincerely, Ms. Ashby'),(3413,3761,NULL,1,'2011-12-15 11:34:05','2011-12-15 11:34:05','Sem1','Although Diya arrived part way through the semester she has had no difficulty catching up and is performing well in the course. She makes positive contributions to classroom discussions and is able to work well both in a group and as an individual. She is consistent in her work ethic and finishes her assignments in a timely manner.'),(3414,2702,2,1,'2011-12-15 11:34:06','2011-12-15 11:34:06','Sem1',''),(3415,2133,2,1,'2011-12-15 11:34:20','2011-12-15 11:34:20','Sem1',''),(3416,585,NULL,2,'2011-12-15 11:34:25','2011-12-16 10:14:21','Sem1','Great work Sophie.  You have shown very solid understanding of all the benchmarks we studied this semester.  This shows a lot of improvement from quarter 1.  Well done.  I appreciate your positive energy and enthusiasm in the class and your focus during the laboratories.  To reach for the next level I would like to see if you are interesting in doing an independent study or experiment in the 3rd quarter.  Overall great job!  \r\nSincerely, Ms. Ashby'),(3417,2733,2,2,'2011-12-15 11:34:36','2011-12-15 11:34:36','Sem1',''),(3418,2543,2,2,'2011-12-15 11:35:06','2011-12-15 11:35:06','Sem1',''),(3419,2338,1,1,'2011-12-15 11:35:26','2011-12-15 11:35:26','Sem1',''),(3420,2657,3,2,'2011-12-15 11:35:45','2011-12-15 11:35:45','Sem1',''),(3421,1818,2,2,'2011-12-15 11:36:02','2011-12-15 11:36:02','Sem1',''),(3422,790,NULL,1,'2011-12-15 11:37:14','2011-12-15 11:37:14','Sem1','Julia easily follows the pace of the course. She is consistent in her effort and makes positive contributions during class discussions. She finishes her work in a timely manner and is able to work well with her peers.'),(3423,3399,3,2,'2011-12-15 11:37:27','2011-12-15 11:37:27','Sem1',''),(3424,2768,3,2,'2011-12-15 11:37:42','2011-12-15 11:37:42','Sem1',''),(3425,2059,3,2,'2011-12-15 11:38:00','2011-12-15 11:38:00','Sem1',''),(3426,1849,3,2,'2011-12-15 11:38:19','2011-12-15 11:38:19','Sem1',''),(3427,13,NULL,4,'2011-12-15 11:38:27','2011-12-16 09:35:04','Sem1','Ezana is improving in many areas.  His accurate measurement with rulers and his metric conversion are definitely two!  There are many areas he stills needs to work on.  Being careful with written answers and details would be helpful in general.  I think a lot of that has to do with focus.  He has done an excellent job understanding variables in experimental design.  Great job.  The after school sessions are productive and should continue in the 3rd quarter.  Keep working Ezana!  Sincerely, Ms. Ashby'),(3428,2671,3,2,'2011-12-15 11:38:40','2011-12-15 11:39:10','Sem1',''),(3429,2226,2,2,'2011-12-15 11:39:01','2011-12-15 11:39:01','Sem1',''),(3430,2541,16,NULL,'2011-12-15 11:39:31','2011-12-15 11:39:31','Sem1',''),(3431,2293,2,1,'2011-12-15 11:39:56','2011-12-15 11:39:56','Sem1',''),(3432,206,NULL,2,'2011-12-15 11:39:57','2011-12-16 09:25:12','Sem1','Kai has worked hard this semester and this shows with his solid understanding of all the benchmarks.  He is very reliable in terms of staying on top of his assignments and turning work in on time.  In class, Kai is an enthusiastic scientist, loving the labs most of all.  I would love to see Kai do an independent project next quarter designing an experiment or working on research topic that he is interested in.   Keep up the good work.  Sincerely, Ms. Ashby'),(3433,1975,4,4,'2011-12-15 11:40:22','2011-12-15 11:40:22','Sem1',''),(3434,1147,NULL,4,'2011-12-15 11:41:31','2011-12-15 11:41:31','Sem1','Keeghan is not working to his full potential in this class. He is capable of understanding the course work but does not always apply himself in class. He can sometimes be distracted and is not always fully engaged. Keeghan will see improvements if he can be more consistent with his effort and by making sure he fully understands directions.'),(3435,422,NULL,2,'2011-12-15 11:41:45','2011-12-16 09:58:57','Sem1','Michael is always looking for ways to improve his work.  When he saw his results on the metric skills test 2, he instantly asked if he could do a redo.  Normally, there would be a redo but this test was right at the end of the semester.  There will be time during quarter 3 to work on these skills and improve them.  A few of these skills Michael knew from 1st quarter but just forgot how to do them (eg graphing and interpreting).  He has done a great job with defining variables in experimental design.  In class, Michael has shown much more focus and self control.  He is more organized and gets his work in on time, which is a huge improvement from quarter 1.  Keep working hard Michael, it will pay off!\r\nSincerely, Ms. Ashby'),(3436,3027,17,1,'2011-12-15 11:41:57','2011-12-15 11:41:57','Sem1',''),(3437,254,NULL,2,'2011-12-15 11:44:06','2011-12-16 10:03:07','Sem1','Joshua has shown a solid understanding of the benchmarks for semester 1.  He is an enthusiastic  participant in a lot in class discussions.  I would like to see him take that skill to the next level which would be to think through his response before sharing it to the class.  This might also help with his written responses which need to be more elaborate (eg a few sentences not just one), thought through and then read through before submitting. This would take Josh to the next level in terms of assignments.  I appreciate Joshua\'s positive and playful spirit in class.  Keep working hard!  \r\nSincerely, Ms. Ashby'),(3438,2619,3,2,'2011-12-15 11:44:46','2011-12-15 11:44:46','Sem1',''),(3439,3160,17,1,'2011-12-15 11:44:50','2011-12-15 11:44:50','Sem1',''),(3440,2417,2,1,'2011-12-15 11:45:05','2011-12-15 11:45:05','Sem1',''),(3441,1061,NULL,2,'2011-12-15 11:45:08','2011-12-15 11:45:08','Sem1','Kgatiso has demonstrated a good understanding of the course material. He makes positive contributions to class discussions and works well with his peers. '),(3442,2809,2,1,'2011-12-15 11:45:32','2011-12-15 11:45:32','Sem1',''),(3443,2651,3,2,'2011-12-15 11:45:54','2011-12-15 11:45:54','Sem1',''),(3444,409,NULL,2,'2011-12-15 11:45:59','2011-12-16 09:56:49','Sem1','Patience is able to understand concepts with seemingly little effort.  She can be extremely efficient during labs but at other times, can also be distracted and waste tons of time.  It all depends how she wants to handle it.  I would like her to take on more of a leadership role in these cases of group work, and be the one to keep her group on task.  Patience has a great understanding of basic science theory and how to conduct experiments.  She can read instructions and follow them.  I hope she will consider doing an independent study or experiment in the 3rd quarter to explore an aspect of science that she might like.  Keep up the good work.  \r\nSincerely, Ms. Ashby'),(3445,2778,2,1,'2011-12-15 11:46:10','2011-12-15 11:46:10','Sem1',''),(3446,2350,3,2,'2011-12-15 11:46:33','2011-12-15 11:46:33','Sem1',''),(3447,2149,2,2,'2011-12-15 11:47:03','2011-12-15 11:47:03','Sem1',''),(3448,2028,3,2,'2011-12-15 11:47:22','2011-12-15 11:47:22','Sem1',''),(3449,303,NULL,2,'2011-12-15 11:47:55','2011-12-16 09:55:20','Sem1','Sina has shown very solid understanding of all the benchmarks we studied this semester.  This shows as lot of improvement from quarter 1.  Well done.  I appreciate your positive energy and enthusiasm in the class and your focus during the laboratories.  We will continue to work on our density concepts in the 3rd quarter so I am not worried about that benchmark.   Overall great job!  Keep working hard.  \r\nSincerely, Ms. Ashby'),(3450,186,NULL,4,'2011-12-15 11:50:33','2011-12-16 10:00:30','Sem1','Liyaan is a quiet and seemingly reluctant scientist, yet she has done a great job of understanding the basic concepts for semester 1.  Her reluctance to wear glasses impedes the review session we have and perhaps many other things.  It would be an interesting experiment to see what the impact would be!  Assignments are being submitted mostly on time.  I would say there has been a general improvement since quarter 1 and I am looking for this trend to continue with such an intelligent student!  Sincerely, Ms. Ashby'),(3451,803,NULL,1,'2011-12-15 11:50:38','2011-12-15 11:50:53','Sem1','Although Kiana arrived part way through the school year she has done well catching up with her missed work. She is able to fully understand the concepts taught in class and can analyze issues critically. Kiana works will with her peers and is consistent with her effort, providing her work in a timely manner.'),(3452,220,NULL,4,'2011-12-15 11:52:39','2011-12-16 10:01:55','Sem1','Kadiya has a solid understanding of the benchmarks for semester 1 with only three that really need review and improvement.  Kadiya needs a quiet place to get work done and I wonder if coming to my room one day a week after school,  might help her with assignments and clarify an questions she might have early on.  She has done a really great job with the buoyancy labs especially the last one that dealt with density.  Keep working hard Kadiya.  Sincerely, Ms. Ashby'),(3453,751,NULL,1,'2011-12-15 11:54:05','2011-12-15 11:54:05','Sem1','Layan is performing well in class. She is able to understand and synthesize new material easily. Her effort is consistently good an she works well alone or in a group.'),(3454,398,NULL,2,'2011-12-15 11:54:17','2011-12-16 09:59:51','Sem1','Lonaoui has done very well on all the semester 1 benchmarks.  He has a good approach to the science labs in class and is very purposeful in his actions.  With his absences, I felt he was always playing catch-up rather than working towards an \'exceeds the standard\' project.  Lonaoui answered the exceed the standard questions very well on the metric skills test 2 which bumped him up in two benchmarks. \r\nI look forward to trying to inspire Lonanoui to take on an independent project of his own choosing in the 3rd quarter. \r\nSincerely,  Ms. Ashby'),(3455,922,NULL,1,'2011-12-15 11:55:54','2011-12-15 11:55:54','Sem1','Leah is working well in class. She is able to understand new material and makes positive contributions to classroom discussions. She is sometimes distracted in class but she is able to work well with her peers.'),(3456,198,NULL,2,'2011-12-15 11:56:11','2011-12-16 09:57:56','Sem1','Nkotseng has done a great job of achieving the standard in all the benchmarks for semester 1.  She has improved a lot in her organization and ability to get work done.  I appreciate her positive focus during labs and would encourage her to ask questions if she doesn\'t understand a concept.  Overall a good first semester.  Sincerely, Ms. Ashby'),(3457,2677,3,1,'2011-12-15 11:57:16','2011-12-15 11:57:16','Sem1',''),(3458,2840,17,1,'2011-12-15 11:58:28','2011-12-15 11:58:28','Sem1',''),(3459,488,NULL,2,'2011-12-15 11:58:47','2011-12-16 09:56:04','Sem1','Samuel has worked hard this semester and this shows with his solid understanding of all the benchmarks.  He is reliable in terms of staying on top of his assignments and turning work in on time.  In class, Samuel is an inquisitive scientist,  getting used to the structure and uncertainty of the labs.  I would love to see Samuel do an independent project next quarter designing an experiment or working on research topic that he is interested in.   Keep up the good work.  Sincerely, Ms. Ashby'),(3460,2623,3,2,'2011-12-15 11:59:03','2011-12-15 11:59:03','Sem1',''),(3461,2442,2,1,'2011-12-15 11:59:22','2011-12-15 11:59:22','Sem1',''),(3462,3196,17,1,'2011-12-15 11:59:32','2011-12-15 11:59:32','Sem1',''),(3463,2688,3,2,'2011-12-15 12:00:01','2011-12-15 12:00:01','Sem1',''),(3464,2725,4,2,'2011-12-15 12:00:18','2011-12-15 12:00:18','Sem1',''),(3465,2635,2,1,'2011-12-15 12:00:52','2011-12-15 12:00:52','Sem1',''),(3466,2474,2,2,'2011-12-15 12:01:16','2011-12-15 12:01:16','Sem1',''),(3467,326,NULL,2,'2011-12-15 12:01:32','2011-12-16 09:29:04','Sem1','Cuthbert has done a great job on most of the benchmarks, just having two that need a little more work. Cuthbert can be a bit forgetful with homework, but gets it in eventually.  He shows really good precision in his data collection but needs to pay attention to his details on graphs.  We will continue to work on variables when designing experiments in the third quarter, so I am not worried too much about this benchmark.  I would like to see Cuthbert continue his positive approach to science labs and work a bit more on staying organized with assignments.  Overall, good job Cuthbert.  \r\nSincerely, Ms. Ashby'),(3468,2342,5,2,'2011-12-15 12:01:36','2011-12-15 12:01:36','Sem1',''),(3469,2426,3,1,'2011-12-15 12:02:15','2011-12-15 12:02:15','Sem1',''),(3470,849,NULL,1,'2011-12-15 12:02:33','2011-12-15 12:02:33','Sem1','Leyla is performing very well in class. She easily understands and incorporates new course material. She makes positive contributions to classroom discussions and recognizes the viewpoints of her peers. She works well in groups as well as on her own.'),(3471,466,NULL,2,'2011-12-15 12:03:20','2011-12-16 09:53:01','Sem1','Gen works hard and is very meticulous in his approach to the lab work.  He has achieved well in all benchmarks for Semester 1, even exceeding the standard in his understanding and calculations of buoyancy concepts.   I would like to see Gen take on an independent study or experiment in the 3rd quarter to explore an aspect of science that he might like, and to develop his experiment design skills as well. Keep working hard. \r\nSincerely,  Ms. Ashby '),(3472,3114,17,1,'2011-12-15 12:03:57','2011-12-15 12:03:57','Sem1',''),(3473,3104,17,2,'2011-12-15 12:04:19','2011-12-15 12:04:19','Sem1',''),(3474,2934,3,2,'2011-12-15 12:04:31','2011-12-15 12:04:31','Sem1',''),(3475,3275,3,1,'2011-12-15 12:04:48','2011-12-15 12:04:48','Sem1',''),(3476,513,NULL,4,'2011-12-15 12:04:56','2011-12-16 09:54:37','Sem1','Sofia has done a good job on most of the semester 1 benchmarks.  She had a little trouble with some interpreting questions on the metric skills test 2, which we can review together.  Sofia is doing a good job in general but sometimes has trouble getting assignments in on time.  Being careful with the details and staying organized would be good goals for quarter 3.  Overall, good work Sofia!  Sincerely, Ms. Ashby'),(3477,3303,17,1,'2011-12-15 12:05:03','2011-12-15 12:05:03','Sem1',''),(3478,2921,4,2,'2011-12-15 12:05:06','2011-12-15 12:05:06','Sem1',''),(3479,3236,3,1,'2011-12-15 12:05:19','2011-12-15 12:05:19','Sem1',''),(3480,968,NULL,1,'2011-12-15 12:05:26','2011-12-15 12:05:26','Sem1','Makda is performing very well in class. She understands new course material and has no problem keeping pace with the course. Her effort is consistently good and she recognizes the viewpoints of her peers. She completes her work and is able to work well with her peers.'),(3481,2772,4,2,'2011-12-15 12:05:53','2011-12-15 12:05:53','Sem1',''),(3482,291,NULL,2,'2011-12-15 12:06:32','2011-12-16 09:33:26','Sem1','Enrico is a naturally inquisitive scientist who really enjoys doing labs and exploring new concepts.  He sometimes has trouble remembering details (title, units) on graphs, but in general his understanding of the semester 1 benchmarks are good.  We need to review interpreting graphs and how to calculate density but that is it.  I appreciate his focus and good data collection during labs.   I would like to see Rico take on an independent study or experiment in the 3rd quarter to explore an aspect of science that he might like and to develop his experiment design skills as well. Keep working hard. \r\nSincerely,  Ms. Ashby '),(3483,2361,2,2,'2011-12-15 12:06:54','2011-12-15 12:06:54','Sem1',''),(3484,3168,2,2,'2011-12-15 12:07:11','2011-12-15 12:07:11','Sem1',''),(3485,2668,4,2,'2011-12-15 12:07:20','2011-12-15 12:07:20','Sem1',''),(3486,2852,2,1,'2011-12-15 12:07:23','2011-12-15 12:07:23','Sem1',''),(3487,2841,2,1,'2011-12-15 12:07:43','2011-12-15 12:07:43','Sem1',''),(3488,3031,4,2,'2011-12-15 12:07:45','2011-12-15 12:07:45','Sem1',''),(3489,1124,NULL,2,'2011-12-15 12:07:54','2011-12-15 12:07:54','Sem1','Malik is doing well in class. He is an active participant in class discussions and keeps up with the flow of the course material. He should work on being more consistent 