 12:11:16','Sem1',''),(3507,2165,1,1,'2011-12-15 12:11:25','2011-12-15 12:11:25','Sem1',''),(3508,2307,2,2,'2011-12-15 12:11:36','2011-12-15 12:11:36','Sem1',''),(3509,626,NULL,2,'2011-12-15 12:12:54','2011-12-16 09:28:02','Sem1','Clara has really improved a great deal this semester.  I appreciate her contributions to class discussions as well as her reliability on getting assignments in.  She needs to remember the small details like units or titles, but in general is solid in all the semester 1 concepts.  Keep working hard, it is paying off!  Sincerely, Ms. Ashby'),(3510,2373,4,2,'2011-12-15 12:13:28','2011-12-27 08:03:50','Sem1','Yohannes has been doing fine in general, especially in class, but has had to re-do several assessments and has not shown marked improvement on them.'),(3511,991,NULL,1,'2011-12-15 12:13:40','2011-12-15 12:14:15','Sem1','Rebekah is performing well in class. She makes positive contributions to class discussions and is able to recognize the viewpoints of her peers. She understands and incorporates new ideas and is able to easily follow the course material. She works well as an individual and in group activities and is consistently strong in her effort.'),(3512,2503,4,2,'2011-12-15 12:14:00','2011-12-15 12:14:00','Sem1',''),(3513,2696,1,1,'2011-12-15 12:14:43','2011-12-15 12:14:43','Sem1',''),(3514,2516,3,2,'2011-12-15 12:15:24','2011-12-15 12:15:24','Sem1',''),(3515,159,NULL,2,'2011-12-15 12:15:32','2011-12-16 10:32:35','Sem1','Bamlak has done a lot of great work this quarter.  He has very good intentions in class but I feel sometimes he gets distracted or is embarrassed to ask questions or get help.  He has made a lot of good improvements during the 2nd quarter especially with graphing.  There are a couple of areas that need to be improved, which will be worked on third quarter.  Keep working hard Bamlak, and ask lots of questions! \r\nSincerely, Ms. Ashby'),(3516,2594,4,2,'2011-12-15 12:15:39','2011-12-15 12:15:39','Sem1',''),(3517,2558,2,