s discussions and is very enthusiastic about it.  I would like to see him take that skill to the next level which would be to think through his response before sharing it to the class.  This might also help with his written responses which need to be more elaborate (eg a few sentences not just one), thought through and then read through before submitting.  I think the after school sessions are productive and would like to continue those in the next quarter.  I really enjoy having Abdu in my class.   If his enthusiasm can be channelled by a little focus into productive work then he should be very successful indeed. \r\nSincerely, Ms. Ashby. '),(3528,2580,2,1,'2011-12-15 12:21:08','2011-12-15 12:22:27','Sem1',''),(3529,873,NULL,1,'2011-12-15 12:22:44','2011-12-15 12:22:44','Sem1','Sarah is performing very well in class. She easily understands and synthesizes new material and has no trouble following the flow of the course. She makes positive contributions to the classroom discussions and her effort is consistently good.'),(3530,2602,3,2,'2011-12-15 12:23:04','2011-12-15 12:23:04','Sem1',''),(3531,2408,3,2,'2011-12-15 12:23:22','2011-12-15 12:23:22','Sem1',''),(3532,2453,1,1,'2011-12-15 12:23:36','2011-12-15 12:23:36','Sem1',''),(3533,2615,3,2,'2011-12-15 12:23:54','2011-12-15 12:23:54','Sem1',''),(3534,2416,2,1,'2011-12-15 12:24:13','2011-12-15 12:24:13','Sem1',''),(3535,2648,5,2,'2011-12-15 12:24:33','2011-12-15 12:24:33','Sem1',''),(3536,2781,3,2,'2011-12-15 12:24:50','2011-12-15 12:24:50','Sem1',''),(3537,2812,3,2,'2011-12-15 12:26:21','2011-12-15 12:26:21','Sem1',''),(3538,836,NULL,2,'2011-12-15 12:26:28','2011-12-15 12:26:28','Sem1','Sawyer is a strong contributor to the classroom discussions. He is able to understand new material easily and demonstrates strong effort for the most part. He will see his grades improve if he is able to be more consistent with the work he puts into his assignments.'),(3539,2464,2,2,'2011-12-15 12:29:00','2011-12-15 12:29:00','Sem1',