ocus and remembering the details on tests is difficult for him.  He shows a wide range of knowledge and shares this very well during class discussions, often bringing in a new perspective.  I appreciate his love of plants and gardening, and hope that he will create an independent project with that in the third quarter.  Good job Jared.  Sincerely, Ms. Ashby'),(3546,1704,NULL,6,'2011-12-15 12:40:50','2011-12-15 12:40:50','Sem1','Ammanuel showed overall achievement of standards in writing this semester.  He would benefit by being prepared for class and placing more effort into his work in order to display achievement across the board in English.  '),(3547,482,NULL,4,'2011-12-15 12:42:16','2011-12-16 10:23:17','Sem1','Jonathan has improved his measurement skills and now is much more accurate in his data collection.  He still needs to pay attention to important details like units and titles.  He has a solid understanding of most of the benchmarks, with only a couple to review.  The biggest issue so far has been getting work done outside of class and handing it in on time and done well.  I feel this is more an organization and time management issue than anything else.  Having a \'study hall\' once a week after school, where he stays to work on assignments (in math, science or other classes) would really help him stay on top of his work.  The \'check-ins\' are less effective, as the assignments are usually forgotten the next day anyway.  I really enjoy having Jonathan in my class.  I find him very enthusiastic about science and he really enjoys doing the laboratories.  I look forward to a productive 3rd quarter!  Sincerely, Ms. Ashby\r\n'),(3548,2084,2,2,'2011-12-15 12:46:44','2011-12-15 12:46:44','Sem1',''),(3549,1309,NULL,4,'2011-12-15 12:48:34','2011-12-15 12:48:34','Sem1','Ammr completed the semester with achievement of most standards in English.  His strengths were displayed in literature and writing.  Ammr would benefit by focusing more carefully on the conventions of English as well as using and studying more carefully vocabulary words studied in class.   '),(3550,1643,NULL,1,'2011-12-15 12:52:07','2011-12-15 12:55:06','Sem1','Liesl is an excellent student. She is always focused and on task. She asks insightful questions and she participates well in class. I encourage her to keep up the good work.\r\n\r\nSincerely yours,\r\n\r\nMr. Goliad Tamerou'),(3551,1966,4,2,'2011-12-15 12:54:07','2011-12-15 12:54:07','Sem1','Momodou needs to be more focused on his writing skills.\r\nHe has to improve French grammar and spelling and we will try with extra work after the holidays.\r\nHe participates well in class and contributes with relevant ideas.\r\n\r\n'),(3552,2029,3,2,'2011-12-15 12:54:19','2011-12-15 12:54:19','Sem1',''),(3553,133,NULL,1,'2011-12-15 12:54:20','2011-12-15 12:54:20','Sem1','Maria is a very good student. She is always focused and on task. She participates well in class. I encourage her to keep up the good work.\r\n\r\nSincerely yours,\r\n\r\nMr. Goliad Tamerou'),(3554,573,NULL,4,'2011-12-15 12:55:37','2011-12-16 09:06:51','Sem1','Kojo has made average progress this year in Physical Education.  He is able to perform and develop some skills and tactics in some of the activities covered in PE lessons and can apply some skills within a preferred activity with occasional success that influences his performance.  Looking forward Kojo needs to develop more coordination skills and would benefit from becoming involved in extra-curricular activities.  Overall a good start to the year, and I will look forward to his progress in the second semester.\r\n\r\nNG = No Grade - indicates the benchmark was not assessed during this grading period.'),(3555,101,NULL,4,'2011-12-15 12:59:39','2012-01-04 05:45:22','Sem1','Abdu still comes to class regularly without a pencil or his book or another crucial supply item.  He needs to build his organizational skills in order to focus more on learning in class.'),(3556,276,NULL,2,'2011-12-15 13:01:13','2011-12-16 09:07:02','Sem1','Lara has made above average progress this year in Physical Education.  She is able to perform and develop a range of skills, tactics and understanding in most activities covered in PE lessons and can select and apply skills that suit most sports and briefly comment on how those skills have been used in her own and others\' performances.  Looking forward Lara needs to foster a greater sense of confidence in her Physical Education abilities as I believe she is very capable of excelling even her own expectations.  Overall, a great start to the year and I look forward to the positive changes the latter half of the year will bring.\r\n\r\nNG = No Grade - indicates the benchmark was not assessed during this grading period.'),(3557,1759,NULL,2,'2011-12-15 13:03:00','2011-12-15 13:03:00','Sem1','Asha worked with focus, engagement and effort this semester in English where she displayed particular strength in writing and listening/speaking.  Asha would benefit by practicing summarizing literature, by studying and using with greater intensity vocabulary words studied in class, and by tending more closely to the conventions of English when writing.  '),(3558,393,NULL,2,'2011-12-15 13:05:09','2012-01-03 09:43:28','Sem1','Lonaoui is a very good student. However, Lonaoui works too quickly and makes mistakes. He is also easily distracted in class. I believe that if Lonaoui focuses more and puts a little extra effort, he can improve his skills more rapidly.\r\n\r\nSincerely yours,\r\n\r\nMr. Goliad Tamerou'),(3559,1705,3,2,'2011-12-15 13:07:07','2011-12-15 13:07:07','Sem1',''),(3560,524,NULL,1,'2011-12-15 13:07:10','2011-12-15 13:08:01','Sem1','Nanseera is an excellent student. She is always focused and on task. She asks insightful questions and she participates well in class. I encourage her to keep up the good work.\r\n\r\nSincerely yours,\r\n\r\nMr. Goliad Tamerou'),(3561,1678,3,1,'2011-12-15 13:07:42','2011-12-15 13:07:42','Sem1',''),(3562,1898,