1','Aisha has made excellent progress this year in Physical Education.  She is is able to perform and develop a wide range of skills, tactics and understanding in all activities covered in PE lessons.  She can also select and apply skills that suit any sport and comment on how those skills have been used in her own and others\' performance.  Aisha is always prepared, organized, attentive, and applies herself to the lessons with full dedication and effort.  Looking forward Aisha could benefit from developing more advanced skills in team sports such as volleyball or basketball.  Building on her skill will allow her to develop her self-confidence, which in turn will promote her enjoyment and active participation in team sports.  Overall, a very impressive year so far - keep up the great attitude!\r\n\r\nNG = No Grade - indicates the benchmark was not assessed during this grading period.'),(3765,62,NULL,2,'2011-12-16 06:47:14','2011-12-16 06:56:26','Sem1','Hafeleni is a very good student. She participates well in class. She shows enthusiasm and curiosity for the subject. I believe that if Hafeleni puts a little extra effort to practice the grammatical structures learned in class, she can improve her skills more rapidly. I encourage her to keep up the good work.\r\n\r\nSincerely yours,\r\n\r\nMr. Goliad Tamerou'),(3766,1523,NULL,2,'2011-12-16 06:47:52','2011-12-16 08:45:35','Sem1','Matthew shows in depth understanding and can articulate the concepts taught clearly and in detail.  He organizes information effectively to support and demonstrate ideas and concepts.\r\nNG = No Grade - indicates the benchmark was not assessed during this grading period.'),(3767,1236,NULL,2,'2011-12-16 06:48:33','2011-12-16 06:48:33','Sem1','Penehafo has made progress in the last quarter in using art skills and knowledge in a variety of contexts.  She continues to have some difficulty following directions, and should work on advocating for herself as a student and asking for help when needed.\