:13','Sem1','Jasmin-\r\n\r\n-participates occasionally\r\n-does well on assessments\r\n-should see me outside of class when confused\r\n\r\nNice job this semester!'),(4054,1632,NULL,4,'2011-12-16 08:01:32','2011-12-16 08:13:41','Sem1','Jon-\r\n\r\n-does well on assessments\r\n-participates often\r\n-is often distracting others in class\r\n\r\nNice job this semester!'),(4055,1788,NULL,2,'2011-12-16 08:02:02','2011-12-16 08:14:27','Sem1','Nisala-\r\n\r\n-participates often\r\n-asks great questions\r\n-speaks out of turn and sometimes distracts others\r\n\r\nNice job this semester!'),(4056,1093,NULL,1,'2011-12-16 08:02:34','2011-12-16 08:02:34','Sem1','Yohanna shows a consistent and thorough understanding of the required knowledge and skills in Books and Films.  She generally provides evidence of being able to analyze, synthesize and apply concepts learned in class.\r\n\r\nShe is a sincere and mature student.  Very focused, hardworking and studious.'),(4057,885,NULL,4,'2011-12-16 08:03:44','2011-12-16 09:06:18','Sem1','Amanda showed improvement in her classwork this quarter.  However, she should take advantage of the opportunity to improve her work in light of feedback.  '),(4058,1073,NULL,5,'2011-12-16 08:04:17','2011-12-16 09:12:20','Sem1','Ben struggles with focus during lab activities and during classroom discussions.  When he is on-task and participating, however, his contributions improve the classroom environment.  Lab work is often turned in late and does not show consistent effort.  He should also take advantage of the opportunity to improve his work.  '),(4059,1761,NULL,1,'2011-12-16 08:04:48','2011-12-16 08:07:31','Sem1','Asha has worked hard all semester and is making very good progress in Pre-Algebra. Well done, Asha!\r\n\r\nFiona Thangata'),(4060,767,NULL,4,'2011-12-16 08:04:50','2011-12-16 09:15:08','Sem1','Charlotte is mostly on-task during lab activities and classroom discussions.  Increased participation in discussions would be a welcome improvement.  Lab work is often turned in late and is at times an exact copy of her partners\' work.  '),(4061,1487,NULL,4,'2011-12-16 08:05:10','2011-12-16 08:05:10','Sem1','This semester, the students have been learning about the house, getting around in town, daily routines, and more. Zarmesh has not always been focused in class and he often needed to be reminded about deadlines. He is talented for Spanish, but in order to develop his language skills he needs to practice at home. He would benefit from regular revising of vocabulary and of verbs and sentence structure. \r\nGabriela Gade'),(4062,1577,NULL,2,'2011-12-16 08:05:18','2011-12-16 08:05:18','Sem1','Biram is an extremely hard working student who consistently turns in work of a high standard.  He uses feedback efficiently, participates well in all activities, and is an effective communicator in all media.  He now needs to develop his use of transitions and conjunctions in his written work.'),(4063,696,NULL,4,'2011-12-16 08:05:22','2011-12-16 09:17:24','Sem1','Diego is often on task during lab activities.  He struggles with focus during classroom discussions and increased participation would be a welcome improvement.  He should also take advantage of the opportunity to improve his work.  '),(4064,1051,NULL,2,'2011-12-16 08:05:46','2011-12-16 09:19:38','Sem1','Elliot is consistently on-task during lab activities and classroom discussions.  His ideas and contributions are a welcome addition to the classroom environment.  He shows evidence of high level thinking and problem solving.  He is a natural inquirer.  '),(4065,1016,NULL,2,'2011-12-16 08:06:17','2011-12-16 09:23:07','Sem1','Emma is consistently on-task during lab activities and classroom discussions.  Her contributions improve the classroom environment.  She shows consistent effort in her lab work and is a pleasure to have in class.'),(4066,100,NULL,2,'2011-12-16 08:06:32','2011-12-16 08:06:32','Sem1','Works well in small groups.  Tries hard. Shows a good understanding of the required knowledge and skills.  Is a great member of class.'),(4067,2000,5,4,'2011-12-16 08:07:13','2011-12-16 08:07:13','Sem1','Bethel continues to struggle with many topics in the Pre-Algebra course. I would like Bethel to commit to one day a week for after school help from January onwards. The extra time to practice and ask questions will benefit her. \r\n\r\nFiona Thangata'),(4068,1110,NULL,6,'2011-12-16 08:07:32','2011-12-16 10:18:49','Sem1','Jarrah struggles with focus during lab activities and during classroom discussions.  He also shows an unwillingness to improve his understanding or performance in class.  He is frequently unprepared for class.  NG marks indicate an exemption from the particular assessment.'),(4069,782,NULL,2,'2011-12-16 08:08:03','2011-12-16 09:28:44','Sem1','Kahlil is consistently on-task during lab activities and classroom discussions.  His contributions improve the classroom environment.  When his lab work is submitted it is very high quality.  However, he not submitted all lab assignments this quarter.'),(4070,818,NULL,4,'2011-12-16 08:08:09','2011-12-16 09:05:09','Sem1','Tomas has made above average progress this year in Physical Education.  He is able to perform and develop a wide range of skills, tactics and understanding in most activities covered in PE lessons.  Tomas can select and apply skills that suit most sports and briefly comment on how those skills have been used in his own and others\' performances.  Looking forward, Tomas has a solid foundation that he should strive to develop into more advanced skills.  He could also benefit from improving his punctuality and organizational skills, striving to arrive to all lessons with full kit.  Overall, a good start to the year with scope for improvement.\r\n\r\nNG = No Grade - indicates the benchmark was not assessed during this grading period.'),(4071,704,NULL,4,'2011-12-16 08:08:35','2011-12-16 09:33:02','Sem1','Kaleb is on-task during lab activities most of the time.  