rated rich language into her stories.     \r\n(NG = No Grade - indicates the benchmark was not assessed during this grading period.)'),(4225,1506,NULL,1,'2011-12-16 08:37:10','2012-01-11 10:56:02','Sem1','Anna continues to make improvements in her reading and writing.  She is feeling more confident with her English language abilities, both socially and academically.  To continue to improve, she should ask questions and continually revise her writing.'),(4226,1012,NULL,1,'2011-12-16 08:37:56','2011-12-16 08:55:07','Sem1','Maeve has been very responsible and on top of things in class.'),(4227,1300,NULL,2,'2011-12-16 08:38:53','2012-01-03 10:11:23','Sem1','Kalkidan is working very hard in English Language Arts and making good progress in her written work. She needs to develop her use of transitions and accuracy of punctuation. By reading more challenging texts, she will also develop her vocabulary further. Keep up the good work!'),(4228,1561,NULL,4,'2011-12-16 08:39:23','2011-12-16 08:39:23','Sem1','I think that with increased effort Ratu could achieve more in Pre-Algebra. She has made some progress this semester, but there are some areas that need more work, such as solving equations. I am available for extra help after school, when Ratu can ask questions and get further practice to increase her knowledge and understanding. \r\n\r\nFiona Thangata'),(4229,3134,16,5,'2011-12-16 08:39:30','2011-12-16 08:39:30','Sem1',''),(4230,1779,NULL,1,'2011-12-16 08:39:53','2011-12-16 08:39:53','Sem1','Philipp has made wonderful progress this semester with his social and academic English.  He is not afraid to ask questions for clarification or assistance.  He\'s received an \'INC\' or incomplete, as he hasn\'t presented his writing portfolio yet.  Once this is complete in January, he will receive a grade for this benchmark.'),(4231,2277,17,2,'2011-12-16 08:40:09','2012-01-11 10:56:25','Sem1',''),(4232,977,NULL,1,'2011-12-16 08:40:21','2011-12-16 08:55:24','Sem1','Makda has shown tremendous effort and perseverance in class.'),(4233,666,NULL,1,'2011-12-16 08:40:38','2011-12-16 08:40:38','Sem1','Annemaries\'s excellent efforts and achievement of all standards in English this semester is commendable.  Although conventions were not a benchmark this semester, Annmarie displays difficulty writing using correct English conventions.  \r\n(NG = No Grade - indicates the benchmark was not assessed during this grading period.)'),(4234,2066,17,4,'2011-12-16 08:41:07','2011-12-16 08:42:00','Sem1',''),(4235,2219,17,1,'2011-12-16 08:41:27','2011-12-16 08:42:11','Sem1',''),(4236,2372,4,2,'2011-12-16 08:41:47','2012-01-11 10:57:00','Sem1',''),(4237,1562,NULL,2,'2011-12-16 08:42:07','2011-12-16 08:42:07','Sem1','Ratu is working hard in English Language Arts and making very good progress in her written assignments.  She still needs support getting assignments in on time, and after school study hall and/or tutoring has proved successful in helping her do this, so I highly recommend she enroll in this in Semester 2.   '),(4238,1064,NULL,2,'2011-12-16 08:42:18','2011-12-16 08:42:18','Sem1','Kgatiso had made very good progress this semester in Pre-Algebra. He shows good understanding of all the topics. He works on a range of mathematical problems with confidence and insight. \r\n\r\nFiona Thangata'),(4239,2508,17,2,'2011-12-16 08:42:24','2011-12-16 08:42:24','Sem1',''),(4240,880,NULL,1,'2011-12-16 08:42:37','2011-12-16 08:55:40','Sem1','Sarah has been a responsible leader in class and shown excellent musicality.'),(4241,12,NULL,1,'2011-12-16 08:43:31','2011-12-16 08:43:31','Sem1','Abale participates well in drama.  She uses skills taught naturally in performances.  She shows understanding of concepts through quizzes and reflections.'),(4242,918,NULL,1,'2011-12-16 08:43:43','2011-12-16 08:55:52','Sem1','Simon has been very creative in his musical composition ability.'),(4243,1080,NULL,2,'2011-12-16 08:43:55','2012-01-02 09:36:13','Sem1','Ben shows a consistent and thorough understanding of the required knowledge and skills in Odyssey of the Mind.  He is creative, innovative and has great ideas when working on his projects.  \r\n\r\nHe works well with others but is also confident to work on his own . His Monument Project showed his high regard for family and his Antland project showed his ability to design and build.  Perhaps Ben will become an engineer in the future!  \r\n\r\nGood luck, Ben.'),(4244,734,NULL,2,'2011-12-16 08:44:34','2011-12-16 09:03:32','Sem1','Mikal has made above average progress this year in Physical Education.  She is able to perform and develop a range of skills, tactics and understanding in most activities covered in PE lessons.  She can select and apply skills that suit most sports and briefly comment on how those skills have been used in her own and others\' performances.  Looking forward Mikal could benefit from developing more advanced skills in team sports.  Building on her skill will allow her to develop her self-confidence, which in turn will promote her enjoyment and active participation in team sports.  Mikal would also benefit from listening attentively, focusing her full attention and efforts on the lessons.  Overall, a very good year so far - keep up the good work!\r\n\r\nNG = No Grade - indicates the benchmark was not assessed during this grading period.'),(4245,859,NULL,2,'2011-12-16 08:44:59','2011-12-16 08:56:05','Sem1','Thuso has been a consistent team player in group work.'),(4246,1694,NULL,1,'2011-12-16 08:45:02','2011-12-16 08:45:02','Sem1','Krubel is producing consistently great work in English Language Arts!  He continually revises and reworks assignments, and submits all work within deadlines and often earlier.  In second semester, I encourage him to have more confidence in participating in group discussions.'),(4247,564,NULL,2,'2011-12-16 08:45:55','2011-12-16 08:45:55','Sem1','Abigail is an able and conscientious member of the group who displays a real interest in the subject and appears to enjoy all aspects of the work. She has developed a good general health knowledge and is always willing to share her ideas with the rest of the class during discussion. Overall, a very good semester. Frank Bartmann'),(4248,1692,NULL,1,'2011-12-16 08:46:20','2011-12-16 08:46:20','Sem1','Krubel always works conscientiously and meticulously. He is keen to understand every detail in a topic. He asks good questions and is able to give reasons for his answers. Krubel has made excellent progress in Pre-Algebra this semester, as his benchmarks indicate. \r\n\r\nFiona Thangata '),(4249,1474,NULL,1,'2011-12-16 08:46:36','2011-12-16 08:56:15','Sem1','Victor has been innovative in his musical performances.'),(4250,1453,NULL,2,'2011-12-16 08:46:48','2011-12-16 08:46:48','Sem1','This semester the students have been investigating about Global Issues in Ethiopia and in one other country of their choice. This international Global Issues portrait was presented to the class at the end of the unit. Afshana showed an understanding about the problems in Fiji Islands. Her presentation was informative and insightful. \r\nGabriela Gade '),(4251,1645,NULL,1,'2011-12-16 08:47:58','2011-12-16 08:47:58','Sem1','Liesl is working extremely hard in English Language Arts this semester and consistently produces work of outstanding quality. Keep up the great work! '),(4252,210,NULL,2,'2011-12-16 08:48:01','2011-12-16 08:48:01','Sem1','Kai has developed an excellent general health knowledge and is always willing to share his ideas with the rest of the class during discussion. The general quality of his written work has been consistently very good, both in terms of content and presentation. I hope he can sustain his current interest in and enthusiasm towards Health.\r\nOverall, a very good semester. Frank Bartmann'),(4253,95,NULL,2,'2011-12-16 08:48:09','2011-12-16 08:56:26','Sem1','Wedu has been a good team player in group work.'),(4254,1331,NULL,2,'2011-12-16 08:48:26','2011-12-16 08:56:14','S