1','This semester the students have been investigating about Global Issues in Ethiopia and in one other country of their choice. This international Global Issues portrait was presented to the class at the end of the unit. Marda has been quiet in class, and did not actively participate in discussions or debates. However, she was focused and put a lot of effort in her research and presentation about Rwanda. \r\nGabriela Gade '),(4327,961,NULL,2,'2011-12-16 09:18:01','2011-12-16 09:18:01','Sem1','Sakshi should push herself to read seventh grade literature.  This will help her develop skills in both reading and writing.  Sakshi has improved by taking more risks and seeking out more feedback on her writing.  \r\nNG = No Grade - indicates the benchmark was not assessed during this grading period.\r\n'),(4328,876,NULL,1,'2011-12-16 09:18:08','2011-12-16 09:18:08','Sem1','Sarah has a sound understanding of a range of mathematical topics, and is able to apply her knowledge to a wide variety of problems. She particularly enjoys problem solving questions that challenge her thinking. her work is always of a high standard. \r\n\r\nFiona Thangata'),(4329,479,NULL,4,'2011-12-16 09:18:09','2011-12-16 09:18:09','Sem1','Jonathan is a friendly student who works with enthusiasm in the classroom, and regularly contributes to class discussion. He has developed a good general health knowledge and is always willing to share ~ ideas with the rest of the class during discussion.\r\nHowever, although the quality of his answers is usually good, he needs to work on the presentation of his written work. Overall, a good semester. Frank Bartmann'),(4330,1753,NULL,2,'2011-12-16 09:18:23','2011-12-16 09:18:23','Sem1','William is producing consistently great work in ELA and reading a wide range of both fiction and non-fiction work.  I encourage to participate even further in full group discussions, and to ask for organizational help if he needs it (for example in submitting reading evidence).'),(4331,274,NULL,1,'2011-12-16 09:19:02','2011-12-16 09:19:02','Sem1','Lara\'s outstanding efforts and achievement of all standards in English this semester is commendable.  She showed tremendous growth in her writing where she incorporated rich language into her stories.  She also articulated well her ideas about literature in a discussion forum.       \r\n(NG = No Grade - indicates the benchmark was not assessed during this grading period.)\r\n'),(4332,1402,NULL,1,'2011-12-16 09:19:27','2011-12-16 09:24:15','Sem1','This semester the students have been investigating about Global Issues in Ethiopia and in one other country of their choice. This international Global Issues portrait was presented to the class at the end of the unit. Nadezhda put a lot of effort in her research and presentation about the Solomon Islands. Her presentation was informative and insightful. Nadezhda showed a possitive attitude for service during our service project in the AHope Orphanage. She actively participated in class discussions and debates. \r\nGabriela Gade'),(4333,827,NULL,2,'2011-12-16 09:19:53','2011-12-16 09:19:53','Sem1','Sam is making significant progress in reading though he does not yet meet standards.  Sam meets standards in many aspects of writing though he is still building his English vocabulary and convention skills.\r\nNG = No Grade - indicates the benchmark was not assessed during this grading period.'),(4334,1693,NULL,1,'2011-12-16 09:20:33','2011-12-16 09:20:33','Sem1','Krubel is a hardworking student who knows his goals and objectives.  He works well with others but is better working by himself.  His projects in OM shows that he has gained confidence and skills in designing, building and creating.\r\n\r\nHe is mature, responsible and focused.  A great member of class.'),(4335,388,NULL,1,'2011-12-16 09:21:21','2011-12-16 09:21:21','Sem1','Jacob is a solid scientist.  He understand the basics of labs, how to do them, how to collect data and how to analyze it.  I would like to see Jacob take on an independent study or experiment in the 3rd quarter to explore an aspect of science that he likes and to further his science skills. \r\nSincerely, Ms. Ashby'),(4336,257,NULL,4,'2011-12-16 09:21:35','2011-12-16 09:21:35','Sem1','Joshua is a friendly student who works with enthusiasm in the classroom, and regularly contributes to class discussion. He does, however, tend to rush at his work, resulting in careless mistakes, whether in written answers or practical work. Also, he can get confused when he doesn\'t always listen to instructions carefully enough. However, his written work, while usually acceptable, is rarely as detailed or as well presented as I would wish. Overall, a good semester. Frank Bartmann'),(4337,946,NULL,4,'2011-12-16 09:21:56','2011-12-16 09:21:56','Sem1','Theo should push himself to read seventh grade literature.  This will help him develop skills in both reading and writing.  Theo needs to build organization skills to be better better prepared for learning activities. \r\nNG = No Grade - indicates the benchmark was not assessed during this grading period.'),(4338,134,NULL,1,'2011-12-16 09:23:01','2011-12-16 09:23:01','Sem1','Maria displayed excellent efforts in English Semester 1.  Her achievement in the area of reading shows her strength in comprehension of literature.  Writing is the area Maria needs to focus on to improve.â€¢    Aida\'s outstanding efforts and achievement of all standards in English this semester is commendable.  She showed tremendous growth in her writing where she incorporated rich language into her stories.     \r\n(NG = No Grade - indicates the benchmark was not assessed during this grading period.)\r\n  '),(4339,1465,NULL,2,'2011-12-16 09:23:37','2011-12-16 09:23:37','Sem1','Zack has a high level of comprehension and analysis which he best expresses through group oral discussions and multi media reading evidence. He now needs to develop his written assignments so that these reflect his high levels of comprehension and analysis.  I am confident he will increase his stamina in writing in second semester if he attends study hall once or twice per week to help him balance his attention to his written work with his other assignments.  '),(4340,223,NULL,2,'2011-12-16 09:24:00','2011-12-16 09:24:00','Sem1','Kadiya is an able and conscientious member of the group who displays a real interest in the subject and appears to enjoy all aspects of the work. She has developed a good general health knowledge and is always willing to share her ideas with the rest of the class during discussion. The general quality of her written work has been consistently very good, both in terms of content and presentation. Overall, a very good semester. Frank Bartmann'),(4341,821,NULL,4,'2011-12-16 09:24:53','2012-01-04 05:58:38','Sem1','Tomas can accurately articulate ideas about literature verbally.  Tomas needs to build organization skills to be better prepared for learning activities. \r\nNG = No Grade - indicates the benchmark was not assessed during this grading period.'),(4342,760,NULL,1,'2011-12-16 09:24:58','2011-12-16 09:24:58','Sem1','Layan shows a consistent and thorough understanding of the required knowledge and skills and the ability to apply them in many situations.  She is enthusiastic, cares about her learning and is mature, responsible and focused.\r\n\r\nHer projects in OM shows insight and creativity and her ability to think for herself.  I enjoy having Layan in class .\r\nKeep up the good work.'),(4343,3462,4,4,'2011-12-16 09:25:08','2011-12-16 09:25:08','Sem1',''),(4344,3639,5,5,'2011-12-16 09:25:24','2011-12-16 09:25:24','Sem1',''),(4345,612,NULL,4,'2011-12-16 09:25:47','2011-12-16 09:25:47','Sem1','Kalkeydan is a reserved member of the group who displays a quiet interest in the subject and participates in practical work with enthusiasm. He has developed a good general health knowledge and is always willing to share his ideas with the rest of the class during discussion.  Written work has been rather variable - often detailed and carefully presented; but sometimes only just adequate. Overall, a very good semester. Frank Bartmann'),(4346,1792,NULL,2,'2011-12-16 09:26:53','2011-12-16 09:26:53','Sem1','This semester the students have been investigating about Global Issues in Ethiopia and in one other country of their choice. This international Global Issues portrait was presented to the class at the end of the unit. Nisala\'s presentation about Sri Lanka was informative and insightful. However, Nisala could have given more detail about the interconnected nature of the issues he studied. \r\nGabriela Gade '),(4347,1155,NULL,4,'2011-12-16 09:27:26','2012-01-04 05:58:52','Sem1','Uakuu should push himself to regularly read seventh grade literature.  This will help him develop skills in both reading and writing.  Uakuu needs to build organization skills to be better prepared for learning activities. \r\nNG = No Grade - indicates the benchmark was not assessed during this grading period.'),(4348,187,NULL,2,'2011-12-16 09:27:29','2011-12-16 09:27:29','Sem1','Liyaan is a friendly student who works with enthusiasm in the classroom, and regularly contributes to class discussion. She  has developed a good general health knowledge and is always willing to share her ideas with the rest of the class during discussion. The general quality of her written work has been consistently very good, both in terms of content and presentation. Overall, a very good semester. Frank Bartmann'),(4349,1408,NULL,2,'2011-12-16 09:27:35','2011-12-16 09:45:27','Sem1','Adam is working well in World Cultures and I am confident he will continue to make good progress in second semester.\r\nNG = No Grade - indicates the benchmark was not assessed during this grading period.\r\n\r\n'),(4350,3406,3,4,'2011-12-16 09:29:34','2011-12-16 09:29:34','Sem1',''),(4351,127,NULL,2,'2011-12-16 09:29:40','2011-12-16 09:29:40','Sem1','Medin is an able and conscientious member of the 