12:32:06','2011-12-16 12:32:06','Sem1','Hanna is a very dedicated and hardworking student.  In Cul. Arts I find her enthusiastic and eager to learn all the techniques that we do when cooking.  She can follow instructions and make sure that her measurements are correct. She is a good team member, open minded and tolerant of others in her group.  Her recipe book is good and practical collection of different recipes for sweets.  Great job Hanna!\r\n(NOTE: NG = no grade. Benchmarks not assessed this semester for all students)'),(4745,1611,NULL,1,'2011-12-16 12:32:23','2011-12-16 12:32:23','Sem1','Hamza shows strong understanding and can articulate the concepts taught clearly and in detail.  He organizes information effectively to support and demonstrate ideas and concepts and is participating more fully in group discussions.'),(4746,1653,NULL,1,'2011-12-16 12:34:45','2011-12-16 12:34:45','Sem1','Heldana participates well in discussions, sharing valuable ideas and questions.  She shows understanding of many concepts and has insight into motivations of people and groups of people.  Her willingness to spend extra time and re-do assignments has been very beneficial.'),(4747,1770,NULL,1,'2011-12-16 12:36:25','2011-12-16 12:36:25','Sem1','Jan-Philipp participates very well in discussions, sharing valuable ideas and questions.  He easily retains specific information to support his ideas and to explain them clearly in writing.  He shows understanding of many concepts and has insight into motivations of people and groups of people.'),(4748,1030,NULL,4,'2011-12-16 12:37:46','2011-12-16 12:37:46','Sem1','Rama is mathematically very capable and I feel he is underachieving in Pre-Algebra. He was awarded an IB learner profile certificate for his work on magic squares.  However, in class, he tends to make careless errors, or not show his working. I would like to see him focus fully on the assigned tasks; either classwork, homework or assessments. He should aim to challenge himself with the problem solving questions to demonstrate his ability to apply his knowledge in a wider variety of situations.\r\n\r\nFiona Thangata   '),(4749,1138,NULL,5,'2011-12-16 12:37:47','2011-12-16 12:51:47','Sem1','Alex is consistently off-task during classroom activities and discussions.  Her quality of work is poor as a result.'),(4750,604,NULL,1,'2011-12-16 12:38:14','2011-12-16 12:38:14','Sem1','Kayleigh is the most enthusiastic of my 21 students in Culinary Arts. She is dedicated and hardworking , as she is always the first to hand in her work.  She worked on her recipe book, organized and finished it, ahead of the rest of the class.  She is caring and mindful of the feelings of others.  She volunteers to help clean up, and in a variety of chores in our kitchen.  I enjoyed having her in my class and hope to have her again.  Congratulations for a job well done, Kayleigh.\r\n(NOTE: NG = no grade, benchmarks not assessed this semester for all students) '),(4751,886,NULL,4,'2011-12-16 12:41:11','2011-12-16 12:41:11','Sem1','Amanda is consistently on-task during classroom activities and discussions.  Her quality of work is good.  Participation could use improvement.'),(4752,1594,NULL,2,'2011-12-16 12:42:00','2011-12-16 12:42:00','Sem1','Max participates very well in discussions, sharing valuable ideas and questions.  He struggled in quarter 1 to complete assignments on time and to the best of his ability, but has made considerable progress in the second half of the semester to successfully overcome this.   He explains both main ideas and supporting details clearly in his writing, and shows insight into motivations of people and groups of people. Keep up the good work, Max!'),(4753,999,NULL,2,'2011-12-16 12:43:14','2011-12-16 12:43:14','Sem1','Rebekah has made good progress in Pre-Algebra this semester. She sets her work out clearly and accurately, and demonstrates a good understanding of all the topics. She is motivated to succeed and she asks questions in class to check her understanding. Homework is always completed on time. \r\n\r\nFiona Thangata'),(4754,1274,NULL,1,'2011-12-16 12:44:29','2011-12-16 12:44:29','Sem1','Maimuna consistently produces outstanding work and is a committed, hardworking student who strives for excellence.  She provides a positive role model for others.'),(4755,277,NULL,1,'2011-12-16 12:45:00','2011-12-16 12:45:58','Sem1','Lara is a very dedicated and sincere student in Cul. Arts, so I am very surprised that she has not submitted her recipe book which is one of requirements for the course.\r\n\r\n(NOTE: NG = no grade- benchmarks not assessed this semester for all students)'),(4756,2673,3,2,'2011-12-16 12:46:54','2011-12-16 12:46:54','Sem1',''),(4757,1538,NULL,1,'2011-12-16 12:46:55','2011-12-16 12:46:55','Sem1','Pandeni participates well in all class activities.  In discussions, he shares valuable ideas and questions and shows understanding of many concepts.  He has insight into motivations of people and groups of people, and is developing his writing stamina very well.  Keep up the good work!'),(4758,2597,1,1,'2011-12-16 12:47:11','2011-12-16 12:47:34','Sem1',''),(4759,840,NULL,4,'2011-12-16 12:48:15','2011-12-16 12:48:15','Sem1','Sawyer has made good progress this semester in Pre-Algebra. He participates well in class and is able to give clear verbal explanations for answers. He has improved in showing his working out. I would like to see him \'have a go\' at questions he is not sure about, rather than leaving them unattempted. Homework has not always been brought to class completed on time and I would like Sawyer to address this issue next quarter. \r\n\r\nFiona Thangata '),(4760,695,NULL,4,'2011-12-16 12:48:58','2011-12-16 12:54:32','Sem1','Diego is generally on-task during classroom activities and discussions.  At times he is distracted by his laptop.  His participation and quality of work are good.'),(4761,794,NULL,2,'2011-12-16 12:49:07','2011-12-16 12:54:51','Sem1','Julia is consistently on-task during classroom activities and discussions.  Her participation and quality of work are excellent.'),(4762,783,NULL,2,'2011-12-16 12:49:14','2011-12-16 12:55:12','Sem1','Kahlil is consistently on-task during classroom activities and discussions.  His participation and quality of work are excellent.'),(4763,705,NULL,4,'2011-12-16 12:49:22','2011-12-16 12:56:41','Sem1','Kaleb is generally on-task during classroom activities and discussions.  His participation needs improvement.  His quality of work is good but could benefit from more effort.'),(4764,1145,NULL,4,'2011-12-16 12:49:30','2011-12-16 12:57:32','Sem1','Keeghan is generally on-task during classroom activities and discussions.  At times his focus needs improvement during group activities and discussions.  His participation and quality of work are good.'),(4765,1069,NULL,2,'2011-12-16 12:49:37','2011-12-16 12:58:23','Sem1','Kgatiso is generally on-task during classroom activities and discussions.  His participation and quality of work are good.'),(4766,902,NULL,4,'2011-12-16 12:49:43','2011-12-16 12:59:16','Sem1','Krubell is generally on-task during classroom activities and discussions.  His laptop is a distraction to his classwork.  His participation is excellent.'),(4767,970,NULL,2,'2011-12-16 12:49:49','2011-12-16 12:59:42','Sem1','Makda is consistently on-task during classroom activities and discussions.  Her participation and quality of work are excellent.'),(4768,730,NULL,2,'2011-12-16 12:49:56','2011-12-16 13:00:06','Sem1','Mikal is consistently on-task during classroom activities and discussions.  Her participation and quality of work are excellent.'),(4769,1045,NULL,2,'2011-12-16 12:50:03','2011-12-16 13:00:28','Sem1','Nick is consistently on-task during classroom activities and discussions.  His participation and quality of work are excellent.'),(4770,939,NULL,2,'2011-12-16 12:50:10','2011-12-16 13:00:55','Sem1','Rishabh is generally on-task during classroom activities and discussions.  His participation and quality of work are excellent.'),(4771,960,NULL,2,'2011-12-16 12:50:18','2011-12-16 13:01:54','Sem1','Sakshi is consistently on-task during classroom activities and discussions.  Her participation and quality of work are excellent.'),(4772,1356,NULL,2,'2011-12-16 12:50:32','2011-12-16 12:50:32','Sem1','Sagar is working hard in English Language Arts and making steady progress in his written work.  He has a strong command of vocabulary, and now needs to build on his writing stamina to show further evidence of this. '),(4773,831,NULL,4,'2011-12-16 12:50:38','2011-12-16 13:02:46','Sem1','Sam struggles staying on-task during classroom activities and discussions.  His participation and quality of work suffer as a result.'),(4774,2922,4,5,'2011-12-16 12:50:39','2011-12-16 12:50:39','Sem1',''),(4775,2989,2,2,'2011-12-16 12:51:08','2011-12-16 12:51:08','Sem1',''),(4776,1199,NULL,2,'2011-12-16 12:51:57','2011-12-16 13:03:13','Sem1','Sameera is consistently on-task during classroom activities and discussions.  Her participation and quality of work are excellent.'),(4777,872,NULL,2,'2011-12-16 12:52:03','2011-12-16 13:03:32','Sem1','Sarah is consistently on-task during classroom activities and discussions.  Her participation and quality of work are excellent.'),(4778,1372,NULL,2,'2011-12-16 12:52:04','2011-12-16 12:52:04','Sem1','After a rather slow beginning, I am pleased to see that Seema has recently increased her effort and participation in class. This has resulted in work of a higher standard and improved results on assessments. Seems knows I am available after school for extra help if she is finding any particular topic difficult. I would encourage her to take up that opportunity for further practice and the time to ask questions.\r\n\r\nFiona Thangata '),(4779,867,NULL,4,'2011-12-16 12:52:09','2011-12-16 13:04:10','Sem1','Thuso is consistently on-task during classroom activities and discussions.  His participation needs improvement, but his quality of work is excellent.'),(4780,1098,NULL,2,'2011-12-16 12:52:15','2011-12-16 13:04:26','Sem1','Vilde is consistently on-task during classroom activities and discussions.  Her participation and quality of work are excellent.'),(4781,855,NULL,1,'2011-12-16 12:52:16','2011-12-16 12:52:16','Sem1','Leyla is able to apply concepts, techniques and terminology we use in cooking.  She is able to follow a recipe and in addition she is creative and adds her own touch to her cooking. Her recipe book is excellent, an impressive collection of recipes that are practical and easy to follow.  A great member of class.\r\n(NOTE: NG = no grade - benchmarks not assessed this semester for all students)'),(4782,742,NULL,4,'2011-12-16 12:52:21','2011-12-16 12:53:38','Sem1','Winnie is generally on-task during classroom activities and discussions.  Her participation is excellent.  At times, she struggles to focus during group activities.'),(4783,3646,4,5,'2011-12-16 12:53:38','2011-12-16 12:58:14','Sem1',''),(4784,3351,2,2,'2011-12-16 12:53:52','2011-12-16 12:53:52','Sem1',''),(4785,1414,NULL,1,'2011-12-16 12:53:54','2011-12-16 12:53:54','Sem1','Sarah shows understanding of many concepts and clearly expresses her ideas in both written, oral and visual formats.  She consistently strives for excellence, and provides a positive role model for other students.'),(4786,3632,3,1,'2011-12-16 12:54:15','2011-12-16 12:54:15','Sem1',''),(4787,913,NULL,1,'2011-12-16 12:55:20','2012-01-03 06:40:00','Sem1','Simon has made very good progress in Pre-Algebra this semester. He is mathematically capable and he grasps concepts quickly. His work is always of a high standard. He participates well in class and is able to explain his thinking. He should push himself to reach the more challenging problem solving questions during classwork. \r\n\r\nFiona Thangata'),(4788,3715,4,4,'2011-12-16 12:55:24','2011-12-16 12:55:24','Sem1',''),(4789,1369,NULL,2,'2011-12-16 12:55:45','2011-12-16 12:55:45','Sem1','Seema participates very well in discussions, sharing valuable ideas and questions. She shows understanding of many concepts and has insight into motivations of people and groups of people.  Her ideas are expressed clearly in both her written and oral work.'),(4790,3740,4,4,'2011-12-16 12:56:02','2011-12-16 12:56:02','Sem1',''),(4791,3559,2,2,'2011-12-16 12:56:18','2011-12-16 12:56:18','Sem1',''),(4792,3621,5,6,'2011-12-16 12:56:31','2012-01-16 05:11:39','Sem1',''),(4793,1397,NULL,1,'2011-12-16 12:56:48','2011-12-16 12:56:48','Sem1','Nadia is a mature and responsible student in Cul. Arts.  She is able to follow a recipe and make food by herself.  She works well with others but she is also good when working alone.  Her recipe book is a good collection of recipes that are practical and easy to follow. Also her attitude and behavior has improved a lot and makes her a very consistent and balanced and a lovely young lady.  I admire her ability to improve and reach her potential. Congratulations on a job well done, Nadia.\r\n(NOTE: NG = no grade, benchmarks not assessed this semester for all students.)\r\n'),(4794,3492,3,2,'2011-12-16 12:56:53','2012-02-03 12:32:32','Sem1',''),(4795,3341,5,5,'2011-12-16 12:57:56','2011-12-16 12:59:54','Sem1',''),(4796,3513,4,4,'2011-12-16 12:58:43','2011-12-16 12:58:43','Sem1',''),(4797,3596,4,4,'2011-12-16 12:58:56','2011-12-16 12:58:56','Sem1',''),(4798,1186,NULL,4,'2011-12-16 12:59:21','2011-12-16 12:59:21','Sem1','Temi has made good progress this semester in Pre-Algebra. He sometimes needs some extra time, or further practice, to understand a topic. He has come in after school to ask for further explanations or get extra practice, and this has been of benefit. He should ensure he is fully focused in class and not let himself get distracted. \r\n\r\nFiona Thangata'),(4799,1797,NULL,1,'2011-12-16 12:59:34','2011-12-16 12:59:34','Sem1','Stephen understands and can articulate the concepts taught.  He organizes information effectively to support and demonstrate ideas and concepts, and expresses himself clearly in both written and oral forms.  He is steadily increasing his writing stamina, and I am confident this will continue to develop in second semester.'),(4800,1046,NULL,1,'2011-12-16 13:00:59','2011-12-16 13:00:59','Sem1','Nicholas is a motivated and enthusiastic member of class. He enjoys cooking and tries his best to do a good job.  His willingness to learn creates a good atmosphere in class and makes everyone feel good to have him around.  His recipe book is well done, contains a variety of recipes that are practical and easy to follow.  I hope he uses it at home and continues to enjoy cooking.\r\nKeep up the good work, Nick!\r\n(NOTE: NG = no grade, benchmarks not assessed this semester for all students.)'),(4801,2847,4,2,'2011-12-16 13:03:02','2011-12-16 13:03:02','Sem1',''),(4802,3277,4,4,'2011-12-16 13:04:22','2011-12-16 13:04:22','Sem1',''),(4803,196,NULL,1,'2011-12-16 13:04:52','2011-12-16 13:04:52','Sem1','Nkotseng is a great member of the Cul Arts class.  She is enthusiastic, motivated and really enjoys working in the kitchen.  She can follow a recipe and her recipe book is a great collection of good and practical ways to make food.  I hope she continues to give joy to her family by cooking for them.\r\nI enjoyed having her in my class.\r\n(NOTE: NG = no grade, benchmarks not assessed this semester for all students)'),(4804,817,NULL,4,'2011-12-16 13:04:55','2011-12-16 13:04:55','Sem1','Tomas has made satisfactory progress since joining Pre-Algebra. I would like to see Tomas aim to work a bit faster during classwork so that he can complete a greater number and variety of problems. This will give him more experience of a topic. He enjoys working on Classzone and this is a useful source of further practice, especially outside the classroom. Tomas is gradually getting better organised about remembering to bring the required materials, including homework, to class.\r\n'),(4805,3182,4,2,'2011-12-16 13:07:20','2011-12-16 13:07:20','Sem1',''),(4806,1090,NULL,1,'2011-12-16 13:08:28','2011-12-16 13:08:28','Sem1','Yohanna has made very good progress in Pre-Algebra this semester. Her work is always of a high standard. She works diligently, paying attention to detail and to ensuring she understands the topic fully. She often completes classwork quickly and then works on more challenging problem solving questions. '),(4807,1537,NULL,1,'2011-12-16 13:08:32','2011-12-16 13:08:32','Sem1','Pandeni is mature, responsible and practical.  He is a good member of class because he does not complain and can work with any group. He enjoys cooking and I hope he continues to do so.  His recipe book is a good collection of different easy, practical recipes that can be easily followed by a beginner.  Great job Pandeni.\r\n(NOTE: NG = no grade, benchmarks not assessed this semester for all students)'),(4808,356,NULL,2,'2011-12-16 13:12:46','2011-12-16 13:12:46','Sem1','I think Shakaa truly enjoys Culinary Arts but sometimes he is too playful and inattentive in class.  He likes to socialize a lot and does not pay attention to details.  However, he and his partner produced a good recipe book which showed a lot of effort and motivation and a lot of time spent in researching for different recipes.\r\nCongratulations on a job well done, Shakaa.\r\n\r\nNOTE: NG = no grade, benchmarks not assessed this semester for all students.\r\n'),(4809,1462,NULL,4,'2011-12-16 13:13:28','2012-01-03 06:40:49','Sem1','Zack has made steady progress in Pre-Algebra this semester. He has found some of the topics challenging, such as solving equations, and he needs some further practice on them. Zack should use his time wisely in class to focus on the assigned tasks, and ask questions if he needs further explanations, rather than distracting others and not completing the classwork. I am available after school for extra help.\r\n\r\nFiona Thangata'),(4810,2622,2,2,'2011-12-16 13:13:38','2011-12-16 13:13:38','Sem1',''),(4811,2125,3,4,'2011-12-16 13:14:54','2011-12-16 13:14:54','Sem1',''),(4812,2095,4,2,'2011-12-16 13:15:52','2011-12-16 13:15:52','Sem1',''),(4813,1947,3,2,'2011-12-16 13:16:04','2011-12-16 13:16:04','Sem1',''),(4814,511,NULL,1,'2011-12-16 13:16:44','2012-01-02 09:48:31','Sem1','Sofia is a very sincere and dedicated student in Cul. Arts.  She likes cooking and shows enthusiasm and interest in all the activities we do in class.  However I have not received her recipe book which is one of the requirements of the course and I am disappointed. \r\n\r\n(NOTE: NG = no grade, benchmarks not assessed this semester for all students) '),(4815,2207,2,2,'2011-12-16 13:18:33','2011-12-16 13:18:33','Sem1',''),(4816,1879,2,2,'2011-12-16 13:18:43','2011-12-16 13:18:43','Sem1',''),(4817,1989,5,5,'2011-12-16 13:19:00','2011-12-16 13:19:00','Sem1',''),(4818,1795,4,4,'2011-12-16 13:19:13','2011-12-16 13:19:13','Sem1',''),(4819,1472,NULL,4,'2011-12-16 13:20:01','2011-12-16 13:20:01','Sem1','I like Zach\'s recipe book.  It is colorful, well organized and has really good recipes that are practical and easy to do.  I hope that this book will be useful at your home, and Zach to show more interest in making good food.\r\n\r\nI enjoyed having Zach in class. Great job!\r\n(NOTE: NG = no grade, benchmarks not assessed this semester for all students)'),(4820,1737,4,4,'2011-12-16 13:20:25','2011-12-16 13:20:25','Sem1',''),(4821,1266,4,2,'2011-12-16 13:21:19','2011-12-16 13:21:19','Sem1',''),(4822,1997,5,4,'2011-12-16 13:21:40','2011-12-16 13:21:40','Sem1',''),(4823,1383,2,2,'2011-12-16 13:21:54','2011-12-16 13:21:54','Sem1',''),(4824,1892,4,2,'2011-12-16 13:22:07','2011-12-16 13:22:07','Sem1',''),(4825,1903,4,4,'2011-12-16 13:22:22','2011-12-16 13:22:22','Sem1',''),(4826,2428,4,2,'2011-12-16 13:22:39','2011-12-16 13:22:39','Sem1',''),(4827,1333,4,4,'2011-12-16 13:23:00','2011-12-16 13:23:00','Sem1',''),(4828,1936,4,2,'2011-12-16 13:23:12','2011-12-16 13:23:12','Sem1',''),(4829,1133,NULL,2,'2011-12-16 13:23:29'