 13:34:30','2011-12-16 13:34:30','Sem1','Diego has made very good progress in Pre-Algebra this semester. He works conscientiously and to a high standard at all times. He made a very good data presentation (powerpoint) based on sets of class data. He is very thoughtful and is able to explain his thinking, or reasons for an answer. \r\n\r\nFiona Thangata'),(4847,1112,NULL,4,'2011-12-16 13:38:59','2011-12-16 13:38:59','Sem1','Jarrah has made some progress in Mathematics this semester. Many of the topics have been new for Jarrah and so he is learning some basic skills and concepts. He tends to work very slowly, and can easily become distracted. However, he is eager to learn and to succeed. Jarrah participated well in a group project to make a powerpoint presentation about graphs and data analysis. \r\n\r\nFiona Thangata '),(4848,701,NULL,2,'2011-12-16 13:42:19','2011-12-16 13:42:19','Sem1','Kaleb has made good progress in Mathematics this semester. He has shown good understanding of the topics. He participates well in class and can often give explanations for his answers. Kaleb can easily get distracted and so he tends to work better on his own. \r\n\r\nFiona Thangata'),(4849,3463,3,4,'2011-12-16 13:42:20','2011-12-16 13:42:20','Sem1',''),(4850,3569,4,4,'2011-12-16 13:42:35','2011-12-16 13:42:35','Sem1',''),(4851,3009,4,2,'2011-12-16 13:42:46','2011-12-16 13:42:46','Sem1',''),(4852,3071,3,2,'2011-12-16 13:42:56','2011-12-16 13:42:56','Sem1',''),(4853,3389,3,2,'2011-12-16 13:43:13','2011-12-16 13:43:13','Sem1',''),(4854,3616,3,4,'2011-12-16 13:43:34','2011-12-16 13:43:34','Sem1',''),(4855,3498,3,2,'2011-12-16 13:43:49','2011-12-16 13:43:49','Sem1',''),(4856,3485,3,2,'2011-12-16 13:44:06','2011-12-16 13:44:06','Sem1',''),(4857,3042,2,2,'2011-12-16 13:44:24','2011-12-16 13:44:24','Sem1',''),(4858,3177,2,2,'2011-12-16 13:44:34','2011-12-16 13:44:34','Sem1',''),(4859,3605,5,5,'2011-12-16 13:44:49','2011-12-16 13:44:49','Sem1',''),(4860,3534,2,2,'2011-12-16 13:45:06','2011-12