rther with continued video editing practice.'),(5139,3615,4,2,'2012-01-09 08:38:52','2012-01-16 12:53:37','Sem1',''),(5140,3676,4,4,'2012-01-09 08:40:22','2012-01-16 12:54:21','Sem1',''),(5141,3594,4,4,'2012-01-09 08:40:33','2012-01-16 12:54:29','Sem1',''),(5142,3666,5,5,'2012-01-10 06:03:13','2012-01-16 12:54:06','Sem1',''),(5143,3765,17,1,'2012-01-17 08:32:43','2012-01-17 12:00:32','Sem1',''),(5144,2932,4,2,'2012-01-17 08:34:02','2012-01-17 08:34:02','Sem1',''),(5145,3766,17,1,'2012-01-17 08:34:32','2012-01-17 12:00:08','Sem1',''),(5146,2787,17,1,'2012-01-17 08:35:38','2012-01-17 11:59:46','Sem1',''),(5147,3767,4,2,'2012-01-17 13:20:03','2012-01-17 13:20:03','Sem1',''),(5148,3768,3,1,'2012-01-19 08:50:16','2012-01-19 08:50:16','Sem1',''),(5149,3769,2,2,'2012-02-20 07:58:06','2012-02-20 07:58:06','Q3',''),(5150,3770,5,4,'2012-02-20 08:26:02','2012-02-20 08:26:02','Q3','Ammanuel has just started getting extra support. I am confident that it can help him to catch up with the other students.\r\nIn addition, he needs to be more focused in class'),(5151,1925,5,4,'2012-02-20 08:26:25','2012-02-20 08:26:25','Q3',''),(5152,2568,5,2,'2012-02-20 08:26:42','2012-02-20 08:26:42','Q3',''),(5153,2287,5,4,'2012-02-20 08:26:57','2012-02-20 08:26:57','Q3',''),(5154,2931,4,4,'2012-02-20 08:27:29','2012-02-20 08:27:29','Q3',''),(5155,3225,5,5,'2012-02-20 08:27:53','2012-02-20 08:27:53','Q3',''),(5156,3191,5,4,'2012-02-20 08:28:17','2012-02-20 08:28:17','Q3',''),(5157,2888,6,5,'2012-02-20 08:28:36','2012-02-20 08:28:36','Q3',''),(5158,3403,5,2,'2012-02-20 08:29:12','2012-02-20 08:29:12','Q3',''),(5159,3771,2,2,'2012-02-20 08:31:40','2012-02-20 08:31:40','Q3','Emma has a strong basis for this demanding course. Both written and oral skills are good. She shows interest and her participation in class is very positive'),(5160,3663,5,4,'2012-02-20 08:33:17','2012-02-20 08:33:17','Q3','Manisha needs to participate more actively in class in order to improve her oral skills. She also should inform me when she needs clarification about a grammar point or activity'),(5161,2544,5,2,'2012-02-20 08:35:08','2012-02-20 08:35:08','Q3','She has some problems with some basic grammar points. She should come and ask for help when she needs it'),(5162,1828,4,4,'2012-02-20 08:37:42','2012-02-20 08:37:58','Q3','Jasper\'s effort has dropped drastically and as a result he is falling behind academically. He should meet the teachers for extra help'),(5163,2261,5,4,'2012-02-20 08:41:16','2012-02-20 08:41:16','Q3','Sophi has improved with her organizational skills. However, she still needs to be more focused in class.'),(5164,3704,5,5,'2012-02-20 09:03:35','2012-02-20 09:03:35','Q3','David does not realize that he still has time to improve his academic achievement level to an easy \"4\" for IB if he puts in a dedicated effort. However, he seems to have completely given up as far a Physics is concerned. I have asked him to utilize his study hall or his after school time for doing some reviews with me. However, he prefers not to take this opportunity.'),(5165,3465,4,5,'2012-02-20 09:06:44','2012-02-20 09:06:44','Q3','Abel is dong much better academically. However if he raises his effort a bit more, he can do very well in Physics. He knows that his internal assessment score for IB is not satisfactory at all. However, he has not seized any opportunity to hand in better lab reports even when such opportunities were provided throughout the year.'),(5166,3688,4,5,'2012-02-20 09:10:29','2012-02-20 09:10:29','Q3','Frequent absences and lack of handing in assignments on time has put Simon on the back foot this quarter. I am concerned about his overall performance given that his Internal Assessment scores are very low. He knows this and he was given enough opportunities to improve his scores. However, he has chosen not to take this opportunity.'),(5167,3546,5,4,'2012-02-20 09:14:52','2012-02-20 09:14:52','Q3','Nicolas is great with handing in all the assignments on time. However, the quality of these assignments are mediocre especially when it comes to the lab reports. The practical work makes up 24% of his IB grade. However, he has not been able to raise this score even after continuous feedback and opportunities were provided. '),(5168,3520,5,2,'2012-02-20 09:18:16','2012-02-20 09:34:53','Q3','Nomolelo continues to put in good effort in class. However, the recent summative assessment shows minimal retention of the concepts learned last year. Therefore, Nomolelo will need dedicated time either during study hall or after school to review the topics covered last year. She understands this and has already been in touch with me. I will start seeing her every Monday (Tuesday if needed) between 3:30 to 4:30 pm starting February 27.'),(5169,3433,6,2,'2012-02-20 09:39:02','2012-02-20 09:39:02','Q3','I could see Solomon has been putting more effort in his Spanish lately. He has been learning more vocabulary and has been submitting homework on time. However, as said previously, Solomon needs to focus his efforts on learning verbs, verb conjugations and sentence structure. This could be done through more practice, flashcards or extra homework. More study time for Spanish will be crucial for Solomon in order to be successful in the subject. '),(5170,3668,5,5,'2012-02-20 14:03:12','2012-02-20 14:03:12','Q3','Manisha needs to participate in class actively - to ask questions and to answer questions, to make observations and comments.'),(5171,1947,4,5,'2012-02-20 17:21:28','2012-02-20 17:21:28','Q3','Kareem struggles with pronunciation and listening comprehension in French. He needs to make an extra effort in fully participating in class activities that will help him in his challenges in those areas. I have been seeing a change in his attitude towards learning: I don\'t see the same enthusiasm he had at the beginning of the year.'),(5172,2095,5,5,'2012-02-20 17:25:37','2012-02-20 17:26:09','Q3','During the course of the quarter, I have been talking to Eynaas about her lack of effort in doing homework assignments and reviewing notes and spending more time in preparation for tests. I expect her to change her habits in order to boost her grade.'),(5173,1989,5,4,'2012-02-20 17:38:03','2012-02-20 17:38:03','Q3','This quarter Shane has shown more interest in learning. He takes notes and asks questions when he is in doubt. He needs to put more effort in doing homework assignments. He struggles with pronunciation and listening comprehension. The Rosetta Stone program is still available to him. That would be very helpful. I have mentioned that to him again last week. When he misses class, he needs to send me an email inquiring about what was done in class so that he can catch up before the next class.'),(5174,1997,5,5,'2012-02-20 17:54:26','2012-02-20 17:54:26','Q3','Bethel needs to buy a new text book. She has lost hers but she has not made an effort to come to me to get another one. More effort should be put into doing homework assignments. She needs to ask questions when she does not understand. She needs to spend extra time with me to review lessons.'),(5175,1737,4,4,'2012-02-20 17:56:58','2012-02-20 17:56:58','Q3','Ahadu needs to pay more attention in class. He is not fully engaged in class activities. He is often in class physically but not mentally.'),(5176,1333,4,4,'2012-02-20 17:58:42','2012-02-20 17:58:42','Q3','Glenn\'s behavior has improved a lot. He is more engaged in class. He takes notes and asks questions when he does note understand. He needs to work harder on his writing and take time to re-read his assignments. '),(5177,2336,NULL,NULL,'2012-02-21 10:16:07','2012-02-21 10:38:30','Q3','\r\n'),(5178,1960,NULL,NULL,'2012-02-21 10:18:27','2012-02-21 10:38:49','Q3',' '),(5179,2180,NULL,NULL,'2012-02-21 10:19:54','2012-02-21 10:39:06','Q3',''),(5180,2406,NULL,NULL,'2012-02-21 10:23:04','2012-02-21 10:36:43','Q3',''),(5181,2282,NULL,NULL,'2012-02-21 10:24:16','2012-02-21 10:37:24','Q3',''),(5182,2374,NULL,NULL,'2012-02-21 10:24:50','2012-02-21 10:38:16','Q3','\r\n'),(5183,2267,NULL,NULL,'2012-02-21 10:32:18','2012-02-21 10:37:45','Q3',''),(5184,3297,5,5,'2012-02-21 11:18:05','2012-02-21 11:18:05','Q3','Regularly unprepared for class.  Should take advantage of the opportunity to re-write his Things Fall Apart essay.  Should schedule an appointment to talk about it.'),(5185,2890,5,5,'2012-02-21 11:18:25','2012-02-21 11:18:25','Q3','Should take advantage of the opportunity to re-write his Things Fall Apart essay.  Should schedule an appointment to talk about it.'),(5186,2922,5,5,'2012-02-21 11:19:03','2012-02-21 11:19:03','Q3','Should take advantage of the opportunity to re-write his Things Fall Apart essay.  Should schedule an appointment to talk about it.'),(5187,3229,16,6,'2012-02-21 11:20:24','2012-02-21 11:20:24','Q3','Continues to plagiarize take-home assessments.  He cannot pass this course if this behavior persists.'),(5188,3024,5,5,'2012-02-21 12:01:43','2012-02-21 12:01:43','Q3','Should take advantage of the opportunity to re-write his Things Fall Apart essay - your first effort is too short and non-specific.  Should schedule an appointment to talk about it.');
