INSERT INTO `interim_grades` VALUES (1,1815,2,NULL,'Q2','Always','Always','Usually','Usually','Bethel is progressing along really well thus far.  I would encourage Bethel to take a risk and project more so we can hear her voice more.  ','2011-11-09 14:20:21','2011-11-18 07:05:38'),(2,1829,2,NULL,'Q2','Usually','Always','Usually','Usually','Jasper obviously enjoys singing, demonstrates a fantastic attitude consistently and is eager to do well in choir.  Keep up the great work, Jasper! ','2011-11-09 14:21:11','2011-11-09 14:21:11'),(3,1870,2,NULL,'Q2','Usually','Always','Usually','Usually','Semegne is working hard on singing with good diction and mouth shapes.  I would encourage Semegne to participate more as I know she has good musical input.  Often she is sitting and staring out the window of the classroom.  Even though she is attentive, I would like to see her voice her thoughts more in class.  ','2011-11-09 14:22:38','2011-11-09 14:22:38'),(4,1881,2,NULL,'Q2','Usually','Always','Usually','Usually','Swazi has been a pleasure to teach.  She is eager to do well in singing and contributes positively to class.  Swazi is doing a great job on not being distracted by her friends during class.  ','2011-11-09 14:48:45','2011-11-09 14:48:45'),(5,1933,2,NULL,'Q2','Usually','Usually','Usually','Usually','Bo Sung has a beautiful singing voice but when challenged or encouraged to change the way he sings, he sometimes demonstrates reluctance.  Occasionally, he is extremely tired in class.  When asked, it is due to the fact that he does not get enough sleep. I am concerned about this situation and would ask for a bit of \"sleep monitoring\" at home so that he is ready to work at school the next day. ','2011-11-09 14:51:53','2011-11-18 07:06:29'),(6,1935,2,NULL,'Q2','Usually','Usually','Usually','Usually','Tumi is demonstrating a fantastic singing voice.  She is always eager to learn and working hard to achieve the best sound possible.  Occasionally, she is tempted and concedes to talking with her friends.  ','2011-11-09 14:54:11','2011-11-09 14:54:11'),(7,2090,2,NULL,'Q2','Always','Always','Always','Usually','Eynaas has been a pleasure to teach.  She is always eager to learn more about singing, positively contributes to class and is attentive.  I would encourage her to sing with a good posture at all times and keep up the great work! ','2011-11-09 14:55:30','2011-11-09 14:55:30'),(8,2131,3,NULL,'Q2','Usually','Usually','Usually','Usually','Pride is demonstrating improvement in her singing posture, diction and attitude.  I am pleased that many of her good friends are in choir.  However, she is often easily distracted or causes distractions whilst I work with a different section.  Pride is aware of this and is working on it.  I would encourage her to be more diligent in being more attentive in class.','2011-11-10 07:05:57','2011-11-10 07:05:57'),(9,2211,2,NULL,'Q2','Usually','Always','Usually','Usually','Mwenya is a pleasure to teach in class. She has begun to participate more and voice her thoughts to the class.  Often, she has very good ideas for how to improve our music, musicianship and work.  I would, however, encourage her to be more attentive in class and not get too easily distracted by her friends (or cause that distraction).  ','2011-11-10 07:07:39','2011-11-10 07:07:39'),(10,2392,2,NULL,'Q2','Usually','Always','Usually','Usually','Alex continues to sing beautifully and implements his music knowledge from playing the trumpet to singing.  He is attentive in class and participates well.  The only area of concern is the consistent chatter and being attentive enough to hear their pitches for when we start.  ','2011-11-10 07:12:49','2011-11-10 07:12:49'),(11,2629,2,NULL,'Q2','Always','Always','Always','Always','Alexandra is doing a fantastic job in choir.  She consistently sings on pitch and is attentive.  She is helpful to those around her and fully participates to attain the best quality in her tone quality.  Keep up the great work! ','2011-11-10 07:16:18','2011-11-10 07:16:18'),(12,2710,2,NULL,'Q2','Occasionally','Usually','Usually','Usually','Nico continues to do a great job of singing in class.  Unfortunately, he is spending equal amount of time chatting when another section is singing.  I would encourage him to actively use the time when another section is singing to review his notes.  Occasional conversation is acceptable.  Currently, he exceeds occasional conversations. ','2011-11-10 14:51:50','2011-11-10 14:51:50'),(13,18,5,NULL,'Q2','Usually','Usually','Occasionally','Usually','Since the conferences, Ezana has definitely made progress. He is moving forward in the right direction.  Keep on practicing, keep remembering your instrument and music and make sure you ask questions when you don\'t understand something!  Keep it up! ','2011-11-10 15:11:27','2011-11-10 15:11:27'),(14,180,4,NULL,'Q2','Usually','Usually','Usually','Usually','Liyaan continues to pay attention in class.  However, her pitch accuracy on her flute has not improved. If she marks her music (for accidentals), please encourage her to show it to me before or after class!  ','2011-11-13 12:05:06','2011-11-13 12:05:06'),(15,222,4,NULL,'Q2','Usually','Usually','Usually','Usually','Kadiya is a natural clarinet player and has a beautiful sound on her instrument. However, she has not made much improvement since the first quarter - especially in her high register playing.  The only way she will play the high register without much difficulty is if she practices (or asks for help). ','2011-11-13 12:14:35','2011-11-13 12:14:35'),(16,384,4,NULL,'Q2','Usually','Usually','Usually','Usually','Jacob is making progress on his trombone sound!  His positions are perfect.  He now knows how much air he needs for the higher pitches. However, if he is ever uncertain, please encourage him to come in!  He\'s got a great sound on that trombone and his persistence is commendable!  ','2011-11-13 12:35:50','2011-11-13 12:35:50'),(17,3753,4,NULL,'Q2','Usually','Usually','Usually','Usually','Kurbell is steadily improving.  He is making good progress.  However, he seems to need help with reading the music and matching the correct pitches with the given positions. Please encourage Kurbell to get help whenever possible or necessary so that he can continue to progress along quickly.   ','2011-11-13 13:17:48','2011-11-13 13:17:48'),(18,1968,5,NULL,'Q2','Usually','Always','Usually','Always','Momodou continues to work well in class, and is beginning to respond to my continual reminders about giving detailed clear answers to questions. In his most recent assessment he showed good understanding of work on Proportion and Ratio, apart from \"solving similar figures\". He also struggled to apply basic percentage calculations to solving problems. I really would like him to arrange a regular day, once a week, when he can stay after school and work with me.\r\nHe scored well (64%) on a recent quiz on our current topic (Linear Graphs)and I very much hope he can achieve a 4 in the final Assessment for this unit.\r\nHe is now up-to-date on all HW tasks (although last week\'s was submitted very late).','2011-11-14 10:38:22','2011-11-14 10:38:22'),(19,3298,5,NULL,'Q2','Always','Always','Usually','Always','I feel that Ngatuuane is now beginning to make progress! \r\nAt the end of the unit on Financial Mathematics he scored 42% in the assessment, showing a good understanding of quite a few sections. He has recently made a good start to the Statistics unit we are now studying; I am sure that his new tactic of reading ahead, combined with asking for further explanations during lessons, cannot fail to have a very good effect on his understanding. \r\nHis GDC skills have improved (but still need practice) and he is making a genuine effort to understand each question that he works on.\r\n','2011-11-14 10:50:07','2011-11-14 10:50:07'),(20,2123,16,NULL,'Q2','Always','Always','Usually','Occasionally','Boitumelo made a very confident start to this second quarter, answering well in class and, initially, producing some good work. However, I have been unable to give a valid achievement grade as, through absence, she has missed the one major assessment the class did (and has not made it to either of the sessions arranged after school for her to catch up). On November 14th she attempted a mini-quiz, to test understanding of our Linear Graphs topic, but having missed two out of the last three lessons, was unable to complete this. I would urge her to arrange a regular weekly session with me, after school. I am sure she has the ability to succeed, but not without some extra help.','2011-11-14 10:56:47','2011-11-14 10:56:47'),(21,3433,5,NULL,'Q2','Occasionally','Usually','Usually','Usually','Solomon needs to work hard on his vocabulary and grammatical structures for achieving a higher grade in Spanish. Being more consistent in writing a journal and in studying for class would be very beneficial for his learning, as well as trying to be more focused in class. \r\n ','2011-11-15 06:00:41','2011-11-16 12:11:58'),(22,426,5,NULL,'Q2','Occasionally','Occasionally','Occasionally','Always','Sean has not always displayed a positive attitude in class this term. He needs to be reminded to stay in task and to focus. He needs to be more consistent about homework and to work on his vocabulary and structures  to be able to have a better understanding of the materials taught. ','2011-11-15 06:08:51','2011-11-15 06:08:51'),(23,163,5,NULL,'Q2','Occasionally','Always','Occasionally','Always','Bamlak sometimes forgets to do his homework. He has missed some French classes because he was sick. As a result, Bamlak has some difficulties copping up with the material being taught. I encourage him to come work with me after school on the parts he has missed.','2011-11-15 06:45:10','2011-11-15 06:45:10'),(24,205,5,NULL,'Q2','Occasionally','Usually','Occasionally','Always','Kai is not yet meeting standards in multiplication and division.  He is keen to do well and would benefit from work at home on memorization of basic math facts (addition, subtraction, multiplication, and division).  Flash cards can be helpful in memorization, students can make flashcards using index cards or another type of paper.\r\n','2011-11-15 12:40:40','2011-11-15 12:40:40'),(25,230,5,NULL,'Q2','Occasionally','Occasionally','Occasionally','Usually','Ahmed is not yet meeting standards and struggles with multiplication and division.  He needs to work more carefully and focus more during class.  Ahmed would benefit from more practice at home.','2011-11-15 12:42:39','2011-11-15 12:42:39'),(26,512,5,NULL,'Q2','Occasionally','Occasionally','Usually','Always','Sofia has not yet met standards in addition and subtraction of decimals.  She also struggles with division.  While Sofia is kind and respectful when speaking to the teacher, she needs to focus more during class in order to get more time to practice skills and receive support.','2011-11-15 12:44:48','2011-11-15 12:44:48'),(27,620,5,NULL,'Q2','Usually','Always','Always','Always','Clara has met standards in addition and subtraction of decimals, and is approaching standards in multiplication.  Clara has struggled with division.  She would benefit from extra division practice at home.  She is hard working during class and responds well to added instruction.  With more practice she will be able to master division.  She is invited to come after school for some extra instruction on division.','2011-11-15 12:47:24','2011-11-15 12:47:24'),(28,146,4,NULL,'Q2','Always','Always','Always','Always','Marda has met standards in most of the learning targets, but has struggled with division.  She is keen to do well and can improve her division skills with some added practice at home until she builds her confidence.','2011-11-15 12:48:52','2011-11-15 12:48:52'),(29,668,5,NULL,'Q2','Usually','Usually','Always','Always','Ann Marie has met standards in addition and subtraction of decimals. but struggles with multiplication and division.  She is keen to do well and can improve these skills with added practice at home of multiplication and division.  Ann Marie would also benefit from work at home on memorization of basic math facts (addition, subtraction, multiplication, and division).  Flash cards can be helpful in memorization, students can make flashcards using index cards or another type of paper.','2011-11-15 12:50:41','2011-11-15 12:50:41'),(30,1428,6,NULL,'Q2','Occasionally','Usually','Occasionally','Usually','Joe performs poorly on tests and quizzes.  He may benefit from added support in studying.  He is encouraged to make appointments with his teacher to study before major tests and quizzes.  Joe would also benefit from reviewing his notes more often, at least twice a week, to refresh his memory.  ','2011-11-15 12:53:31','2011-11-15 12:53:31'),(31,1463,4,NULL,'Q2','Usually','Usually','Usually','Always','Zack has improved his test scores substantially in the second quarter.  To make sure this continues, he is encouraged to review his notes or discuss the main points from class twice a week with family, friends, or teachers.','2011-11-15 12:55:03','2011-11-15 12:55:03'),(32,1298,5,NULL,'Q2','Usually','Usually','Usually','Usually','Kalkidan is not yet meeting standards in world cultures.  Her writing about social studies issues is often unclear or vague.  She would benefit from writing paragraphs about what she learned in world cultures twice a week.  She is welcome to submit these for feedback.  Kalkidan seems to understand much of the content, but struggles to share her understanding clearly and specifically.','2011-11-15 12:57:21','2011-11-15 12:57:21'),(33,226,5,NULL,'Q2','Occasionally','Usually','Usually','Usually','Ahmed has difficulty following directions and staying on task during class.  As a result, his work is often incomplete and/or not completed according to directions.  He needs to work on asking for help and clarification when needed and taking responsibility for completing his work.','2011-11-16 05:32:40','2011-11-16 05:43:38'),(34,2290,5,NULL,'Q2','Occasionally','Occasionally','Occasionally','Usually','Natty demonstrates minimal effort in classwork and low engagement with content and projects.  He needs to work on focus in class and increased effort, which will lead to better fulfillment of assignment requirements and higher achievement.','2011-11-16 05:41:33','2011-11-16 05:41:33'),(35,1704,5,NULL,'Q2','Usually','Usually','Occasionally','Always','Ammanuel is displaying a marked improvement in the effort he is putting forth in his work and assessments.  With this continued effort, Ammanuel is sure to meet standards in English by the Semester 1 grade reporting period, as he if fully capable to do so. I encourage Ammanuel to keep up this good work.  I also encourage Ammanuel to come to class prepared with necessary materials and assignments.   ','2011-11-16 07:12:31','2011-11-16 07:12:31'),(36,157,5,NULL,'Q2','Always','Always','Occasionally','Usually','Bamlak, in order to meet standards, needs to make more of an effort to complete work on time.  This will allow Bamlak to receive important feedback and instruction in order to improve in English.','2011-11-16 09:04:58','2011-11-16 09:04:58'),(37,216,5,NULL,'Q2','Usually','Always','Usually','Always','Kadiya should continue to seek assistance when necessary.  Additionally, Kadiya would benefit by being prepared for class consistently. She is currently engaged in reading independently which is wonderful.  I encourage her to see me for further book recommendations to keep her reading and improving her skills.   ','2011-11-16 09:13:48','2011-11-16 09:13:48'),(38,375,5,NULL,'Q2','Usually','Always','Usually','Always','So far, this quarter, Sidney has improved in being prepared for class with homework and materials.  At this time, Sidney would benefit by placing more thoughtful, dedicated effort into his work to show achievement of course standards and objectives.  With such effort, I know Sidney will meet standards in English.','2011-11-16 09:18:05','2011-11-16 09:18:05'),(39,498,5,NULL,'Q2','Always','Always','Occasionally','Usually','Ntsika is still having difficulty coming to class prepared with homework and materials.  Outside of that realm, Ntsika is making effort in class to achieve class objectives and standards.    ','2011-11-16 09:23:41','2011-11-16 09:23:41'),(40,431,5,NULL,'Q2','Always','Always','Occasionally','Always','Sean is showing solid progress with current course objectives and standards, however, he still needs to place more effort into being prepared for class with materials and homework assignments.','2011-11-16 09:25:54','2011-11-16 09:25:54'),(41,677,5,NULL,'Q2','Always','Always','Usually','Always','Wilson is currently making strong efforts to achieve course standards and objectives.  I encourage him to seek assistance when necessary.  ','2011-11-16 09:29:18','2011-11-16 09:29:18'),(42,3170,5,NULL,'Q2','Always','Always','Occasionally','Always','This is to inform you that I have seen real progress in Logan since our last meeting. He is participating more and more in class and taking charge of his learning. This has raised his confidence. I am confident that he will meet or exceed the standard by the end of the first semester. Please continue to monitor his work on a regular basis.','2011-11-16 12:38:57','2011-11-18 07:23:20'),(43,3115,5,NULL,'Q2','Always','Always','Usually','Usually','Khanya is having difficulty in this class. She has not come for extra help. Khanya can boost her confidence in the class by asking question outside of class time and reviewing the material with me. \r\n\r\n','2011-11-16 12:44:04','2011-11-16 12:44:04'),(44,3665,5,NULL,'Q2','Occasionally','Usually','Usually','Always','Manisha is facing real difficulties in the subject. During class, I always have to remind her that she needs to ask questions and keep up with the class. \r\nI am available for extra help. Please advise her to see 