bility to use feedback to improve in a timely manner.','2011-11-17 07:10:52','2011-11-18 06:02:56'),(60,1925,5,NULL,'Q2','Occasionally','Usually','Always','Always','Bo Sung needs to pay more attention in class and review at home the grammar and vocabulary on a daily basis. ','2011-11-17 07:14:24','2011-11-17 07:14:24'),(61,3668,5,NULL,'Q2','Occasionally','Always','Unacceptable','Always','Manisha needs to put more effort into her assignments and to come to class prepared.She seldom has all of her required materials with her.','2011-11-17 07:14:36','2011-11-17 07:14:36'),(62,2287,5,NULL,'Q2','Occasionally','Usually','Always','Always','Natty will improve quickly if he pays more attention in class and fulfills  assignments in a serious manner.','2011-11-17 07:16:56','2011-11-18 06:57:46'),(63,897,5,NULL,'Q2','Usually','Always','Usually','Usually','Kurbell is not yet meeting standards in language arts.  He is, however, improving well this year.  While he does not meet standards he is working very well in language arts.  He is usually prepared and most days works hard to get the most out of each class.  Kurbell always asks questions in order to improve.  He seems to be very invested in improving his skills.','2011-11-17 07:17:29','2011-11-17 07:17:29'),(64,2568,5,NULL,'Q2','Always','Always','Always','Always','Hanna needs to review the daily material at home, using flash cards for the vocabulary, reading aloud, and redoing the grammar exercises.','2011-11-17 07:18:18','2011-11-18 06:57:26'),(65,2888,6,NULL,'Q2','Occasionally','Usually','Occasionally','Always','Wuby has changed her attitude towards the subject and as a result she is improving little by little (the other day she received a 6 for an oral activity), She still needs to be more focused in class and review at home the daily material.','2011-11-17 07:21:11','2011-11-18 06:57:03'),(66,946,5,NULL,'Q2','Occasionally','Usually','Occasionally','Always','Theo is not yet meeting standards in language arts.  The most pressing issue is work completion on time.  Theo is often late with his work, which means he is not prepared for the learning activities in class.  This means that he does not always get the most out of instruction.  The late work also impacts his ability to use feedback to improve in a timely manner.  Theo would also would benefit from daily practice writing paragraphs and from some added practice in conventions, such as online grammar or spelling games.  ','2011-11-17 07:30:26','2011-11-18 06:03:30'),(67,961,5,NULL,'Q2','Usually','Usually','Usually','Usually','Sakshi is not yet meeting standards in language arts.  She participates well in class and seems to enjoy reading and writing.  In order to build her skills Sakshi would benefit from daily practice writing paragraphs clearly, and from some added practice in conventions, such as online grammar or spelling games.  She especially struggles with English grammar and run on sentences.','2011-11-17 07:33:50','2011-11-17 07:33:50'),(68,1072,5,NULL,'Q2','Usually','Usually','Occasionally','Always','Ben is approaching standard in language arts.  While many of his skills meet standard much of his written work does not.  Ben is often late with his work, which means he is not prepared for the learning activities in class.  This means that he does not always get the most out of instruction.  The late work also impacts his ability to use feedback to improve in a timely manner.','2011-11-17 07:35:02','2011-11-17 07:35:02'),(69,1135,5,NULL,'Q2','Usually','Usually','Unacceptable','Always','Alexandra is not yet meeting standards in language arts.  She needs to make sure that she reads every day and would benefit from daily practice writing paragraphs clearly.  The most pressing issue is work completion on time.  Alexandra is often late with assignments, which means she is not prepared for the learning activities in class.  This means that she does not always get the most out of instruction.  The late work also impacts her ability to use feedback to improve in a timely manner.','2011-11-17 07:41:05','2011-11-17 07:41:05'),(70,1108,6,NULL,'Q2','Unacceptable','Usually','Occasionally','Always','Jarrah is not yet meeting standards in language arts.  His skills in both reading and writing are below standards.  Jarrah is hesitant to get started working without assistance.  He needs to take initiative to get started on assignments right away so that he has as much time to work as possible.  Jarrah works slowly, so should be prepared to spend extra time at home or with a tutor in order to complete assignments.  In quarter 2 Jarrah has improved by asking more questions when he doesn\'t understand, I hope this continues as it helps him get started more quickly and understand assignments.  Jarrah is often late with assignments, which means he is not prepared for the learning activities in class.  This means that he does not always get the most out of instruction.  The late work also impacts his ability to use feedback to improve in a timely manner.\r\nJarrah has made improvements in participating in class activities more.','2011-11-17 07:54:06','2011-11-17 07:54:06'),(71,1155,5,NULL,'Q2','Usually','Usually','Occasionally','Always','Uakuu is not yet meeting standards in language arts.  He seems to enjoy writing and writes for his own personal growth which is a great thing.  His writing, however, is often unclear.  He would benefit from daily practice writing paragraphs clearly and from some added practice in conventions, such as online grammar or spelling games.  Uakuu is often late with assignments, which means he is not prepared for the learning activities in class.  This means that he does not always get the most out of instruction.  The late work also impacts his ability to use feedback to improve in a timely manner.','2011-11-17 07:56:26','2011-11-17 07:56:26'),(72,862,5,NULL,'Q2','Usually','Usually','Usually','Usually','Thuso is approaching standards in language arts.  Thuso is reading at grade level