,'Usually','Always','I have been expecting Ivan to come for extra help after school as per our conversation during parent-teacher conference. He struggles with his written assignments and his spoken skills are weak. ','2011-11-17 10:37:44','2011-11-17 10:37:44'),(105,156,4,NULL,'Q2','Occasionally','Always','Usually','Usually','Bamlak continues to demonstrate some difficulty in following directions and completing work as assigned.  In order to achieve the standard, Bamlak needs to seek help and clarification when needed.  He also needs to focus on completing work before socializing.','2011-11-17 10:40:19','2011-11-17 10:40:19'),(106,1997,5,NULL,'Q2','Occasionally','Usually','Occasionally','Unacceptable','Bethel often comes to class late. There is room for improvement in her engagement in class. She also needs to ask for help when she needs it. I have been expecting to see Bethel after school for extra help when her schedule permits it but have not seen her as of yet.','2011-11-17 10:42:52','2011-11-18 06:18:26'),(107,2081,4,NULL,'Q2','Occasionally','Occasionally','Occasionally','Usually','Mikael has shown some improvement in focus and completion of classwork.  He needs to continue to make choices that will allow him to be productive in class.','2011-11-17 10:43:32','2011-11-17 10:43:32'),(108,1995,4,NULL,'Q2','Occasionally','Usually','Usually','Usually','Shane has shown improvement in completing assignments.  In order to achieve the standard or above, he needs to continue to focus, ask for help as needed, and develop ideas in his work.','2011-11-17 10:47:04','2011-11-17 10:47:04'),(109,2250,13,NULL,'Q2','Usually','Always','Always','Always','Abelom has improved his work ethic since the end of the first quarter.  \r\n\r\nAlthough his grade is a 3 at this time, if he continues with the changes and sticks to the intervention we have structured, then I expect Abelom to improve to a 4 or a 5 by the end of the semester.  I am very pleased and encouraged with his effort level.','2011-11-17 11:09:34','2011-11-17 11:09:34'),(110,1887,16,NULL,'Q2','Always','Always','Usually','Always','Swazi\'s incomplete grade is due to missing work while during her prolonged absence from school.  We all wish her well and hope she is doing better.  She is carrying the same grade (3) as she had at the end of the 1st quarter.','2011-11-17 11:12:53','2011-11-17 11:12:53'),(111,1153,5,NULL,'Q2','Usually','Usually','Usually','Always','Keeghan is making some progress in Pre-Algebra. At times, he makes good contributions to discussions in class, and sometimes asks for help when he is unsure what to do. Keeghan is getting better at bringing homework completed on time. However, he needs to focus more in class and devote his effort and attention to the classwork assigned. He tends to be easily distracted from his work and then does not complete as much classwork as he is capable of doing. His assessment grades are rather low, which suggests a partial understanding of the work assessed. I encourage Keeghan to come along for extra help when he does not fully understand the work. ','2011-11-17 11:13:05','2011-11-17 11:13:05'),(112,1890,16,NULL,'Q2','Usually','Always','Usually','Usually','Unfortunately, due to absence, Swazi has missed a lot of the work this quarter. When she returns, I will ask Swazi to come for help after school to catch up the work she has missed. ','2011-11-17 11:15:54','2011-11-17 11:15:54'),(113,2258,5,NULL,'Q2','Usually','Always','Usually','Always','Similar to his Trial Law and Modern World History classes, Abelom has brought more effort to his Quarter 2 work.  \r\n\r\nThe reading for this class is a bit challenging for him but with the interventions we have put in place I expect his grade to improve to a 4 or a 5 by the end of the course.','2011-11-17 11:18:57','2011-11-18 06:11:07'),(114,2000,5,NULL,'Q2','Usually','Usually','Usually','Usually','Bethel has made a little progress in Pre-Algebra so far this year. However,there are several concepts and skills that she has found quite challenging. Consequently, her quiz and test grades are rather low. Bethel needs extra help and time to practice the necessary skills to be successful in Pre-Algebra. I hope she will continue to come for help after school. I am available on Monday, Thursday and Friday after school. ','2011-11-17 11:19:28','2011-11-17 11:19:28'),(115,295,5,NULL,'Q2','Occasionally','Occasionally','Usually','Usually','In the last couple of weeks Enrico has not been as engaged and focused in class. The students in Spanish 1A did a project which was a power point presentation about themselves, giving personal details, writing about school subjects, hobbies, etc. Enrico submitted a project with very little detail, and although I sent him my feedback and  I asked him to redo it, adding more information, and working on his weeknesses, he did not change much on his project, and presented it to the class as it was. \r\nI would like to see Enrico more focused and to show more enthusiasm about his work, trying to do his best. ','2011-11-17 11:23:25','2011-11-17 11:23:25'),(116,1186,5,NULL,'Q2','Usually','Usually','Usually','Always','Temi is trying hard, but is finding Pre-Algebra quite challenging. Temi needs to focus fully in class and aim to complete more classwork than he is currently doing. In addition, I encourage him to come for extra help on a regular basis after school. I am available on Monday, Thursday and Friday. I believe that the extra time and assistance will help Temi to gain a better understanding of the work. ','2011-11-17 11:23:57','2011-11-17 11:23:57'),(117,1312,5,NULL,'Q2','Usually','Usually','Usually','Always','Ammr is trying hard but is finding Pre-Algebra quite challenging. He tends to work quite slowly and therefore does not always complete many problems during class time. I would like to see Ammr push himself to work a bit faster in class, and to ask for help if he is unsure what to do. I would also like to encourage him to come along after school for extra help when he does not fully understand the work in class. ','2011-11-17 11:26:48','2011-11-17 11:26:48'),(118,77,5,NULL,'Q2','Usually','Usually','Usually','Always','Martin has tried to improve his writing, but he still has difficulties.\r\nHe has to work in order to developp his ideas and to work on his spelling and grammar.','2011-11-17 11:30:44','2011-11-17 11:53:56'),(119,2305,6,NULL,'Q2','Occasionally','Occasionally','Occasionally','Usually','Thabang seems to be on steady decline these last few weeks. It is important that he do well on the test and speech next week.','2011-11-17 11:37:02','2011-11-17 11:37:02'),(120,2396,4,NULL,'Q2','Occasionally','Occasionally','Occasionally','Usually','Adediji has been on a downward trend the last several weeks. Although he is passing, he has been turning work in late and is often not engaged in class discussions. I\'ve spoken with him and let him know he is capable of doing so much better. ','2011-11-17 11:40:46','2011-11-17 11:40:46'),(121,2342,5,NULL,'Q2','Usually','Usually','Occasionally','Usually','Deborah is passing. However, we have several summative assessments coming up and it is important that she stays focused on her work in class.','2011-11-17 11:45:24','2011-11-18 07:10:38'),(122,2373,4,NULL,'Q2','Occasionally','Usually','Occasionally','Usually','Yohannes is passing, but he needs to try to focus a little more. We have several summative assessment coming up, and it\'s important that he do well on those.','2011-11-17 11:52:29','2011-11-17 11:52:29'),(123,637,5,NULL,'Q2','Always','Always','Always','Always','Kip has tried to improve his writing, but he still has some difficulties with spelling and structural components.\r\nHe demonstrated good behavior in class with a lot of participation and I appreciated his effort for the extra works he did by taking his personal initiative. \r\n\r\n','2011-11-17 11:53:05','2011-11-17 11:53:05'),(124,2648,5,NULL,'Q2','Usually','Usually','Usually','Usually','Rawan is passing, but it is important that she stay focused and study well for upcoming summative assessments.','2011-11-17 11:56:20','2011-11-17 11:56:20'),(125,2547,5,NULL,'Q2','Usually','Usually','Usually','Always','Christine is passing, but she can do much better. A little more focus in class would help, as would turning work in on time. We have several summative assessments coming up. This is an opportunity to improve her grade.','2011-11-17 12:00:59','2011-11-17 12:00:59'),(126,2311,6,NULL,'Q2','Occasionally','Occasionally','Usually','Always','Thabang, you have the potential to achieve so much more in Algebra II/Trig. Unfortunately, you have achieved 2 on both your tests and many of your formative assessments are Achieving Below Standard. It is clear you have questions and I will continue to urge you to come for extra help. \r\nYou can increase both your understanding and your achievement on your summative assessments by making sure you:\r\n1. focus well in class\r\n2. ask for extra help\r\n3. review your notes everyday\r\n4. prepare well for tests.\r\nPlease see me if I can be of assistance.','2011-11-17 12:03:08','2011-11-17 13:10:52'),(127,2345,5,NULL,'Q2','Usually','Always','Usually','Always','Deborah, recently you have shown more focus on tasks in class and you have been asking questions. I do continue to urge you though to come in for extra help. Twenty minutes a week would clear up the questions I know you have. Please be sure to practice well at home.\r\nPlease let me know how I can help.','2011-11-17 12:05:08','2011-11-17 12:05:08'),(128,2401,6,NULL,'Q2','Occasionally','Occasionally','Occasionally','Usually','Adediji, you have the potential to achieve so much more in Algebra II/Trig. Unfortunately, you have achieved 2 on both your tests and many of your formative assessments are Achieving Below Standard. It is clear you have questions and I will continue to urge you to come for extra help. \r\nYou can increase both your understanding and your achie