revise the concepts learned in class. She needs to improve her verb conjugation and to increase her vocabulary. Penehafo has not submitted a brochure that was due last week. In the brochure, the students had to write information about their favorite city. ','2011-11-17 13:28:09','2011-11-17 13:28:09'),(148,1112,13,NULL,'Q2','Usually','Always','Usually','Always','Jarrah comes to class with a positive attitude, willing to learn. He tries hard in class and, with support, he is making steady progress. He is becoming more confident to speak up in class, volunteering answers and asking questions. We are now trying to build up his basic skills and vocabulary so that he can succeed in the Maths 7 course. Jarrah should continue to ask for help if he is unsure about what to do, what a maths problem means or how to solve a problem. He should ensure he always tries to do as much of the homework as he can. I am confident that the individual help from a tutor will be beneficial to Jarrah too. ','2011-11-17 13:31:38','2011-11-17 13:31:38'),(149,883,5,NULL,'Q2','Usually','Usually','Usually','Always','In order to improve her grades, Amanda should work on her sentence structure, practicing at home the concepts learned in class. Amanda needs to practice verb conjugation, which is the area that she has more problems with. Furthermore, Amanda would benefit from studying the vocabulary, as this will give her more tools when speaking or writing in Spanish. ','2011-11-17 13:35:16','2011-11-17 13:35:16'),(150,2650,5,NULL,'Q2','Usually','Usually','Usually','Usually','Rawan is following an individual program in the Mathematics Enrichment class. She is working on topics to build up her basic skills and knowledge in mathematics, and which will also prepare her for next year. So far this year she has done some work on Metric measurement and Scale drawing, Decimals, Percentages and Currency Conversion, and Data and Statistics. I would like to see Rawan put more effort into completing more work during class time and also ensuring that homework is completed regularly and on time. This will help her make better progress. ','2011-11-17 13:38:00','2011-11-17 13:38:00'),(151,1998,6,NULL,'Q2','Occasionally','Occasionally','Unacceptable','Always','Bethel negelected assignments for most of the quarter and was not able to fully catch up. She needs to work on organization and time management in order to stay current with her learning. ','2011-11-17 13:39:15','2011-11-17 13:39:15'),(152,969,5,NULL,'Q2','Usually','Always','Usually','Always','In order to improve her grades, Makda needs to work on verb conjugation, and on sentence structure. \r\nFurthermore, practicing the vocabulary learned in class would be very beneficial for Makda, as she would develop her writing and reading skills. ','2011-11-17 13:44:53','2011-11-21 07:13:46'),(153,2867,5,NULL,'Q2','Usually','Usually','Usually','Always','Robert is preparing for his assessments ineffectively. IB Biology requires daily study in current and past topics. I am available for academic coaching 3 days a week i strongly encourage Robert to come and review Biology with me.','2011-11-17 13:51:07','2011-11-17 13:51:07'),(154,1370,5,NULL,'Q2','Usually','Usually','Occasionally','Usually','In order to improve her grades, Seema should work harder on her sentence structure and vocabulary. She also needs to practice and revise the verb conjugations. Seema participates in class and shows a good attitude toward class. However, she has not submitted a brochure that the students needed to finish last week as homework. ','2011-11-17 13:53:31','2011-11-17 13:53:31'),(155,1299,5,NULL,'Q2','Usually','Usually','Usually','Always','Kalkidan earned a 3 on the Work and Heat Lab and a 3.7 on her Force, Work and Energy test.  These marks show that Kalkidan must put more effort into her assignments.  Kalkidan can improve by: seeing me after school when she is having difficulty with a concept;  bringing her lab report to me before it is due so I can