176,304,5,NULL,'Q2','Usually','Always','Usually','Always','Sina is doing well in math but there are a few things she needs to work on before the upcoming Unit 2 test.  Her basic multiplication and division facts need practice.  This is like the times tables (9 x 4 =).  If she can practice and improve her speed on these basic facts then doing her other work with decimals will be easier.  She needs to practice her division with decimals as well.  If both of these are worked on before the Unit 2 test she will be just fine.  The website www.sumdog.com is useful for practicing quick math facts for multiplication and division.  \r\n\r\nSincerely, Ms. Ashby','2011-11-17 15:59:12','2011-11-17 15:59:12'),(177,351,5,NULL,'Q2','Occasionally','Usually','Occasionally','Usually','Jared is doing well but needs to practice his addition, subtraction, multiplication and division so that he is confident for the Unit 2 test coming up.  He has many assignments on \"www.tenmarks.com\" to complete as practice for this.  He can also practice basic math facts on the \"www.sumdog.com\" website.  The tenmarks website would be the priority.  \r\n\r\nSincerely, Ms. Ashby','2011-11-17 16:03:53','2011-11-17 16:03:53'),(178,13,5,NULL,'Q2','Usually','Usually','Usually','Always','Ezana is improving on his completion of homework.  The quality of his answers still needs to be improved both in details given and relevance to the question asked.  During our regular weekly meeting we will work on these aspects of assignments. He does not have any overdue homework at this time!  Good job Ezana.  \r\n\r\nSincerely, Ms. Ashby','2011-11-17 16:09:30','2011-11-17 16:09:30'),(179,186,4,NULL,'Q2','Occasionally','Usually','Unacceptable','Usually','Liyaan is doing fine in science.  I am confident she understands the concepts thus far.  I would like to help her become more organized as homework or assignments usually come in late because she can\'t find them.  Many times she is completing assignments during class.  Liyaan still does not have a planner in which to write down her homework.  I think this would be an excellent start to helping her get organized and helping a parent at home be able to check if she is on top of assignments.  I am still struggling in finding a way to encourage Liyaan to wear her glasses in class.  Any suggestions would be welcome.  Sincerely, Ms. Ashby','2011-11-17 16:14:05','2011-11-17 16:14:05'),(180,233,5,NULL,'Q2','Occasionally','Usually','Occasionally','Usually','Ahmed is making progress towards meeting the standard so far this quarter but requires further assistance to meet the standards by the end of the quarter. Your child will need to demonstrate an improved understanding in the following areas to meet the standards by the end of the quarter:\r\n\r\nâ€¢ Identify and explain the beliefs of the ancient Egyptians and Israelites.\r\nâ€¢ Describe how the pharaohs have contributed to change in ancient Egypt.\r\nâ€¢ Identify the resources available and explain how those resources were used to gain power in ancient Egypt and Kush.\r\n\r\nI recommend that Ahmed work with an adult at least two times a week to better understand the above targets. I am available Monday and Tuesday after school to provide extra assistance and practice resources/ideas for your child. Rarely will these be one-on-one tutoring sessions since I will be working with multiple students. In addition, your child would greatly benefit from assistance from yourself or a tutor to properly prepare for upcoming assessments.\r\n','2011-11-17 16:17:07','2011-11-17 16:17:07'),(181,206,4,NULL,'Q2','Usually','Usually','Always','Always','Kai is doing a great job staying on top of his homework assignments.  He participates well in class and overall is doing a great job. \r\n\r\nSincerely, Ms. Ashby','2011-11-17 16:17:50','2011-11-17 16:17:50'),(182,429,5,NULL,'Q2','Usually','Usually','Usually','Usually','Sean is making progress towards meeting the standard so far this quarter but requires further assistance to meet the standards by the end of the quarter. Your child will need to demonstrate an improved understanding in the following areas to meet the standards by the end of the quarter:\r\n\r\nâ€¢ Identify and explain the beliefs of the ancient Egyptians and Israelites.\r\nâ€¢ Describe how the pharaohs have contributed to change in ancient Egypt.\r\nâ€¢ Identify the resources available and explain how those resources were used to gain power in ancient Egypt and Kush.\r\n\r\nI recommend that Sean work with an adult at least two times a week to better understand the above targets. I am available Monday and Tuesday after school to provide extra assistance and practice resources/ideas for your child. Rarely will these be one-on-one tutoring sessions since I will be working with multiple students. In addition, your child would greatly benefit from assistance from yourself or a tutor to properly prepare for upcoming assessments.\r\n','2011-11-17 16:19:35','2011-11-17 16:19:35'),(183,253,5,NULL,'Q2','Usually','Usually','Usually','Always','Joshua is making good progress towards meeting the academic standards so far this quarter. He works well in groups but at times struggles with focus while writing independently. I feel he would benefit greatly if I could spend more time with him when there are fewer students in the classroom. I recommend that Joshua meet with me on Monday or Tuesday weekly to focus on his writing until the winter break. ','2011-11-17 16:21:26','2011-11-17 16:21:26'),(184,428,5,NULL,'Q2','Occasionally','Usually','Occasionally','Usually','Sean enjoys science (from what I can observe) and participates nicely in group/ class discussions but needs to put more focus on completing assignments.  Time is given during some classes to at least begin assignments and sometimes enough to complete assignments.  If he could utilize that time fore wisely, less work would need to be done at home. \r\n\r\nMissing work:\r\nEco 6 Summary questions\r\nJar drawings/observation sheet\r\nPacket #2 Writing statements \r\nSoiled Again! Quiz','2011-11-17 16:23:28','2011-11-17 16:24:07'),(185,488,4,NULL,'Q2','Usually','Always','Always','Always','Samuel is continuing to do a great job staying on top of his homework and assignments.  Just today I sent back some work that he needed to improve because it was done in a rush and instructions not read completely.  Other than that I am happy with his progress so far this quarter.  Sincerely, Ms. Ashby','2011-11-17 16:28:02','2011-11-17 16:28:02'),(186,121,7,NULL,'Q2','Occasionally','Usually','Unacceptable','Always','Medin is a positive, enthusiastic and happy scientist in my class.  The only issue is that he doesn\'t get work done and he doesn\'t hand in work.  When I request that he emails you -the parents - he rarely does despite saying he has.  He has not handed in one completed assignment this quarter.  I highly recommend that Medin comes 2 days a week after school on a regular schedule to do work for science.  I am available Mondays and Fridays, Ato Zerihun is available Tuesdays and Thursdays.  Please let me know what days would work best and we can start immediately.  I really like Medin a lot and would like to help him become a successful student.  Sincerely,  Ms. Ashby','2011-11-17 16:35:33','2011-11-17 16:35:33'),(187,227,5,NULL,'Q2','Occasionally','Usually','Unacceptable','Usually','Ahmed needs to continue to work on his organization and his commitment to getting quality work handed in on time.  He is not following through with our regular meeting times.  When asked to attend after school session on Tuesday - he did not show up.  I would ask that a regular day be set up until he can prove that he can get assignments in on time.  \r\n\r\nMissing work as of now:\r\nJar drawing/observation sheet\r\nResearch paper on soil\r\nSoiled Again Quiz\r\n\r\nPlease let me know which day would work best.  Sincerely,  Ms. Ashby','2011-11-17 16:39:50','2011-11-17 16:39:50'),(188,64,5,NULL,'Q2','