cimals to be prepared for the upcoming Unit 2 test. Ms. Ashby','2011-11-17 17:18:40','2011-11-17 17:18:40'),(195,161,5,NULL,'Q2','Usually','Always','Usually','Usually','Bamlak is doing well in both math and science.  In math, he needs to practice his division of decimals, as a recent quiz showed he was having some problems.  Other than that, all seems to be going well.  \r\n\r\nMs. Ashby','2011-11-17 17:23:52','2011-11-17 17:23:52'),(196,269,5,NULL,'Q2','Always','Always','Usually','Always','Just a heads up for David to continue to practice and perfect his operations with decimals (addition, subtraction, multiplication and division) as recent quiz scores were low and the Unit 2 test is coming up.  Sincerely, Ms. Ashby','2011-11-17 17:26:07','2011-11-17 17:26:07'),(197,308,5,NULL,'Q2','Always','Always','Always','Always','Comfort is doing a great job in math.  However, recent quiz score indicates she needs help in division with decimals.  She is always welcome to come in after school and get extra help if needed.  The Unit 2 test is coming up soon. \r\n\r\nSincerely, Ms. Ashby','2011-11-17 17:28:18','2011-11-17 17:28:18'),(198,417,5,NULL,'Q2','Usually','Usually','Occasionally','Usually','Michael needs to practice his addition, subtraction, multiplication and division of decimals to be ready for the up coming Unit 2 test.  His two quiz scores so far were low.  Sincerely,  Ms. Ashby','2011-11-17 17:29:55','2011-11-17 17:29:55'),(199,504,6,NULL,'Q2','Occasionally','Usually','Unacceptable','Usually','Ntsika has not been keeping up with his journal page assignments in math.  This is due to several factors, one being that he misplaced his math journal for several days and could not work in class or at home with it. He has a huge amount of work to catch up on.  His quiz scores indicate that he has not practiced addition, subtraction, multiplication or division and needs to do so before the Unit 2 test which is coming up in the next week and a half (Nov. 28).  As always, he is