t grade. In the next three weeks, he will have done two more experiments. These experiments though will need to be done after school. In doing this, he needs to follow my comments given in the past lab reports very carefully and make sure that he does not repeat the same errors again. By doing this, his IA scores should definitely go up. ','2011-11-18 05:50:51','2011-11-18 07:43:15'),(211,3704,5,NULL,'Q2','Usually','Usually','Usually','Always','David realizes the importance of this course for IB diploma. However, he doesn\'t pay much attention to the details when it comes to improving his lab reports. These Internal Assessments make up 24 % of his grade and if he can improve these lab reports, he can achieve a 4. \r\n\r\nDavid knows that he needs to complete one very important lab. However, he has not taken any initiative to complete it during his study hall. \r\n\r\nDavid\'s focus in class needs to improve a lot. Last week, while we were working on Nuclear physics, he was engaged in doing some other assignment. This obviously is going to affect his performance in the assessment because he was not paying attention to the complex concepts being discussed in class.\r\n\r\nStarting next week, I will send one practice worksheet every alternate days for him to complete. He can come and discuss or ask for help as needed from either Ato. Tilahun or I on the daily basis if he wants. \r\n\r\n','2011-11-18 06:03:32','2011-11-18 07:41:32'),(212,1123,5,NULL,'Q2','Occasionally','Usually','Usually','Always','Malik struggles with focus in class.  This lack of focus means he is not engaged and is not always aware of the meaning of the activities performed.  This leads to misunderstanding of some concepts.  \r\n\r\nI recommend that Malik takes more care to adjust his summary questions during discussions and to see me if he is ever unsure of an answer.  Also, focusing on the purpose of lab activities and taking labs seriously will increase his understanding.','2011-11-18 06:08:40','2011-11-18 06:08:40'),(213,740,5,NULL,'Q2','Occasionally','Usually','Usually','Always','Winnie struggles with focus when working in groups during lab activities.  She has shown improvements in this area but at times I think it keeps her from fully understanding the purpose for activities.  \r\n\r\nI will start e-mailing Winnie\'s tutor with more specific answers to lab summary questions so that he can check her work and assist Winnie with the more difficult concepts.  Winnie also has the opportunity to retake assessments and should take advantage of this - she can stay after with me Tues. and Thurs. to get additional help.','2011-11-18 06:22:13','2011-11-18 06:22:13'),(214,2511,5,NULL,'Q2','Usually','Always','Always','Always','Almudena has not performed well on her the assessment about Forces and Dynamics. She needs to come for extra help after school if she hasn\'t understood the concepts explained in class. ','2011-11-18 06:28:22','2011-11-18 06:28:22'),(215,2283,5,NULL,'Q2','Usually','Usually','Usually','Always','Natty gets easily distracted in class. I have moved him to the front and it has helped him a bit. However, he does not ask for help when needed. He needs to come as often as he can for after-school help.\r\n\r\n','2011-11-18 06:30:48','2011-11-18 07:40:35'),(216,830,5,NULL,'Q2','Occasionally','Usually','Usually','Always','Sam struggles with focus during lab activities and discussions, which makes understanding abstract concepts more difficult.  He is sometimes off-task when using his laptop - playing games or other non-class related activities.  \r\n\r\nSam also struggles with organization and turning work in.  My recommendation is for him to improve attention and seriousness during class.  He should also see me when he doesn\'t completely understand the purpose or outcome of a lab activity.  I am available Tues. and Thurs. after school in this quarter and next.  ','2011-11-18 06:34:02','2011-11-18 06:34:02'),(217,1110,5,NULL,'Q2','Occasionally','Usually','Occasionally','Always','Jarrah is often off-task during lab activities and discussions.  This lack of focus may be due to his struggle with language and reading comprehension - but his lack of attention and effort only creates a more difficult learning situation for him.  \r\n\r\nHe has shown improvement in coming to me for clarification, but increasing this will only help him further.  Jarrah also should focus on completing lab summary questions (homework) so that he has questions ready to ask for clarification in class.  ','2011-11-18 06:45:34','2011-11-18 06:45:34'),(218,1927,5,NULL,'Q2','Occasionally','Always','Unacceptable','Always','Bo Sung is polite in class and when he completes his work it is clear he has put time and effort into the final product. Unfortunately, Bo Sung often does not complete his work. Of the last three short writing assignments we have done, Bo Sung is missing one, earned a â€œDoes Not Meet Standardâ€ on one and earned a â€œMeets Standardâ€ on the final. It is hard to give Bo Sung a grade right now because he is missing the last two reading/note taking homework assignments, which were on Chapter 6 Section 4 and 5 of the textbook and also, four pages from a book titled France in Revolution. These assignments formed the basis for the two writings that he has not completed or done well on. When asked, Bo Sung says that he does not know why he does not complete his work at home, or why he does not sleep very much. My recommendation for Bo Sung is that he should stay after school for 90 minutes each day to complete his work, either in a designated classroom (my room is a possibility) or in the library. If he gets his work done at school, then he does not need to worry about it at home. However, I cannot force him to adopt this system and would like parental input in order to make sure he can be successful. \r\n\r\nIf you have any questions please contact me,\r\n\r\nBrian Greenough\r\nBrian.Greenough@icsaddis.edu.et \r\n0913-026-646\r\n','2011-11-18 06:49:16','2011-11-18 12:27:10'),(219,963,5,NULL,'Q2','Occasionally','Usually','Usually','Always','Sakshi is off-task often during lab activities and occasionally during discussion.  This results in misunderstandings and failure to correct them during discussions.  \r\n\r\nI recommend that Sakshi focuses more in class and blocks out the many distractions that seem to keep her from being on-task.  When reviewing lab summary questions she should be making adjustments to her answers in her document.  She should also see me if she has additional questions and for clarification.  I am available Tues. and Thurs. after school. ','2011-11-18 06:49:17','2011-11-18 06:49:17'),(220,2001,5,NULL,'Q2','Usually','Usually','Occasionally','Always','In the weeks since parent-teacher conferences, Bethel has made improvements in both her effort and her academic performance. Her most recent writing on Napoleon was completed at standard and turned in on time. This is significant progress. However, Bethel continues to be disorganized at times and does not complete all assignments on time. My suggestions for Bethel are:\r\n1. Use only one computer all the time. If she does any work on another computer, it is likely to be lost or not properly transferred over, which ends up being a waste of time. \r\n2. Pack her bag before going to bed to make sure she has the correct binders, notebooks and laptop ready to go when she wakes up in the morning. \r\n3. Continue to work on her writing. She needs to pay special attention to making her sentences short to avoid writing run ons. Also, she should continue to use the transition words that we discussed in class in order to help organize her writing.\r\n\r\nIf you have any questions please contact me,\r\n\r\nBrian Greenough\r\nBrian.Greenough@icsaddis.edu.et \r\n0913-026-646','2011-11-18 06:50:15','2011-11-18 12:23:41'),(221,2274,5,NULL,'Q2','Usually','Always','Occasionally','Always','Shili has made improvements in my class and I sending this progress report as encouragement that he continue to put in his best effort. His recent writing has shown improvements and if he continues, he will be writing on standard for his next assignment. The thing he can improve upon most is to make sure he completes his homework well and on time. Since the parent-teacher conferences, he has missed, or turned in poorly done homework assignments on two occasions. By not doing his homework well, Shili makes it harder on himself to do well on the assessments, which are based on the homework. If you could check to make sure Shili is completing his homework for all of his classes and have him explain what he has done, this will help him perform better in class. \r\n\r\nIf you have any questions please contact me,\r\n\r\nBrian Greenough\r\nBrian.Greenough@icsaddis.edu.et \r\n0913-026-646\r\n','2011-11-18 06:51:27','2011-11-18 06:51:27'),(222,2079,4,NULL,'Q2','Usually','Usually','Occasionally','Always','Since parent teacher conferences Mikael has improved both his effort and academic performance in class. He was able to travel to ISSEA and come back to school without any major changes in performance and he should be congratulated for this. However, he continues to occasionally come to class unpreparedâ€”last class he did not have his computer and could not turn in his homework or be fully productive during the time we did an online assignment. Unfortunately, this is not a one-time occurrence. If Mikael could explain the homework he has done to you and then pack his bag before going to bed each night, I think it would improve his organization.\r\n\r\nIf you have any questions please contact me,\r\n\r\nBrian Greenough\r\nBrian.Greenough@icsaddis.edu.et \r\n0913-026-646','2011-11-18 06:52:39','2011-11-18 12:29:52'),(223,2266,4,NULL,'Q2','Usually','Always','Unacceptable','Always','Sophi is a pleasure to teach because she asks questions and is on task in class. This quarter we have been focusing on writing short persuasive essays and Sophi has been performing at a 4 level on all of her assignments. Unfortunately, Sophi is also very disorganized and however well meaning, her ability to show her knowledge suffers as a consequence. For example, more than once she has insisted that she has done the homework, but is unable to find the file on her laptop. This means that both she and I have to spend time and energy getting the work in late. My suggestions to her are as follows:\r\n1. For her computer: Sophi should create more specific file names for each fileâ€”History, History 1 and History 2â€”give no indication of what is in the files. One easy thing to do for in-class work is add the date to the file name. This way she can see when the file was first created, not when it was last saved.\r\n2. For her work: Sophi should pack her school bag before going to sleep each night and make time to explain what she has completed for homework for the next day.\r\n\r\nIf you have any questions please contact me,\r\n\r\nBrian Greenough\r\nBrian.Greenough@icsaddis.edu.et \r\n0913-026-646\r\n','2011-11-18 06:53:32','2011-11-18 12:31:17'),(224,1134,5,NULL,'Q2','Unacceptable','Occasionally','Unacceptable','Always','Alex continues to be off-task most of the time in class.  This is very clear when reading her answers to summative assessment questions - she is usually completely off target.  She has shown no effort in improving this despite many conversations and warnings.  \r\n\r\nThere is no way that Alex can be successful in class with her current attitude and lack of focus.  She seems to struggle with reading comprehension and her lack of effort only increases her difficulties.  \r\n\r\nI have talked with Alex many times but with no noticeable improvement in her behavior.    ','2011-11-18 06:54:03','2011-11-18 06:54:03'),(225,2032,16,NULL,'Q2','Usually','Usually','Unacceptable','Always','It is hard for me to give Zoe a grade in History because she has turned in very little work. Multiple times since October she has not brought her laptop to class and thus cannot turn in the work in that is claims on the laptop. When she does bring the laptop to class, Zoe has a hard time finding the work that she has done. If she does not want to use the laptop or bring it to school, then she needs to start doing her work by hand so that she has a chance of demonstrating her knowledge. Her missing assignments are as follows: Timeline of the French Revolution, Notes from Chapter 6 Section 4 and 5, a short essay on the impacts of the French Revolution on different social groups, Two Column Notes on Napoleon\'s reforms in France and a short essay on Napoleon\'s reforms in France. From this, it is not clear if she has done any work outside of class for the past two weeks.  \r\n\r\nIt would be a good thing for Zoe that she leave ICS at the semester with marks that reflect her best effort. Can you please ask her to finish these assignments and to turn them in? I will follow up as well and start to schedule time with her at lunch and after school for her to work on these assignments. \r\n\r\nIf you have any questions please contact me,\r\n\r\nBrian Greenough\r\nBrian.Greenough@icsaddis.edu.et \r\n0913-026-646','2011-11-18 06:57:55','2011-11-18 12:33:36'),(226,102,5,NULL,'Q2','Occasionally','Usually','Occasionally','Usually','Abdurrahim is making progress towards meeting the academic standards so far this quarter. However, he struggles with focus while writing independently. I feel he would benefit greatly if I could spend more time with him when there are fewer students in the classroom. I recommend that Abdurrahim meet with me on Monday or Tuesday weekly to focus on his writing until the winter break.','2011-11-18 07:04:28','2011-11-18 07:05:29'),(227,73,5,NULL,'Q2','Occasionally','Usually','Usually','Always','Martin is making progress towards meeting the standard so far this quarter but requires further assistance to meet the standards by the end of the quarter. Your child will need to demonstrate an improved understanding in the following areas to meet the standards by the end of the quarter:\r\n\r\n* Cite textual evidence to support analysis of what a text says explicitly as well as inferences drawn from the text.\r\n\r\n* Provide a summary of a text distinct from personal opinions or judgments.\r\n\r\n* Effectively discuss a text (one-on-one, in groups, and teacher- led) building on othersâ€™ ideas and expressing their own clearly.\r\n\r\n* Use narrative techniques, such as dialogue, pacing, and description, to develop experiences, events, and/or characters in his/her writing.\r\n\r\n*Use precise words and phrases, relevant descriptive details, and sensory language to convey experiences and events in his/her writing.\r\n\r\nI recommend that Martin work with an adult at least two times a week to better understand the above targets. I am available Monday and Tuesday after school to provide extra assistance and practice resources/ideas for your child. Rarely will these be one-on-one tutoring sessions since I will be working with multiple students. In addition, your child would greatly benefit from assistance from yourself or a tutor to properly prepare for upcoming assessments.','2011-11-18 07:09:31','2011-11-18 07:09:31'),(228,2889,4,NULL,'Q2','Occasionally','Always','Occasionally','Always','Since the meeting that Wubedel had with Ms. Halsey after the parent-teacher conferences, Wubedel has improved her participation and effort in class. She is more willing to talk about what she has learned and has tried to show her work. However, Wubedel still does not complete all of her homework, even when it is a modified or shortened reading. Also, when Wubedel is instructed to be working independently in class on modified assignments she will stop working and sit quietly until I notice her not working. She must stop giving up and not asking for help because this wastes a huge amount of her time. Wubedel will not improve her ability to read or write if she does not put consistent and sustained effort into the process. She also needs to show some attempt to complete the assignments that I give her, even if she is not able to finish. I cannot help her if I have no work of hers to base my feedback on.\r\n\r\nIf you have any questions please contact me,\r\n\r\nBrian Greenough\r\nBrian.Greenough@icsaddis.edu.et \r\n0913-026-646','2011-11-18 07:27:36','2011-11-18 12:30:30'),(229,3117,5,NULL,'Q2','Occasionally','Always','Occasionally','Always','Khanya continues to work at the 3 to 4 range in IB History. She completes most of her assignments on on time, but does not ask questions when she does not understand. Her note taking can be incomplete and she does not always take notes during class. Khanya\'s essay writing will benefit from this quarter\'s focus on analysis. Unfortunately, Khanya was absent when we wrote our most recent essay on November 10th. She still needs to make this essay up in order to receive credit. \r\n\r\n\r\nIf you have any questions please contact me,\r\n\r\nBrian Greenough\r\nBrian.Greenough@icsaddis.edu.et \r\n0913-026-646','2011-11-18 07:37:14','2011-11-18 07:37:14'),(230,3299,5,NULL,'Q2','Usually','Always','Usually','Always','After a rough start Ngatuuane had improved both in his effort and academics in my class. He now comes to class on time and makes a point to greet me. He has also been doing most of his homework on time and mostly complete. His writing will hopefully improve this quarter as we talk about how to create arguments that support thesis statements. His current work is very close to a 4 and if he keeps up the good effort, he should have a 4 by the semester. \r\n\r\nIf you have any questions please contact me,\r\n\r\nBrian Greenough\r\nBrian.Greenough@icsaddis.edu.et \r\n0913-026-646 ','2011-11-18 07:43:55','2011-11-18 12:41:39'),(231,3664,4,NULL,'Q2','Always','Always','Always','Always','Manisha continues to be a model student as she is always attentive and appears to be working hard. Unfortunately, this does not always translate into good performance on her assessments. It is possible that her grade can slip to a 3 by the end of the semester, especially if she has a bad essay or two. Manisha\'s essays suffer because she frequently confuses facts when doing the timed writings in class and will come to conclusions that do not make sense. I suggest that Manisha make flash cards of the essential vocabulary for each unit and spend 15 minutes a day going through the flash cards. This might help her to better remember her facts. The flash cards can be simple--term on the front and a quick definition on the back. \r\n\r\nIf you have any questions please contact me,\r\n\r\nBrian Greenough\r\nBrian.Greenough@icsaddis.edu.et \r\n0913-026-646','2011-11-18 08:01:51','2011-11-18 12:29:00'),(232,1138,5,NULL,'Q2','Unacceptable','Occasionally','Occasionally','Always','Alex shows the same lack of focus and effort in health as in science.  \r\n\r\n','2011-11-18 09:58:36','2011-11-18 09:58:36'),(233,1229,5,NULL,'Q2','Usually','Always','Usually','Always','Jessica is reading at 8th grade level and clearly understanding a variety of texts both in class and for her independent reading standard.  She is also developing her participation in group discussions and gave a very confident, short oral book presentation in front of the whole group last week.  Her writing skills are approaching 8th grade level, and she needs to work on the following areas to develop this standard:  (1) structure and organization e.g. a clear introduction, body and conclusion to each piece of work (2) use of specific examples / evidence e.g. in response to literature and specific details / description e.g. in memoir narrative.  We also need to build Jessica\'s stamina in writing so she is able to write more in the time given.  I strongly recommend Study Hall (available Monday, Thursdays and Fridays from 3.30-4.30 in room 70 and Wednesdays 2.30-3.30 in the Library) once or twice per week to help with these skills.     ','2011-11-21 06:05:36','2011-11-21 06:05:36'),(234,1227,5,NULL,'Q2','Usually','Always','Usually','Always','Jessica is very close to a 4 / meets standard in World Cultures at this point in the quarter, and I am confident she will meet standard in the near future.  She participates well in class activities, and easily answers questions which are teacher directed.  She needs to work on the following to help her reach the process standard of gathering and organizing information:  (1) Taking clear notes which include both main ideas and supporting details. (2) Making sure she brings all her notes and materials to each class so she has them readily available to prepare for tests / quizzes and so she can add to them during class discussions and presentations of new information.   I strongly recommend Study hall once or twice per week to review what we are doing in class (study hall in room 70 is available Mondays, Thursdays and Fridays from 3.30-4.30). ','2011-11-21 06:30:40','2011-11-21 06:30:40'),(235,1206,4,NULL,'Q2','Usually','Usually','Occasionally','Always','Although Calvin is meeting standard in World Cultures this quarter,I am issuing an interim report as I am concerned about some of his study habits - particularly his note taking skills in class and completing homework to the best of his abilities (including test preparation).\r\n\r\nThe process standard of gathering and organizing information is not always being met on formative assessments, as evidenced by weak note taking skills in class during reading, discussion and viewing activities.  In order to develop this standard, Calvin needs to (1) focus fully on the reading / discussion / viewing activity so he is able to record key points of information and supporting details (2) complete homework using full effort so that he has both test preparation notes and notes on short reading assignments ready for class discussions and quizzes.     \r\n\r\nCalvin may also benefit from attending Study hall once or twice per week to review work and complete short homeworks which are given occasionally in World Cultures.  Study hall in room 70 is available Mondays, Thursdays and Fridays from 3.30-4.30pm.              ','2011-11-21 06:46:24','2011-11-21 06:46:24'),(236,1726,4,NULL,'Q2','Usually','Always','Occasionally','Always','Although DJ is meeting standard in World Cultures this quarter I am issuing an interim report as I am concerned about a number of his study habits - specifically effective note-taking in class and completing homework to the best of his abilities.\r\n\r\nHe participates well in class discussion activities but needs to focus more on the process standard of gathering and organizing information effectively.  If he does the following, I am confident he will continue to meet standard:  (1) focus fully on class reading, viewing and discussion activities so can record key ideas and supporting details in his notes and graphic organizers (2)complete homework such as short reading assignments and test review notes so he is able to fully participate in class and succeed on tests.  I strongly recommend Study Hall once or twice per week to develop these important study skills.  In Room 70, Study hall is available Mondays, Thursdays and Fridays from 3.30-4.30pm and Wednesdays from 2.30-3.30 in the Library.       ','2011-11-21 06:53:40','2011-11-21 06:53:40'),(237,1634,5,NULL,'Q2','Occasionally','Usually','Occasionally','Always','Jon participates well in full group discussions in World Cultures but is not yet meeting standard on this quarter\'s process skills of gathering, organizing and expressing information in multiple formats.  He needs to do the following to achieve standard in these areas:  (1) Focus fully on class reading, viewing and small group discussion activities so that he is able to record key ideas and supporting details effectively  (2)  Complete homework to the best of his abilities (including test preparation and short reading assignments).  He may benefit from Study hall to help develop these study habits.  In room 70, study hall is available Mondays, Thursdays and Fridays from 3.30-4.30pm and on Wednesdays from 2.30-3.30pm in the Library. ','2011-11-21 07:00:29','2011-11-21 07:00:29'),(238,284,10,NULL,'Q2','Usually','Always','Occasionally','Always','\r\n Lara should put some more effort on her homework','2011-11-21 07:06:50','2011-11-21 07:06:50'),(239,1015,1,NULL,'Q2','Always','Always','Always','Always','','2011-11-21 07:07:33','2011-11-21 07:07:33'),(240,1043,1,NULL,'Q2','Always','Always','Always','Always','','2011-11-21 07:08:03','2011-11-21 07:08:03'),(241,1797,4,NULL,'Q2','Always','Always','Usually','Always','Stephen is doing very well in English Language Arts this quarter and participates well in all class activities.  He reads at 8th grade level and has a strong command of vocabulary.  \r\n\r\nI am issuing an interim report as his writing is not yet meeting standard.  I am confident if he does the following he will meet standard in the near future:  (1) develop his stamina in writing by writing every single day - e.g. in his reading notebook and in his writing notebook.  (2) develop his use of specific supporting details and examples e.g. in his response to literature and memoir narrative.\r\n\r\nStephen may also benefit from attending Study hall once or twice per week to have extra time to write.  Study hall is available in Room 70 Mondays, Thursdays and Fridays from 3.30-4.30pm and Wednesdays 2.30-3.30pm in the Library.   ','2011-11-21 07:09:21','2011-11-21 07:09:21'),(242,1049,10,NULL,'Q2','Always','Usually','Occasionally','Always','\r\nElliott should put more effort on his homework','2011-11-21 07:09:39','2011-11-21 07:09:39'),(243,1071,3,NULL,'Q2','Occasionally','Occasionally','Occasionally','Always','\r\n Benjamin has a good command of Spanish, but he should focus more on the activities of the class and on his homework','2011-11-21 07:12:09','2011-11-21 07:12:09'),(244,1202,10,NULL,'Q2','Usually','Usually','Occasionally','Always','\r\nCalvin has a good command of Spanish, but he should focus more on the activities of the class and on his homework','2011-11-21 07:13:28','2011-11-21 07:13:28'),(245,1724,11,NULL,'Q2','Occasionally','Usually','Occasionally','Always','\r\nDavid should put more effort on his work in class and on his homework','2011-11-21 07:14:44','2011-11-21 07:14:44'),(246,1758,1,NULL,'Q2','Always','Always','Always','Always','','2011-11-21 07:15:09','2011-11-21 07:15:09'),(247,2890,5,NULL,'Q2','Occasionally','Usually','Occasionally','Usually','Wubedel needs to push herself to participate in class daily.  This can help her develop her critical understanding and help her to practice  fully explaining her ideas.  This is especially important because at the moment she has shown low levels of understanding of what is required in her writing assignments.  ','2011-11-21 17:18:46','2011-11-22 06:44:16'),(248,3297,6,NULL,'Q2','Usually','Usually','Unacceptable','Usually','Nick has participated very well in class verbally.  However, he rarely does his homework, and he did not take his major written assessment seriously.  He has shown promise in the spoken areas of the course; he must now also deliver in the written portion.  ','2011-11-21 17:21:13','2011-11-21 17:21:13'),(249,3229,6,NULL,'Q2','Occasionally','Occasionally','Occasionally','Always','Mikeal needs to show renewed focus on deadlines and completion of homework.  It is only through doing assignments in the required way that he can develop the critical thinking skills necessary for success in this course.  He should additionally try to participate in whole class discussions at least once per meeting.\r\n\r\nHe has three weeks to pull his grade up to a passing grade of \'3\' for the semester, so immediate improvement is essential. ','2011-11-21 17:26:52','2011-11-22 06:42:41'),(250,3024,5,NULL,'Q2','Usually','Usually','Usually','Always','Mikko has recently shown better effort on his homework in terms of depth and length.  However, he must further develop his understanding of what is required of analytical assignments -- he has correctly identified and used key terms in texts, but has not discussed them depth, nor completely applied them in the proper context.  He should make an appointment to meet with me if he feels that any of the requirements of an assignment are unclear.','2011-11-21 17:30:50','2011-11-22 06:43:25'),(251,2816,5,NULL,'Q2','Always','Always','Occasionally','Usually','Niamh has shown an excellent attitude and enthusiastic participation in class since the parent-teacher conference.  Unfortunately, she did fall short of expectations on her major written assignment - while she did hand in a draft ahead of our revised schedule and met with me to go over it, she did not make a single revision that we discussed before handing it in as a \'final\' piece via email, 3 days past the day we agreed upon -- which was before she fell ill.  We need consistency and commitment to the parts of the course that Niamh is finding difficult as well as to the ones that come more naturally to her, in order to help her advance academically.','2011-11-21 17:40:27','2011-11-22 06:44:59'),(252,2284,3,NULL,'Q2','Usually','Usually','Occasionally','Usually','Natty fulfilled the formal requirements for his persuasive writing piece that resulted in his INC grade, and hopefully now has a better idea how to approach future pieces.  He picked a topic he had a lot of interest in and did well with it, but can still push himself further in specific exemplification and analysis.  He also needs to be more consistent in effort on homework and proper usage of his laptop.  ','2011-11-22 09:03:12','2011-11-22 09:03:12'),(253,2343,4,NULL,'Q2','Usually','Always','Usually','Usually','Deborah has shown good effort in both group and class discussion.  She still needs to work on her organization and attention to detail in assignments, which was a big reason she ended quarter 1 with an INC grade.  However, she remedied the issues she had with her persuasive piece, which turned out to be the best example of writing that I\'ve seen from her to date. ','2011-11-22 09:07:20','2011-11-22 12:10:51'),(254,2394,4,NULL,'Q2','Usually','Always','Occasionally','Usually','Diji has done a great job in class discussion so far this year.  He needs to find how to harness the focus and analysis he shows daily in this regard and translate it into his writing, which is often too short, or without necessary exemplification or analysis.  Also basic attention to detail such a spell check / grammar check / format check is a must for graded assignments.','2011-11-22 09:11:42','2011-11-22 09:11:42'),(255,2475,4,NULL,'Q2','Occasionally','Usually','Unacceptable','Usually','Christian still has not been prepared for class the way he needs to be, particularly with written assignments, which are generally far too brief or nonexistent.  He finally sorted out the formatting issues with his persuasive piece which led to his INC grade for quarter 1, but he did not give it the necessary attention in regards to research, exemplification, and analysis, and thus to date has achieved a grade far below his capabilities.','2011-11-22 09:14:46','2011-11-22 09:14:46'),(256,2312,4,NULL,'Q2','Usually','Always','Occasionally','Always','Thabang has shown better engagement in class activities this year and lately has made more attempts at participation in whole-class discussion; I would like to see these trends continue to develop positively.  However, he is still having problems with completing assignments on time and having all materials he needs for every class.  ','2011-11-22 09:33:54','2011-11-22 09:33:54'),(257,2365,4,NULL,'Q2','Always','Always','Always','Always','We have not completed a major written assessment since Kholiswa completed her formatting requirements on her persuasive piece; this is why her mark is still a 4.  She did do an excellent job presenting this piece as a speech, and has shown renewed commitment to her homework and class participation.  If these trends continue, we should expect a grade commensurate with her recent efforts.','2011-11-22 09:44:16','2011-11-22 12:09:32'),(258,2502,4,NULL,'Q2','Always','Always','Usually','Always','Zebib is starting to settle into her roles and responsibilities as an English student at ICS.  She was able to resolve the formatting issues that resulted in an INC grade during the first quarter, and has recently shown good effort on her homework assignments and has also begun to speak up in class.  I would like to see these trends continue as we move forward...If she has any questions or difficulties with any part of the course, she should be sure to speak with me.','2011-11-22 09:50:59','2011-11-22 09:50:59'),(259,2806,3,NULL,'Q2','Usually','Always','Occasionally','Usually','Cade needs more consistency in homework effort and class participation in order to achieve his academic potential, which he displayed at the end of last year.  He\'s done fine on major assessments, but needs to push himself further in terms of attention to detail and depth of analysis.  ','2011-11-22 09:58:25','2011-11-22 12:12:22'),(260,3753,7,NULL,'Q3','Usually','Usually','Occasionally','Usually','Kurbell is making improvements towards playing his trombone with accuracy.  He has a fantastic sound but did not apply himself completely (with reading pitches on his music and using the correct positions) until now.  If he continues this course of action, he will easily attain a 5 or 6. Keep up the good work! ','2012-02-14 05:29:55','2012-02-14 05:29:55'),(261,18,4,NULL,'Q3','Usually','Always','Usually','Usually','Ezana has made significant improvements since second quarter.  He is not only playing accurate pitches but is engaged and attentive in class.  Keep up the excellent work, Ezana!  ','2012-02-14 05:30:50','2012-02-14 05:30:50'),(262,2545,5,NULL,'Q3','Usually','Usually','Usually','Usually','Christine continues to find chemistry quite challenging but shows a positive attitude. She needs to ensure that she is working on her textbook at home. If she needs clarification on this, or anything that we are doing, she needs to see me ASAP.','2012-02-14 06:47:04','2012-02-14 06:47:04'),(263,2896,5,NULL,'Q3','Usually','Always','Usually','Usually','Wuby continues to find chemistry quite challenging but shows a positive attitude. She needs to ensure that she is working on her textbook at home. If she needs clarification on this, or anything that we are doing, she needs to see me ASAP.','2012-02-14 06:52:34','2012-02-14 06:52:34'),(264,2199,5,NULL,'Q3','Occasionally','Usually','Occasionally','Usually','Prateek often seems to misunderstand what he needs to be doing and as a result doesn\'t always get his work done. If he needs clarification on anything that we are doing, he needs to see me ASAP.','2012-02-14 06:54:44','2012-02-14 06:54:44'),(265,3711,6,NULL,'Q3','Unacceptable','Occasionally','Unacceptable','Usually','Fahreen needs to decide TODAY whether she is going to aim for success of not. If she is willing to put in the work that she needs to do, I will support her every step of the way. I believe she has the potential to be successful with her IB certificate for chemistry, but it will require her to organize her time and use every resource to its fullest. Most recently,I have given Fahreen a revision folder that should help her to learn effectively, but it will only work if she uses it, putting time and effort into every part.','2012-02-14 07:48:08','2012-02-14 07:48:08'),(266,3378,6,NULL,'Q3','Occasionally','Usually','Usually','Usually','When Kaleab and I discussed his decision to take higher level chemistry last year, I don\'t think he believed how much work it would take to be successful. I think he realizes this now. Therefore, I am looking forward to supporting his efforts over the next few weeks so that he can be successful. I have recently given him a revision folder, which will help him to organize his time and actions. He needs to begin studying hard NOW and collaborating with me more to ensure efficient and effective use of his time.','2012-02-14 07:52:43','2012-02-14 08:01:46'),(267,3619,6,NULL,'Q3','Unacceptable','Occasionally','Unacceptable','Usually','Julia put in a lot of time and effort to complete her labs, and did so to a high standard. Now she needs to decide what she will do about her final exams. When Julia decided to take IB chemistry, I don\'t think she believed how much work it would take to be successful. I think she realizes this now. However, I think she has also decided to try to make it go away by ignoring it. \r\nIf Julia begins studying hard NOW and collaborating with me more to ensure efficient and effective use of her time, I truly believe she will be successful.  I have recently given her a revision folder, which will aid her to organize her time and actions, but only if she actually uses it!','2012-02-14 08:01:32','2012-02-14 08:01:32'),(268,3022,5,NULL,'Q3','Usually','Usually','Occasionally','Usually','Mikko needs to develop a routine whereby he studies chemistry \"little and often\". This course is challenging, but he will be successful if he changes his habits now. I would expect him to spend 30 minutes to an hour everyday, and he should collaborate with me on how to use his time.','2012-02-14 08:06:37','2012-02-14 08:23:35'),(269,3227,5,NULL,'Q3','Usually','Usually','Occasionally','Always','Mikeal needs to develop a routine whereby he studies chemistry \"little and often\". This course is challenging, but he will be successful if he changes his habits now. I would expect him to spend 30 minutes to an hour everyday, and he should collaborate with me on how to use his time.','2012-02-14 08:07:18','2012-02-14 08:23:19'),(270,2899,5,NULL,'Q3','Usually','Usually','Usually','Usually','Anirudh needs to develop a routine whereby he studies chemistry \"little and often\". This course is challenging, but he will be successful if he changes his habits now. I would expect him to spend 30 minutes to an hour everyday, and he should collaborate with me on how to use his time.','2012-02-14 08:08:10','2012-02-14 08:22:18'),(271,2933,5,NULL,'Q3','Always','Always','Usually','Always','Ivan needs to develop a routine whereby he studies chemistry \"little and often\". This course is challenging, but he will be successful if he changes his habits now. I would expect him to spend 30 minutes to an hour everyday, and he should collaborate with me on how to use his time.','2012-02-14 08:08:57','2012-02-14 08:22:00'),(272,3238,5,NULL,'Q3','Usually','Always','Usually','Always','Kuki needs to develop a routine whereby she studies chemistry \"little and often\". This course is challenging, but she will be successful if she changes her habits now. I would expect her to spend 30 minutes to an hour everyday, and she should collaborate with me on how to use her time.','2012-02-14 08:09:56','2012-02-14 08:22:32'),(273,3167,5,NULL,'Q3','Usually','Always','Usually','Always','Logan needs to develop a routine whereby he studies chemistry \"little and often\". This course is challenging, but he will be successful if he changes his habits now. I would expect him to spend 30 minutes to an hour everyday, and he should collaborate with me on how to use his time.','2012-02-14 08:10:40','2012-02-14 08:22:56'),(274,2340,5,NULL,'Q3','Usually','Usually','Occasionally','Usually','The reason I am sending this progress report to Deborah is to remind her that if she collaborated more with me after school, she would be able to make effective and efficient use of her time and be more successful.','2012-02-14 08:15:17','2012-02-14 08:15:17'),(275,2000,5,NULL,'Q3','Usually','Usually','Usually','Usually','Bethel has shown increased motivation this quarter. She has been attending extra help sessions regularly after school on Mondays. This extra time is helping her to consolidate the work from class. She has also retaken 2 assessments and brought some of her benchmark scores up to a 4. \r\nKeep up the hard work, Bethel. You perseverance will bring increased achievement. \r\nFiona Thangata.','2012-02-14 09:07:06','2012-02-14 09:07:06'),(276,1312,5,NULL,'Q3','Usually','Usually','Usually','Always','Ammr has shown increased motivation in his own learning this quarter. He now attends regular after school extra help sessions on a Friday. This extra time to ask questions, consolidate the work from class, and the opportunity to revisit skills and concepts will be of benefit to Ammr. He has managed to bring some of his benchmark scores up to a 4 from a 3.  \r\nKeep up this extra work, Ammr! You will see increased achievement. \r\nFiona Thangata','2012-02-14 09:17:50','2012-02-14 09:17:50'),(277,1427,5,NULL,'Q3','Usually','Usually','Usually','Always','I am pleased that Jo has taken more responsibility for his own learning this quarter. He now attends regular after school extra help sessions on a Friday. This extra time to consolidate the work from class, and the opportunity to ask questions outside of the larger class setting will be of benefit to him. Jo also impressed me with his participation when the class was smaller in size due to the grade level trip. He voluntarily contributed to the mathematical discussion, offering good mathematical observations. Keep up the effort, Jo. You will see increased achievement. \r\nFiona Thangata','2012-02-14 09:24:25','2012-02-14 09:24:25'),(278,1728,5,NULL,'Q3','Usually','Usually','Usually','Always','DJ has taken more responsibility for his own learning this quarter and he now attends regular after school help sessions on a Friday. This extra time to ask questions, consolidate the work from class and revisit skills and concepts will be of benefit to him. He has also retaken 2 assessments and has succeeded in bringing some of his benchmarks up to a 4 from a 3. Keep up this hard work, DJ! Your increased effort will bring increased achievement. \r\nFiona Thangata','2012-02-14 09:31:36','2012-02-14 09:31:36'),(279,2650,5,NULL,'Q3','Usually','Usually','Usually','Usually','Rawan has been working hard this quarter. She has shown interest in the topics she has worked on, particularly quadratic equations and graphs. She has been able to achieve quite well in tests and quizzes, but with considerable support. Rawan now needs to work on reviewing her notes and consolidating her learning so that her new knowledge is retained, and so that she can achieve more independently without relying on help from me. Keep up this effort, Rawan. You will see increased achievement as a result of your efforts. \r\nFiona Thangata','2012-02-14 09:44:34','2012-02-14 09:44:34'),(280,1112,13,NULL,'Q3','Usually','Usually','Usually','Usually','Jarrah is continuing to make steady progress with his work in Maths. He has now successfully completed several of the multiplication tables. He was also successful in learning how to identify and plot coordinates in the 4 quadrants (positive and negative integers). Jarrah should continue to practice and consolidate the skills and concepts he has learned so that he does not forget them. \r\nFiona Thangata','2012-02-14 09:57:50','2012-02-14 09:57:50'),(281,1372,5,NULL,'Q3','Usually','Usually','Usually','Usually','Seema\'s work has been rather patchy this quarter so far. Sometimes, her work is of a good standard and she is engaged in her learning, and she participates in class. This was particularly noticeable during the week when we had a smaller class due to the grade level trip, when Seema contributed actively to the mathematical discussions. However, at other times, Seema tends to opt out of class participation and asking questions in class to check her understanding, and this hinders her learning. I would encourage Seema to take more responsibility for her own learning in the classroom, and to come after school for extra help when she feels she needs some assistance. \r\nFiona Thangata','2012-02-14 10:12:31','2012-02-14 10:13:30'),(282,1968,5,NULL,'Q3','Usually','Occasionally','Usually','Usually','Momodou is still failing to achieve passing grades on several assessment criteria. His continued reluctance to write down structured solutions to problems mean that he is unable to apply learned methods to complex problems. A lack of focus and some immature behavior during lessons has not helped him.\r\nIf he hopes to achieve a better grade at the end of this semester he MUST take on board advice I have given him. In particular he needs to spend some time learning proper written methods for solving both equations and inequalities.','2012-02-15 09:19:52','2012-02-15 09:19:52'),(283,3298,5,NULL,'Q3','Usually','Usually','Occasionally','Usually','Nick began this semester very well. In the first unit (2-variable statistics) he showed good analysis skills and also worked hard to learn the complex GDC techniques involved; he passed this unit well, with a grade of 5. However he is continuing to let himself down by not submitting HW assignments, and by not coming for extra help when there is something that he does not understand.  Consequently he achieved only a low 3 in the recent Algebra unit (involving skills that will underpin many future units in this two-year course). He MUST confront the topics he does not understand and overcome problems that I suspect have always haunted him in maths!  ','2012-02-15 09:25:52','2012-02-15 09:27:02'),(284,1799,5,NULL,'Q3','Always','Always','Always','Always','As the level of difficulty in this course has increased, Stephen has been having more problems. I am worried that although he is putting in very good effort, and participating well during lessons, he is struggling to grasp new concepts, and apply them in later questions. In the first unit this semester (Equations of Linear Graphs) he scored a 3, showing some, but not full, understanding of each of the concepts tested. More recently his assessment on Inequalities and Absolute Value highlighted many weaknesses in his basic algebra, resulting in a score of just 2. I do worry that there are gaps in his prior knowledge that are making it almost impossible for him to fully grasp, and hence retain, new skills and concepts.','2012-02-15 09:33:05','2012-02-15 09:34:29'),(285,2375,5,NULL,'Q3','Usually','Always','Occasionally','Occasionally','I am concerned at the \"downhill\" trend that I am seeing. After a very good first semester, Yohannes has made a very disappointing start to this one. Frequently arriving late to class means that he is not fully engaged when I start teaching; he is also failing to complete HW assignments, and hence is unprepared for new learning. As a result he has performed poorly in assessments (a 2 in Equations of Linear Graphs, followed by a slightly better 3 on Inequalities). He was offered extra help after the first test, but declined, preferring to study himself for a retest. The consequent retest showed, if anything, a worse performance! I would like to see a return of the old Yohannes please!','2012-02-15 09:40:25','2012-02-15 09:40:25'),(288,1108,16,NULL,'Q3','Occasionally','Usually','Unacceptable','Usually','Jarrah continues to struggle in reading and writing. Â He needs to focus on building his basic skills and confidence in both areas.Â  To support his learning and progression in reading and writing, Jarrah should come to class prepared and follow the task at the start of each class.Â  These are steps that will help him improve his reading and writing abilities. Â  ','2012-02-16 13:01:16','2012-02-21 10:19:29'),(289,702,16,NULL,'Q3','Usually','Always','Usually','Always','Kaleb has struggled with the concept of theme and the construction of theme paragraphs.  He needs to take advantage of the chances to re-do work in order to improve.  Kaleb often does not address the feedback given to him.  If he does not understand the feedback or how to improve he needs to meet with me during breaks or after school in order for me to help him understand.  ','2012-02-16 13:02:26','2012-02-21 10:20:07'),(290,946,16,NULL,'Q3','Occasionally','Usually','Occasionally','Always','Theo has struggled with the concept of theme and the construction of theme paragraphs.  He needs to take advantage of the chances to re-do work in order to improve.  Theo often does not address the feedback given to him.  If he does not understand the feedback or how to improve he needs to meet with me during breaks or after school in order for me to help him understand.  Theo is not always prepared for class.  We will shortly begin a novel study in class which will require Theo to read and prepare for class at home.  If he has not completed the homework he will not be able to participate in the class activities and this will greatly affect his learning in ELA.','2012-02-16 13:03:13','2012-02-21 10:20:36'),(291,821,16,NULL,'Q3','Occasionally','Usually','Occasionally','Always','Tomas has struggled with the construction of theme paragraphs.  He needs to take advantage of the chances to re-do work in order to improve.  Tomas often does not address the feedback given to him.  If he does not understand the feedback or how to improve he needs to meet with me during breaks or after school in order for me to help him understand.  Tomas is not always prepared for class.  We will shortly begin a novel study in class which will require Tomas to read and prepare for class at home.  If he has not completed the homework he will not be able to participate in the class activities and this will greatly affect his learning in ELA.','2012-02-16 13:03:46','2012-02-21 10:21:05'),(292,1155,16,NULL,'Q3','Usually','Always','Occasionally','Always','Uakuu has struggled with the concept of theme and the construction of theme paragraphs.  He needs to take advantage of the chances to re-do work in order to improve.  Uakuu often does not address the feedback given to him.  If he does not understand the feedback or how to improve he needs to meet with me during breaks or after school in order f