s struggled somewhat with the construction of theme paragraphs.  He needs to take advantage of the chances to re-do work in order to improve.  Thuso often does not address the feedback given to him.  If he does not understand the feedback or how to improve he needs to meet with me during breaks or after school in order for me to help him understand.  Thuso is not always prepared for class.  We will shortly begin a novel study in class which will require Thuso to read and prepare for class at home.  If he has not completed the homework he will not be able to participate in the class activities and this will greatly affect his learning in ELA.','2012-02-16 13:05:41','2012-02-21 10:23:56'),(296,933,16,NULL,'Q3','Usually','Always','Usually','Always','Rishabh has struggled somewhat with the construction of theme paragraphs.  He needs to take advantage of the chances to re-do work in order to improve.  Rishabh often does not address the feedback given to him.  If he does not understand the feedback or how to improve he needs to meet with me during breaks or after school in order for me to help him understand. ','2012-02-16 13:06:18','2012-02-21 10:22:58'),(297,101,16,NULL,'Q3','Usually','Always','Occasionally','Usually','Abdu still regularly comes to class without a pencil or other necessary materials.','2012-02-16 13:19:11','2012-02-21 10:24:41'),(298,230,16,NULL,'Q3','Usually','Always','Occasionally','Usually','Ahmed still regularly comes to class without a pencil or other necessary materials.','2012-02-16 13:19:28','2012-02-21 10:25:03'),(299,668,16,NULL,'Q3','Usually','Always','Always','Always','Annmarie has made much progress in her math skills this year.  She does continue to struggle with some concepts.  Earlier in the year Annmarie met me for extra help after school with good results.  It would be helpful to have one day a week after school when Annmarie is scheduled to meet with me.  Perhaps she will not need it every week, but a regular check in meeting after school could be very useful in catching misunderstandings early and providing the one on one support to continue gaining math skills and concepts.  I am free any day except Wednesday.','2012-02-16 13:19:54','2012-02-21 10:25:44'),(300,650,16,NULL,'Q3','Usually','Always','Usually','Always','Henry has struggled with fractions during the last unit.  He has made progress and is approaching standards.  However Henry does not ask for help when he doesn\'t understand in class.  It would be helpful to have one day a week after school when Henry is scheduled to meet with me.  Perhaps he will not need it every week, but a regular check in meeting after school could be very useful in catching misunderstandings early and providing the one on one support to continue gaining math skills and concepts.  I am free any day except Wednesday.','2012-02-16 13:20:11','2012-02-21 10:26:10'),(301,1428,16,NULL,'Q3','Occasionally','Always','Occasionally','Usually','Joe\'s motivation and preparation for class have decreased in the past few weeks.  Joe does not complete all his homework on time, and does not do his best work every time.  ','2012-02-16 13:20:45','2012-02-21 10:26:48'),(302,2825,2,NULL,'Q3','Occasionally','Occasionally','Usually','Occasionally','','2012-02-19 09:57:37','2012-02-19 09:57:37'),(303,1925,5,NULL,'Q3','Occasionally','Usually','Occasionally','Always','','2012-02-20 08:02:46','2012-02-20 08:02:46'),(304,98,4,NULL,'Q3','Occasionally','Usually','Occasionally','Always','Aburrahim participates well in class. However, he tends to finish his assignments quickly and makes a lot of mistakes. I encourage him to take his time in order to review his works before handing them in or presenting them orally.This will help him improve his oral and written skills.','2012-02-20 08:13:33','2012-02-21 04:57:10'),(305,228,4,NULL,'Q3','Occasionally','Usually','Occasionally','Always','Ahmed participates well in class. However, he tends to finish his assignments quickly and makes a lot of mistakes. He is sometimes easily distracted in class. I encourage him to take his time in order to review his works before handing them in or presenting them orally. This will help him improve his writing and oral skills.','2012-02-20 08:15:08','2012-02-21 04:58:15'),(306,637,5,NULL,'Q3','Usually','Usually','Usually','Always','Kip, really tries to do his best in Advanced French. \r\nIn his writing, Kip tries to organize his writing skills, and focus on the topics.\r\nThe spelling is better but needs more improvement.\r\nI would like to encourage kip to continue\r\nhis effort and good participation.\r\n\r\n \r\n','2012-02-20 08:17:36','2012-02-20 08:17:36'),(307,2568,5,NULL,'Q3','Usually','Always','Always','Always','','2012-02-20 08:19:31','2012-02-20 08:19:31'),(308,2287,5,NULL,'Q3','Occasionally','Usually','Always','Always','','2012-02-20 08:20:30','2012-02-20 08:20:30'),(309,163,5,NULL,'Q3','Usually','Always','Occasionally','Usually','Bamlak needs to participate more in class. He also needs to practice regularly what he learns in class in order to improve his writing skills. I encourage him to ask questions in class and also to come and work with me after school.','2012-02-20 08:22:33','2012-02-21 04:59:25'),(310,376,4,NULL,'Q3','Occasionally','Usually','Usually','Always','Sidney understands very well what he learns in class. However, his effort has reduced this quarter. He is easily distracted. I encourage him to focus and participate more in class.','2012-02-20 08:28:44','2012-02-20 08:28:44'),(311,77,5,NULL,'Q3','Usually','Usually','Occasionally','Always','Martin has to continue his effort in French Advanced.\r\nHe has to produce works more consistent\r\nand focus on the rubrics and topics.\r\nThe French spelling is  better but needs more improvement.\r\nA good organization of his documents  should help him to produce a better work.\r\n','2012-02-20 08:35:22','2012-02-21 04:58:08'),(312,3465,4,NULL,'Q3','Usually','Always','Occasionally','Always','Abel is dong much better academically. However if he raises his effort a bit more, he can do very well in Physics. He knows that his internal assessment score for IB is not satisfactory at all. However, he has not seized any opportunity to hand in better lab reports even when such opportunities were provided throughout the year.','2012-02-20 09:21:20','2012-02-20 09:21:20'),(313,3704,5,NULL,'Q3','Occasionally','Occasionally','Unacceptable','Always','David does not realize that he still has time to improve his academic achievement level to an easy \"4\" for IB if he puts in a dedicated effort. However, he seems to have completely given up as far a Physics is concerned. I have asked him to utilize his study hall or his after school time for doing some reviews with me. However, he prefers not to take this opportunity.','2012-02-20 09:22:45','2012-02-20 09:22:45'),(314,3546,5,NULL,'Q3','Always','Always','Usually','Always','Nicolas is great with handing in all the assignments on time. However, the quality of these assignments are mediocre especially when it comes to the lab reports. The practical work makes up 24% of his IB grade. However, he has not been able to raise this score even after continuous feedback and opportunities were provided. ','2012-02-20 09:23:56','2012-02-20 09:23:56'),(315,3520,5,NULL,'Q3','Usually','Always','Usually','Always','Nomolelo\'s continues to put in good effort in class. However, the recent summative assessment shows minimal retention of the concepts learned last year. Therefore, Nomolelo will need dedicated time either during study hall or after school to review the topics covered last year. She understands this and has already been in touch with me. I will start seeing her every Monday (Tuesday if needed) between 3:30 to 4:30 pm starting February 27.','2012-02-20 09:25:11','2012-02-20 09:25:11'),(316,3547,5,NULL,'Q3','Occasionally','Always','Occasionally','Always','Nicolas is struggling with his written analysis.  He must utilize the language of analysis, and Nicolas has notes to assist him.  Nicolas has begun to re-write his work, which is a positive step.','2012-02-20 09:32:23','2012-02-20 09:32:23'),(317,3686,16,NULL,'Q3','Occasionally','Usually','Unacceptable','Unacceptable','Simon has missed many classes and has not completed the work that he missed.  Simon currently has 3 assignments not turned in.  ','2012-02-20 09:33:59','2012-02-20 09:33:59'),(318,3688,4,NULL,'Q3','Usually','Always','Occasionally','Usually','','2012-02-20 09:36:23','2012-02-20 09:36:23'),(319,2265,5,NULL,'Q3','Occasionally','Usually','Occasionally','Usually','Sophi\'s approach to learning has declined this quarter.  Her work is not completed on time or with care.  Sophi needs to manage her time more effectively to complete the work that meets the standards.','2012-02-20 09:36:46','2012-02-20 09:36:46'),(320,2176,5,NULL,'Q3','Usually','Always','Usually','Always','Marlene struggles with reading comprehension and written analysis.  As Grade 9 English becomes more challenging, Marlene needs to use the language of analysis and ask questions for clarification.','2012-02-20 09:39:13','2012-02-20 09:39:13'),(321,2253,5,NULL,'Q3','Occasionally','Usually','Occasionally','Usually','Abelom struggles with reading comprehension and written analysis.  Abelom must engage more in his reading while taking quality notes, then ask questions for clarification.','2012-02-20 09:41:05','2012-02-20 09:41:05'),(322,2377,16,NULL,'Q3','Occasionally','Usually','Unacceptable','Usually','Yohannes does not fully engage in his work out of class.  He struggles with focus and time management; he currently has one assignment not turned in.  Yohannes must improve his reading comprehension and written analysis if he wants to succeed in Grade 9 English.','2012-02-20 09:42:59','2012-02-20 09:42:59'),(323,2086,16,NULL,'Q3','Usually','Occasionally','Occasionally','Usually','Mikael\'s work is incomplete, with one assignment not turned in.  Additionally, Mikael engages fairly well in class, yet his work outside of class lacks focus and depth of analysis.','2012-02-20 09:45:21','2012-02-20 09:45:21'),(324,3639,16,NULL,'Q3','Usually','Occasionally','Occasionally','Usually','Ahmed is missing 3 assignment, resulting in an incomplete.  Ahmed\'s approach to learning is inconsistent; he must engage more frequently with a positive attitude.','2012-02-20 09:58:54','2012-02-20 09:58:54'),(325,3462,4,NULL,'Q3','Usually','Always','Occasionally','Always','Abel is missing one assignment for this quarter. NOW WORK IS TURNED IN. Abel\'s approach to learning must improve in engagement and organizational skills if he is to succeed in Higher Level English.','2012-02-20 10:00:19','2012-02-21 11:26:19'),(326,3263,4,NULL,'Q3','Always','Always','Always','Always','Samrawit needs extra help in this course outside of regular class in order to enhance her understanding about the concepts learned in class. This will help her clarify all her doubts in while getting one on one attention as she seems to be a little uncomfortable asking questions in class. At present she is at the borderline \"4\" which can be easily improved with extra help. ','2012-02-20 10:04:55','2012-02-20 10:04:55'),(327,1218,16,NULL,'Q3','Usually','Always','Always','Always','Ashley is a conscientious student who works hard in class to stay focused and be on task.  Recently, Ashley completed a major assessment for quarter 3 (Chemistry Summative Assessment) and scored a 2.  \r\n\r\nIn analyzing the assessment, it seems that Ashley has trouble with several concepts including determining information from the periodic table and distinguishing between atoms, elements and compounds.\r\n\r\nAshley and her group members did a good job on their project on buckminsterfullerine.  This assignment was created to reinforce concepts learned in class but will not be used as a summative assessment.  It will, however, be included in her quarter 3 effort grade.\r\n\r\nThis chemistry unit is now completed but I am willing to allow Ashley to re-take the Chemistry Summative Assessment if she chooses.  In order to do this, I would require her to meet with me during three after school or morning sessions (30 mins each) so that I can re-teach the concepts. \r\n\r\nA few suggestions for Ashley as we finish the 3rd quarter would be:\r\n\r\n1.  Ask more questions!!!  Be engaged in class and advocate for yourself when you are confused.\r\n\r\n2. Study material in small chunks throughout the quarter; do not wait and \"cram\" for a test.\r\n\r\nI look forward to seeing Ashley for some extra help.\r\n\r\nMs. Fracchia','2012-02-20 11:14:31','2012-02-20 11:14:31'),(328,1226,16,NULL,'Q3','Usually','Always','Usually','Always','Penehafo\'s attitude and work ethic has improved this quarter.  She regularly participates and seems to be more organized.  Recently, Penehafo completed a major assessment for quarter 3 (Chemistry Summative Assessment) and scored a 3.  \r\n\r\nIn analyzing the assessment, it seems that Penehafo has trouble with several concepts including determining information from the periodic table. drawing Bohr atomic models, and distinguishing between atoms, elements and compounds.\r\n\r\nPenehafo did a satisfactory job on her project on silk.  This assignment was created to reinforce concepts learned in class but will not be used as a summative assessment.  It will, however, be included in her quarter 3 effort grade.\r\n\r\nThis chemistry unit is now completed but I am willing to allow Penehafo to re-take the Chemistry Summative Assessment if she chooses.  In order to do this, I would require her to meet with me during three after school or morning sessions (30 mins each) so that I can re-teach the concepts. \r\n\r\n\r\nI look forward to seeing Penehafo for some extra help.\r\n\r\nMs. Fracchia','2012-02-20 11:18:35','2012-02-20 11:18:35'),(330,1796,16,NULL,'Q3','Usually','Always','Always','Always','Stephen is a conscientious student who works hard in class to stay focused and be on task.  