or has trouble with several concepts including determining information from the periodic table, Bohr atomic models and distinguishing between atoms, elements and compounds.  His low grade may have been due to his absence from his football accident.\r\n\r\nThis chemistry unit is now completed but I am willing to allow Victor to re-take the Chemistry Summative Assessment if he chooses.  In order to do this, I would require him to meet with me during three after school or morning sessions (30 mins each) so that I can re-teach the concepts. \r\n\r\n\r\nI look forward to seeing Victor for some extra help.\r\n\r\nMs. Fracchia','2012-02-20 11:42:41','2012-02-20 11:42:41'),(339,899,4,NULL,'Q3','Usually','Usually','Unacceptable','Usually','Kurbell frequently comes to class without a full PE kit.  He is often missing the whole kit or essential items such as athletic shoes, and is therefore unable to participate.  This affects his effort grade in terms of preparation, but if it continues, will also negatively affect his achievement grade, as he is missing large amounts of instructional time.\r\nPlease let me know if there is anything I can do to help.\r\n\r\nRegards,\r\nMs. Brianna Balboni','2012-02-20 11:44:47','2012-02-20 11:44:47'),(340,711,4,NULL,'Q3','Occasionally','Usually','Usually','Usually','Kaleb has significant trouble staying on task in art class.  He is often talkative to the point that his work suffers.  I am concerned that he will fall behind significantly if this continues.  Please let me know if there is anything I can do to help.\r\nRegards,\r\n\r\nMs. Brianna Balboni\r\n\r\n','2012-02-20 11:48:30','2012-02-20 11:48:30'),(341,2263,16,NULL,'Q3','Usually','Usually','Occasionally','Usually','Sophi is a motivated and conscientious math student who tries to be successful.  This quarter, she has missed a few classes and failed to make up the lost time.  I have encouraged her to meet me outside of class to go over what she has missed and she has yet to see me.\r\n\r\nSophi is a forgetful young woman and often comes to class without her book or completed homework.  \r\n\r\nCurrently, Sophi is not meeting standard.  I highly recommend she meets with me regularly on Thursday mornings from 7:30-8:00 to review concepts.  \r\n\r\nMs. Fracchia','2012-02-20 11:56:12','2012-02-20 11:56:12'),(342,2275,16,NULL,'Q3','Usually','Usually','Usually','Always','Leake is a motivated young man who tries to be successful in pre-algebra.  Mathematics is difficult for him and in order for him to meet standard this quarter he must put in more effort.\r\n\r\nLeake and I have decided that we will meet regularly on Thursday mornings to review concepts learned in class.  If Leake can be consistent with his attendance, I believe it will greatly improve his academic success.\r\n\r\nMs. Fracchia','2012-02-20 11:58:12','2012-02-20 11:58:12'),(343,1574,16,NULL,'Q3','Usually','Occasionally','Always','Always','Biram is a motivated student but recently, his behavior has been affecting his ability to succeed in pre-algebra.  Currently, Biram is not meeting standard.\r\n\r\nBiram can improve his academic success by being more focused in class.  He continues to advocate for himself and completes all assigned homework but is often distracted.\r\n\r\nFor your information, all students will return to a stricter assigned seating arrangement this week to improve engagement.\r\n\r\nI will be teaching a Thursday morning review class for the remainder of the quarter from 7:30 to 8:00.  Biram is encouraged to attend.\r\n\r\nThank you,\r\nElizabeth Fracchia','2012-02-20 12:02:02','2012-02-20 12:02:02'),(344,1135,16,NULL,'Q3','Occasionally','Usually','Unacceptable','Usually','Alexandra continues to struggle to turn in assignments on time.  She is regularly unprepared for learning activities in class.  We will shortly begin a novel study in class which will require her to read and prepare for class at home.  If she has not completed the homework she will not be able to participate in the class activities and this will greatly affect her learning in ELA.','2012-02-20 13:22:17','2012-02-21 10:18:57'),(347,2622,16,NULL,'Q3','Always','Always','Always','Always','asfasf sdgsdgsdg','2012-02-20 13:40:37','2012-02-20 13:48:30'),(348,3668,5,NULL,'Q3','Occasionally','Usually','Occasionally','Always','Manisha\'s attention and participation has dropped this quarter. She does not actively participate in class.','2012-02-20 13:58:09','2012-02-20 13:59:28'),(349,2095,5,NULL,'Q3','Occasionally','Usually','Unacceptable','Always','I have talked to Eynaas about her missing/incomplete homework assignments during the course of the quarter. She has recently improved though her effort is inconsistent. She does not spend enough time in reviewing her notes and studying for tests. That has had an impact on her performances in written and listening comprehension assignments in class.','2012-02-20 17:14:38','2012-02-20 17:14:38'),(350,1702,4,NULL,'Q3','Usually','Usually','Usually','Always','Ammanuel\'s reading skills and listening skills are very strong. However, he is easily distracted and tends to miss certain things. I encourage him to focus more and practice what he learns in class in order to improve his writing and oral skills.','2012-02-21 05:06:51','2012-02-21 05:06:51'),(351,2932,3,NULL,'Q3','Usually','Usually','Usually','Usually','','2012-02-21 05:09:45','2012-02-21 05:09:45'),(352,2254,4,NULL,'Q3','Occasionally','Occasionally','Usually','Usually','Abelom has been putting effort into his studies, however with the low level of engagement during class I think he is not going to be able to sustain his current level of achievement over the semester.','2012-02-21 09:15:19','2012-02-21 09:15:19'),(353,2001,5,NULL,'Q3','Occasionally','Occasionally','Unacceptable','Always','Bethel needs to do the following in order to achieve the standard in Modern World History. \r\n1. Organize her school work. This means consistently using one computer and keeping all of her files in folders on that computer. It is not an acceptable excuse to say she cannot save files on her MacBook because of a lack of space and then be able to find the homework on her memory stick or on her Netbook. \r\n\r\n2. Complete assignments using the rubric and directions. Bethel will frequently do her work on time, however, she will not use the rubrics and directions. This means she creates assignments which cannot score well on the criteria given. It would be much better for Bethel if she were to complete only part of an assignment, provided it fit the requirements, rather than her spend time on something which will fail to meet the standard.\r\n\r\n3. Ask questions. Bethel needs to work on asking questions about assignments both in class and outside of class time. This way she can check her understanding of the requirements and expectations. \r\n\r\n4. Be realistic. When Bethel does not complete an assignment or cannot \"find it\", it is better for her to make a realistic plan than one where she ends up failing to meet her own goals. For example, she said she would complete a homework assignment one Friday after school by 7:00pm. Bethel then hung out at school until 6:00pm watching a basketball game with her friends. She did not turn the assignment in when she got home. \r\n\r\nIf you have any questions, please do not hesitate to contact me or arrange a meeting. \r\n\r\nBrian Greenough\r\n913-026-646','2012-02-21 09:41:10','2012-02-21 09:41:10'),(354,1929,16,NULL,'Q3','Usually','Usually','Unacceptable','Always','Bo Sung has shown improvement with his level of engagement however recent formative assessment data has shown more time outside of class needs to be spent reviewing revising biology material.\r\nBosung is also not meeting his obligations as he is now 3 weeks late in turning in 1 lab report.','2012-02-21 09:44:17','2012-02-21 09:44:17'),(355,2124,5,NULL,'Q3','Usually','Usually','Usually','Always','Pride continues to struggle with the concepts in Biology. I recommend supervised study at home for at least 20 minutes per day reviewing and revising the material. ','2012-02-21 09:46:59','2012-02-21 09:46:59'),(356,2019,5,NULL,'Q3','Usually','Usually','Always','Always','Recent Formative assessment data is showing that Ines is not performing at a level I know she is capable of. ','2012-02-21 09:49:32','2012-02-21 09:52:44'),(357,1927,4,NULL,'Q3','Usually','Usually','Occasionally','Occasionally','I am sending this progress report for Bo Sung in order to repeat my message from the quarter 2 progress report. Bo Sung continues to be hit or miss with both formative and summative assignments. His sleeping habits continue to be irregular and he often complains of being tired in class, but also admits to watching movies until very late.\r\n\r\nI am in my classroom two days a week after school where Bo Sung is welcome to come and work and get his homework done in a quiet, supportive environment. \r\n\r\nBrian ','2012-02-21 09:49:47','2012-02-21 09:49:47'),(358,1950,5,NULL,'Q3','Usually','Usually','Always','Always','Recent Formative assessment data is showing that Kareem is not performing at a level I know he is capable of. ','2012-02-21 09:51:14','2012-02-21 09:52:33'),(359,2510,5,NULL,'Q3','Usually','Usually','Occasionally','Usually','Zebib, it is very important that you revise everyday and prepare well for tests. You are focused in class and I can see you working. Spending more time at home revising and preparing well for tests will increase your understanding and score. Please see me for extra help.','2012-02-21 09:56:54','2012-02-21 09:56:54'),(360,2274,4,NULL,'Q3','Always','Always','Usually','Always','Shili continues to be very close to a 3 in class. The first two writings of this semester were poor grades with a 2 and a 3. However, he earned a 4 on his most recent project and based on his in class work, I expect him to get a 4 on the next two projects. However, Shili needs to continue to work to maintain his homework completion and pay attention to the requirements when completing larger projects. If Shili is able to use the requirements and rubrics effectively when working, he will have a good idea of what his performance will be when he submits his work. \r\n\r\nBrian Greenough','2012-02-21 09:57:19','2012-02-21 09:57:19'),(361,3215,5,NULL,'Q3','Usually','Usually','Usually','Usually','Moreetsi, I believe you are capable of so much more. I am hoping this quarter you will come for extra help on a consistent basis so I can answer the questions I know you have. ','2012-02-21 09:58:54','2012-02-21 09:58:54'),(362,3754,5,NULL,'Q3','Usually','Usually','Occasionally','Usually','Robert, I have only seen you once or twice for extra help since the start of this semester. If you come for extra help, I can answer the questions I know you have. You an also increase your understanding and score by revising everyday and preparing well for tests. Please let me know how I can help.','2012-02-21 10:02:11','2012-02-21 10:02:11'),(363,2336,5,NULL,'Q3','Unacceptable','Usually','Usually','Always','Needs to be on task/engaged and focused on assigned learning without teacher influence \r\n\r\nNeeds to exhibits a positive and respectful attitude towards classroom rules and expectations without teacher influence\r\n','2012-02-21 10:41:40','2012-02-21 10:41:40'),(364,1960,3,NULL,'Q3','Occasionally','Occasionally','Usually','Usually','Needs to be focused and engaged on assigned learning without teacher influence\r\n\r\nNeeds to exhibits a positive and respectful attitude towards classroom rules and expectations without teacher influence','2012-02-21 10:44:37','2012-02-21 10:44:37'),(365,2406,4,NULL,'Q3','Occasionally','Usually','Unacceptable','Usually','Needs to be engaged and focused on assigned learning without teacher influence. The level of engagement has dropped a lot starting January\r\n\r\nNeeds to come to class prepared - there were two instances, since the beginning of the year, when she came to class without the necessary uniform\r\n','2012-02-21 10:49:27','2012-02-21 10:49:27'),(366,2282,5,NULL,'Q3','Unacceptable','Unacceptable','Usually','Unacceptable','Needs to be on task/engaged and focused on assigned learning without teacher influence \r\n\r\nNeeds to exhibits a positive and respectful attitude towards classroom rules and expectations without teacher influence\r\n','2012-02-21 10:50:43','2012-02-21 10:50:43'),(367,2374,5,NULL,'Q3','Unacceptable','Unacceptable','Unacceptable','Usually','Needs to be on task/engaged and focused on assigned learning without teacher influence \r\n\r\nNeeds to exhibits a positive and respectful attitude towards classroom rules and expectations without teacher influence\r\n','2012-02-21 10:51:50','2012-02-21 10:51:50'),(368,2267,4,NULL,'Q3','Occasionally','Occasionally','Unacceptable','Usually','Needs to be consistently engaged and focused on assigned learning without teacher influence \r\n\r\nNeeds to come to class prepared - there were three instances, since the beginning of the year, when she came to class without the necessary uniform\r\n','2012-02-21 10:53:42','2012-02-21 10:53:42'),(369,2257,5,NULL,'Q3','Occasionally','Usually','Usually','Usually','Needs to be on task/engaged and focused on assigned learning without teacher influence ','2012-02-21 10:55:32','2012-02-21 10:55:32'),(370,2689,3,NULL,'Q3','Usually','Occasionally','Usually','Always','Needs to exhibits a positive and respectful attitude towards classroom rules and expectations without teacher influence','2012-02-21 11:05:14','2012-02-21 11:05:14'),(371,2799,3,NULL,'Q3','Usually','Unacceptable','Usually','Always','Needs to exhibits a positive and respectful attitude towards classroom rules and expectations without teacher influence','2012-02-21 11:06:07','2012-02-21 11:06:07'),(372,2327,3,NULL,'Q3','Usually','Unacceptable','Usually','Always','Needs to exhibits a positive and respectful attitude towards classroom rules and expectations without teacher influence','20