eds to exhibits a positive and respectful attitude towards classroom rules and expectations without teacher influence','2012-02-21 11:17:22','2012-02-21 11:17:22'),(381,2648,6,NULL,'Q3','Occasionally','Occasionally','Occasionally','Usually','Rawan rarely comes to class prepared. She does often participate in discussions, but her contributions are limited by the fact she often doesn\'t do the assigned reading. Most of her assessments have to be redone because she fails to meet the basic standards on the first attempt. A little effort would go a long way.','2012-02-21 11:20:17','2012-02-21 11:20:17'),(382,1973,4,NULL,'Q3','Usually','Unacceptable','Usually','Usually','Needs to exhibits a positive and respectful attitude towards classroom rules and expectations without teacher influence','2012-02-21 11:20:36','2012-02-21 11:20:36'),(383,3433,6,NULL,'Q3','Usually','Usually','Usually','Usually','I could see that  Solomon has been putting more effort in his Spanish lately. He has been learning more vocabulary and has been submitting homework on time. However, as said previously, Solomon needs to focus his efforts on learning verbs, verb conjugations and sentence structure. This should be done through more practice, flashcards or extra homework. More study time for Spanish will be crucial for Solomon in order to be successful in the subject. ','2012-02-21 11:22:30','2012-02-21 11:22:30'),(384,3433,6,NULL,'Q3','Usually','Usually','Usually','Usually','I could see that  Solomon has been putting more effort in his Spanish lately. He has been learning more vocabulary and has been submitting homework on time. However, as said previously, Solomon needs to focus his efforts on learning verbs, verb conjugations and sentence structure. This should be done through more practice, flashcards or extra homework. More study time for Spanish will be crucial for Solomon in order to be successful in the subject. ','2012-02-21 11:22:52','2012-02-21 11:22:52'),(385,295,5,NULL,'Q3','Usually','Usually','Occasionally','Usually','Enrico has a lot of talent for Spanish and could be successful in this subject. In order to achieve that, he needs to be focused and to practice regularly at home. He needs to pay more attention to verb conjugations and sentence structure. ','2012-02-21 11:27:06','2012-02-21 11:27:06'),(386,2708,4,NULL,'Q3','Occasionally','Occasionally','Usually','Always','Needs to be on task/engaged and focused on assigned learning without teacher influence\r\n\r\nNeeds to exhibits a positive and respectful attitude towards classroom rules and expectations without teacher influence','2012-02-21 11:49:37','2012-02-21 11:49:37'),(387,2958,4,NULL,'Q3','Unacceptable','Occasionally','Occasionally','Occasionally','Phillip could be doing so much better. He knows he is capable of much more. ','2012-02-21 12:00:11','2012-02-21 12:00:11'),(388,2371,5,NULL,'Q3','Always','Always','Usually','Usually','Yohannes found this section of geometry difficult. He needs to come to my Monday after school sessions and get help.','2012-02-21 12:02:31','2012-02-21 12:02:31');
