INSERT INTO `marks` VALUES (1,'7','A consistent and thorough understanding of the required knowledge and skills, and the ability to apply them almost faultlessly in a wide variety of situations. Consistent evidence of analysis, synthesis and evaluation where appropriate. The student consistently demonstrates originality and insight and always produces work of high quality.',NULL,NULL),(2,'6','A consistent and thorough understanding of the required knowledge and skills, and the ability to apply them in a wide variety of situations. Consistent evidence of analysis, synthesis and evaluation where appropriate. The student generally demonstrates originality and insight.',NULL,NULL),(3,'5','A consistent and thorough understanding of the required knowledge and skills, and the ability to apply them in a variety of situations. The student generally shows evidence of analysis, synthesis and evaluation where appropriate and occasionally demonstrates originality and insight.',NULL,NULL),(4,'4','A good general understanding of the required knowledge and skills, and the ability to apply them effectively in normal situations. There is occasional evidence of the skills of analysis, synthesis and evaluation.',NULL,NULL),(5,'3','Limited achievement against most of the objectives, or clear difficulties in some areas. The student demonstrates a limited understanding of the required knowledge and skills and is only able to apply them fully in normal situations with support.',NULL,NULL),(6,'2','Very limited achievement against objectives. The student has difficulty in understanding the required knowledge and skills, and is unable to apply them in normal situations, even with support',NULL,NULL),(7,'1','None of the standards above has been reached.',NULL,NULL),(9,'7M','A consistent and thorough understanding of the required knowledge and skills, and the ability to apply them almost faultlessly in a wide variety of situations. Consistent evidence of analysis, synthesis and evaluation where appropriate. The student consistently demonstrates originality and insight and always produces work of high quality.',NULL,NULL),(10,'6M','A consistent and thorough understanding of the required knowledge and skills, and the ability to apply them in a wide variety of situations. Consistent evidence of analysis, synthesis and evaluation where appropriate. The student generally demonstrates originality and insight.',NULL,NULL),(11,'5M','A consistent and thorough understanding of the required knowledge and skills, and the ability to apply them in a variety of situations. The student generally shows evidence of analysis, synthesis and evaluation where appropriate and occasionally demonstrates originality and insight.',NULL,NULL),(12,'4M','A good general understanding of the required knowledge and skills, and the ability to apply them effectively in normal situations. There is occasional evidence of the skills of analysis, synthesis and evaluation.',NULL,NULL),(13,'3M','Limited achievement against most of the objectives, or clear difficulties in some areas. The student demonstrates a limited understanding of the required knowledge and skills and is only able to apply them fully in normal situations with support.',NULL,NULL),(14,'2M','Very limited achievement against objectives. The student has difficulty in understanding the required knowledge and skills, and is unable to apply them in normal situations, even with support',NULL,NULL),(15,'1M','None of the standards above has been reached.',NULL,NULL),(16,'INC','Incomplete Work.',NULL,NULL),(17,'P','PASS',NULL,NULL),(18,'F','FAIL',NULL,NULL);
